INSERT INTO `quest_offer_reward_locale` VALUES (41767, 'enUS', 'Shinfel cannot be broken at the hands of Mephistroth. Armed with her power and knowledge, the dreadlord would be able to mount a devastating attack against Dreadscar Rift.$B$BA ritual of summoning should be able to summon Shinfel to our side, but we\'ll need to create a powerful anchor.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41768, 'enUS', 'We may have Shinfel in our possession, but her mind remains in the hands of her demon captors.$B$BWhat kind of ancient magic have they cursed her with? I\'ve never seen anything like it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41769, 'enUS', 'That\'s a name I thought I\'d never hear again.$B$BWe may have worked together in the past, but Ritssyn needs to know I\'m not the man I was before.$B$BMy priorities are Marl and this farm.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41770, 'enUS', 'Farseer Nobundo has told me of your plan to save Azeroth. I fear I may be the only zephyr to share your desire.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41771, 'enUS', 'At long last, the Windseeker shall return to to his rightful place as heir to the Throne of Four Winds. This is a glorious day for Skywall!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41772, 'enUS', 'At last you have arrived, Farseer $n.$B$BIt seems our presence in the Firelands has not gone unnoticed.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41773, 'enUS', 'The son of Rhyolith slain by mere mortals? What an ignominious death!$B$BYou have done well, $C. This pleases me greatly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41775, 'enUS', 'The Earthen Ring has come to offer help? This is unexpected... but welcome, nonetheless.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41776, 'enUS', 'At long last, I have returned to Skywall thanks to the help of mortal hands. I owe you a great debt, Farseer.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41777, 'enUS', 'The Twilight\'s Hammer will not soon recover from the damage we\'ve dealt to their numbers this day. It is an honor to battle at your side, Farseer $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41778, 'enUS', 'Success! While their interior decoration sensibilities may differ significantly from those of Dalaran\'s architects, the demon hunters do make an efficient forge.$B$BYou keep the obliterum, $n. I have a feeling you\'ll be needing it eventually.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41780, 'enUS', 'This looks like everything I need. Just give me a moment to mix it all together.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41781, 'enUS', 'I can see all my goats have been accounted for.$B$BNow, let\'s see if we can do something about that curse.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41782, 'enUS', 'Excellent! We will need this water to enter the Emerald Dream, but first we need to address the magical wards that protect the claws.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41783, 'enUS', 'Yes, this should work!$B$BI hate rummaging through the pockets of the dead but we need them more than they do.$B$BNow, let\'s begin.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41784, 'enUS', 'Killing a demon isn\'t always the answer. Sometimes, the solution is to control one, or two as the case may be.$B$BIf we can summon the sisters and bend their will to ours, it will deliver a devastating blow to Mephistroth\'s forces and rid Shinfel of her curse.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41785, 'enUS', 'You\'re the council\'s new leader, aren\'t you? I could tell by your weapon. I bet you have an amazing story to tell about how you got it.$B$BMy name\'s Lulubelle, or Lulu for short. But, uh... I\'d appreciate if you didn\'t mention to anyone that you saw me, ok?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41787, 'enUS', 'Thank you, $n.$B$BYour willingness to help an outcast will not be forgotten.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41788, 'enUS', 'This writing is a bit difficult to decipher, but I think all the pertinent information is included.$B$BArmed with this confession, I should be able to prove my innocence and focus on more pressing matters.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41790, 'enUS', 'You are powerful indeed, but strength alone will not impress me.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41791, 'enUS', 'Well done, $n. You handled yourself with honor!$B$BYou\'ve done well so far, yet a single trial remains before I will give you my blessing.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41792, 'enUS', 'You have passed every trial I\'ve placed before you and emerged victorious. You are worthy indeed of my brother\'s legacy, and have earned my blessing!$B$BGo, seek out the claws and claim them as your own.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41793, 'enUS', 'With Lulubelle\'s assistance, we should be able to complete the summoning.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41795, 'enUS', 'You did it, $n. The demon twins are under your control.$B$BI have not witnessed such power since the fall of Ragnaros.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41796, 'enUS', 'And so the choice is made.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41797, 'enUS', 'Excellent. These troops will be invaluable in our defense of the Broken Isles. Deploy them on missions, just as you would with our champions.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41798, 'enUS', 'I\'m here to help build you an army, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41799, 'enUS', 'These shadows of the spirit realm grow stronger. I fear they may soon pierce the veil into our reality.$B$BI pray restoring the wards will set things right.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41800, 'enUS', 'Huln battled the Necrodark?$B$BThere are so many tall tales attributed to Huln that I assumed those drogbar to be just another story. But it is clear they served the Darkness.$B$BA troubling discovery... but there is no time to dwell on it now.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41802, 'enUS', 'Alright, let\'s see what ye brought me.$B$B<Brann examines the disc pieces.>$B$BWell look at this? There\'s a piece o\' somethin\' fel here. I betcha that\'s what was causin\' all those imps ta show up \'round here.$B$BI\'ll give it to ya to dispose of, or do whatever it is ye do with things like that.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41803, 'enUS', 'It\'s good to see you again. If there\'s anything I can do to help you take the fight to the Legion, just let me know.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41804, 'enUS', 'No need to thank me, just promise you won\'t accidentally blow anything up in the city; our repair bills are already astronomical.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41806, 'enUS', 'Did the Archmage have anything of use?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41807, 'enUS', 'Not good... not good at all.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41815, 'enUS', 'Mayla charged ahead with Ebonhorn. Now they\'re cut off from the rest of us.$B$BThis is bad, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41834, 'enUS', 'That mask suits you.$B$BIn Suramar, it can be quite advantageous to be someone else for a time...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41840, 'enUS', 'Perfect timing, $n. These shards will prove very useful in what I\'m about to do.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41841, 'enUS', 'We failed! The ward is shattered.$B$BI sense the Darkness rising...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41849, 'enUS', 'They made you Grandmaster, eh? Well, I was busy anyway!$B$BAnyway, I managed to escape from those fel-drinking dirt-kickers across the road, but our own are still in trouble.$B$BThose Legion worms are goin\' ta sacrifice the prisoners for their souls.$B$BWe\'ve got ta help them!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41850, 'enUS', 'Good, ye did it. Sylara is worth ten well-trained monks.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41851, 'enUS', '<Sylara bows deeply.>$B$BWell fought.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41852, 'enUS', 'Good work, Grandmaster!$B$BThat should be all of them.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41853, 'enUS', 'Ahhh, tanks be to ya for freein\' me. I thot I was demon-food for sure.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41854, 'enUS', 'This is fantastic news, $n!$B$BNot only have you disrupted the Legion\'s plans, but you\'ve saved the lives of numerous people.$B$BIn addition, you rescued three of the greatest monks we\'ve trained in recent history.$B$BThe order is indebted to you once again.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41863, 'enUS', 'What of the others? Did they...?$B$BI see. They gave their lives for a worthy cause - the Warblades will change the tide of this war, mark my words.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41877, 'enUS', 'I hope you have prepared yourself to enter the City. It is time.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41878, 'enUS', 'Let\'s get started, shall we?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41882, 'enUS', 'Well done, $n. If left unchecked, the whispers can turn even the best of friends against one another.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41884, 'enUS', 'The spirits hold many truths, $n.$B$BWalking in their footsteps may reveal the locations of Ebonhorn\'s wards.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41888, 'enUS', 'I did not think that I would live to see the day when the four great Elemental Lords would unite with the mortal races of Azeroth.$B$BYou have done what no other Farseer has done in the history of the Earthen Ring.$B$BThis is truly a day that will be remembered for generations!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41889, 'enUS', 'Is there anything we can\'t do? I\'m starting to think not!$B$BI\'ll make sure this barding gets to Mei. You hold on to the pattern and maybe you can make some profit with it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41890, 'enUS', 'He is still alive, but the rest remains to be seen. For your sake, let us pray that he is unharmed.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41893, 'enUS', 'My sight fades, but I am glad that he rests.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41897, 'enUS', 'If The Master is not stopped, the Twilight\'s Hammer will have all the power they need to conquer Deepholm and enslave the elements!$B$BWe must not allow that to happen.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41898, 'enUS', 'The servants of Therazane are free and the dark rituals of subjugation have been halted... for now.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41899, 'enUS', 'The captives have been set free, but there is still much more to be done if we are to dismantle the Twilight\'s Hammer cult...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41900, 'enUS', 'It is good to see you safely back, Farseer. With Therazane\'s allegiance, we now have three of the Elemental Lords united to our cause.$B$BHowever, one still remains...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41901, 'enUS', 'The Windlord has pledged to aid The Earthen Ring in the war against the Burning Legion?$B$BThis is fortuitous news indeed!$B$BStill, there is little time for celebration, much remains to be accomplished.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41905, 'enUS', 'Your champion moved swiftly, $n! This report clearly indicates that Tian Monastery is under attack!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41907, 'enUS', 'Ah, yes yes yes! High Elder Cloudfall was right to send you to me.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41909, 'enUS', 'Excellent. It will be extremely dangerous to infiltrate the Gates, but with this information, we will know exactly the enemy\'s location and numbers.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41910, 'enUS', 'This water is filtered from only the freshest fallen snow every winter, and is a vital ingredient to our brew!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41911, 'enUS', 'Mmmm, just smell those hops! This will be a good batch, I just know it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41915, 'enUS', 'Well well, looks like that old fool finally met his match?$B$BIt looks like the Promenade is in need of a new jeweler, and I think I have learned all I could from my former master.$B$BHere is something for your efforts.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41916, 'enUS', 'Our strength grows and our enemies wane. We will win this fight, $n!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41918, 'enUS', 'So, Xavius is behind this. A thousand deaths isn\'t enough of a punishment for that defiler!$B$BBut, you have returned with the claws, that is not an accomplishment that even I could have performed.$B$BYou are truly the hero we need to face the Legion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41919, 'enUS', '<Valeera glances in your direction.>$B$BAny luck?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41920, 'enUS', 'Val\'zuun actually kept his end of the bargain... I\'m impressed.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41921, 'enUS', 'It was a ruse?!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41922, 'enUS', 'He\'s lying again, I know it... but he might be our only option.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41924, 'enUS', 'I knew you\'d succeed, $n. I\'m glad you\'re on our side.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41934, 'enUS', 'I see that you have successfully awakened Emberscar, and that it has been well-fed.$B$BPerhaps you are stronger than I first thought...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41945, 'enUS', 'Most excellent, Grandmaster! The mission was a success. Our new teacher, Recruiter Tianji, is getting situated as we speak.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41946, 'enUS', 'Excellent. These troops will be invaluable in our defense of the Broken Isles. Deploy them on missions, just as you would with our champions.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41957, 'enUS', 'Thank you for arriving in such haste, Brother.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41966, 'enUS', 'I... I owe you my life, brother, but that look on your face tells me you\'re here for something else.$B$B<You tell Barrem about his mentioning of T\'uure in his sleep.>$B$BI must have been dreaming of Alora, she was my cell mate in that accursed world the demons took me to. She told me she saw the crystal but never said much else.$B$BI just hope she is still alive.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41967, 'enUS', 'I felt my soul being ripped from my body. If you hadn\'t come when you did... I don\'t even want to think about it!$B$BIs there anything I can do to repay you? I owe you my life after all.$B$B<You mention to her Barrem\'s story.>$B$BBarrem still lives too? Oh thank the light! Yes, I\'ll gladly tell you everything I know.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41989, 'enUS', 'Thank you. Now our work can begin.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (41993, 'enUS', 'You seek a demon with a staff of crystal? The Eredar that calls itself Lady Calindris has one that matches your description perfectly.$B$BShe\'s MY prey though! I\'ve been chasing her minion all over the isles and I\'m not about to let this opportunity pass.$B$BI could use someone to watch my back though. If you help me out I\'d be willing to let you take this staff you seek. I don\'t care about her equipment, it\'s her soul that I\'m after.$B$BWell, what do you say?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42000, 'enUS', 'I\'m glad yer coming. I\'ve been wanting to pursue this for some time now. With help from the Seers, I think it can be done!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42001, 'enUS', 'So you seek Aluneth? A dangerous weapon, to be sure.$B$BLong ago the Kirin Tor entrusted the blue dragonflight with its safekeeping. It was locked away in the only place that could contain its rampant power - the Nexus Vault.$B$BI have not been there in some time, however. After the blue dragonflight was dissolved, the Nexus was all but abandoned. There is no knowing whether the Nexus Vault is still intact - or what may be waiting in the Nexus itself.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42002, 'enUS', 'I trust the journey wasn\'t too long or hard.$B$BLet\'s go find our dead adventurer, eh?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42005, 'enUS', 'I think I already have a lead on that island. Word around the tavern was a great warrior had broken into a vrykul king\'s tomb on an island in Stormheim.$B$BThat\'s got to be the one we\'re looking for!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42006, 'enUS', 'This appears to be a communication device commonly utilized by the ethereals.$B$BPerhaps it could be the key to finding out who is behind the happenings at the Dragonshrine.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42011, 'enUS', 'You have my gratitude for saving Azuregos, $n. I can rest easy knowing that the Nexus is under his care.$B$BAs for you, I can see you\'re full of surprises. Never in my time have I seen a $C who can control the chaotic energies of Aluneth. $B$BThank you for what you have done for me and my kind today. You are truly the hero we need to face the Legion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42017, 'enUS', 'I am heartened that your quest was a success, $n. We have been awaiting your return.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42031, 'enUS', 'You were just with Naralex? What were the results of the sampling?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42032, 'enUS', 'Our champions returned from Shaladrassil just moments ago, Archdruid. The journey was a great success!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42033, 'enUS', 'I\'m glad you are here, $n, but if only we had arrived earlier! This place was in chaos when I arrived.$B$BThe survivors claim they were attacked by satyr, but how can this be? No satyrs have roamed these woods since ancient times.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42034, 'enUS', 'The satyr have never been this bold, or powerful. They took us completely by surprise, and our magic could not withstand their attacks. Without you, I would not have survived.$B$BI have only one purpose now - to recover that idol.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42035, 'enUS', 'Look what we dragged in.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42036, 'enUS', 'The Idol... so relieved am I to see it in your hands, $n.$B$BWe will keep it here at the Dreamgrove for safekeeping.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42037, 'enUS', 'Good, the druids have gathered. Even now, they should be flocking to Nordrassil to prepare for the ritual.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42038, 'enUS', 'I have seen enough of the Nightmare to know that it is not an idle threat. Within its grasp, even the strongest become their own worst enemies.$B$BYou, however, have displayed courage and fortitude even in the face of this great danger. I feel faith that you will lead us to victory against our enemy.$B$B$n, I wish to pledge my loyalty in service of you and the druidic order', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42039, 'enUS', '$n, I owe you my life. Your actions gave me a second chance, and it is a chance I have no intention of squandering.$B$BWith your help, we were able to recover the Idol of the Wild. Such a sacred relic would have been a devastating loss had it fallen into the wrong hands.$B$BNow, I will see this journey through to its end.$B$BLet me fight for you. If there is anyone who can defeat the Nightmare, I believe it is you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42040, 'enUS', 'Something isn\'t right here, $n. This isn\'t the Dream. Could Xavius\' creatures have invaded our sanctuary? How did they get past our protective wards?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42041, 'enUS', 'Good, I already feel the Nightmare\'s power waning.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42042, 'enUS', 'Yay, they\'re saved! Thank you!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42043, 'enUS', 'Excellent work, $n. I knew that Elune\'s power could purify the nightmare\'s taint. Her blessing is strong here.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42044, 'enUS', 'Today I grieve for a fallen ally, one who has wandered these forests for eons.$B$BHe can now be at peace, knowing he gave his life to protect this sacred place.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42045, 'enUS', 'My grandfather, Malorne, the ancient god of the wilds himself... long have I wished for this day, only to find that he is in great peril.$B$BIf he is trapped in the Nightmare, then what hope remains for the rest of us?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42046, 'enUS', 'Thank you for all of your heroic efforts, great $C. Without your help, we could not have recovered the Idol and spoken to Malorne himself.$B$BNow that we know he is trapped in the Nightmare, we can devise a plan.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42047, 'enUS', 'I have served the wilds for as long as I can remember, mentoring young druids and watching them grow in knowledge and experience.$B$BThere are few who have ascended to the rank of archdruid, but I believe you can become one of our best.$B$BI would be honored to follow your leadership of the grove.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42048, 'enUS', 'Oh, hi $n! My woodland friends just couldn\'t stop talking about you after you left, and it was they who convinced me to come find you here!$B$BA noble $C with your courage and kindness just doesn\'t come along every day.$B$BThis is going to be SO much fun, don\'t you think?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42049, 'enUS', 'Excellent. These shards are positively surging with negative energy. Be careful when touching them, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42050, 'enUS', 'Well chosen. The others will aid me in defending here. We must hurry.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42051, 'enUS', 'Do not be deceived, $n. What appears to be the mountains of Hyjal, is in fact an illusion created by our enemy.$B$BThis is a re-creation of the darkest nightmare in Malorne\'s mind. This is the War of the Ancients, a battle that occurred thousands of years ago.$B$BIt was during this war that Azeroth was first threatened by the Burning Legion, and the War in which Malorne and the Wild Gods fell.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42053, 'enUS', 'You lead us to triumph today, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42054, 'enUS', '<Malorne gazes directly at you. Radiant, soothing energy exudes outward from his body. Suddenly, you feel a serene sense of peace and gratitude envelop your entire being.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42055, 'enUS', '$n, we elders of the Dreamgrove have spoken and all agree. We would like to see you take leadership of the Dreamgrove.$B$BToday, we grant you the title of Arch $C of the Dreamgrove, a nomination of the highest honor in our order.$B$BWith it, you now carry the responsibility of our order: to protect the wilds! Lead well, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42056, 'enUS', 'We have come a long way together, $n. At every step, your choices have led the Dreamgrove to victory.$B$BI would give my life to defend Azeroth, and I know you would do the same.$B$BGreat danger still faces us. $n, take my pledge. We must serve and protect the wilds!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42065, 'enUS', 'So, the Mistress of Twilight was actually a dragon... I thought the brood of Sintharia had all been defeated.$B$BI wonder if Zeryxia was not the last of her kind...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42068, 'enUS', 'It is good that you have arrived, Farseer $n. The Twilight\'s Hammer has built a formidable stronghold here in Deepholm.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42074, 'enUS', 'It is T\'uure! I had thought it was lost to us forever!$B$BWhen I last saw this staff we were escaping from a small world called Niskara. The Legion came upon us unawares, we were only able to escape thanks to a few brave Vindicators who remained behind with T\'uure to stall their attack.$B$BI did not think it could be done, but you were able to recover T\'uure. You truly walk in the light, $n. You have my respect, and my thanks.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42079, 'enUS', 'My little brother is about to turn over a new leaf, whether he likes it or not.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42081, 'enUS', 'You\'re finished? Let\'s see it!$B$B<Deucus takes the conduit from you and places it against the wall.>$B$BNow that is a good looking decoction conduit. I\'m glad I upgraded its strength from that old hunk of junk I had before.$B$BYou might even say Svena did me a favor by destroying that old one.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42088, 'enUS', 'And not a moment too soon. Our scouts report the Underking himself has come.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42096, 'enUS', 'I\'ve watched you rise up the ranks for a long time, $n. With you leading our order, I know we are in good hands.$B$BCount me as one of your champions, Archdruid.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42097, 'enUS', 'Our search of the archives recovered a tome that details the process of creating a demonic gateway. It has the power to access any demon world, assuming we know where to direct it.$B$BWe could use such a gateway to locate and retrieve the remaining council members.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42098, 'enUS', 'You never disappoint, $n.$B$BThis otherwise forgotten soul will now serve a greater purpose.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42100, 'enUS', 'Your troops have done well. Our soul shard supply is sufficient enough to create the anchor.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42102, 'enUS', 'Our scouting efforts have hopefully paid off. I have a lead on a $C who might possess the skills we need to perform the summoning ritual.$B$BWe should follow up as soon as possible.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42103, 'enUS', 'This should be more than enough blood to satiate the Bloodstone.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42104, 'enUS', 'The Underking is coming. Best keep that weapon of yours handy in case this does not go well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42107, 'enUS', 'Glory is ours, indeed! The great worm cannot hide from us!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42110, 'enUS', 'You\'re after the great worm? You must be very foolish or very brave$B$BI know these mountains inside and out. Help me avenge my village and I will help you find the foul beast.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42114, 'enUS', 'I have seen you before, Farseer.$B$B<Lord Neptulon judges you silently for a moment before continuing.>$B$BI sense the potential for great power within you. We shall see if this prophecy holds true...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42120, 'enUS', 'I am heartened at your successful quest. We have been waiting for you to return.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42125, 'enUS', 'Friend was able to get the skull?$B$BYes, Calydus senses it! Keep its gaze turned away from Calydus, friend. I gladly work for you without compulsion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42126, 'enUS', 'Your champion did well! Archmage Omniara agreed to join us and is getting situated as we speak.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42127, 'enUS', 'Well done. These troops will be invaluable in our fight against the Burning Legion. Deploy them on missions, just as you would with our champions.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42128, 'enUS', 'Very good! Now, we\'re ready to begin.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42129, 'enUS', 'Yes, this is it... the pendant of the keepers! Hooray! Vengeance is so fun!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42131, 'enUS', 'The two of them are puppets of Kil\'jaeden and a bane on our existence. I am glad that you have their warglaives.$B$BThey will be that much easier to kill when we invade their world.$B$BI wonder, do you have a moment to discuss a rather urgent issue?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42132, 'enUS', 'There is just one thing left to do.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42133, 'enUS', 'These weapons will work well against Hakkar and his minions. I\'ll ensure that they are distributed to our allies.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42134, 'enUS', 'It\'s my honor to be of service to the Unseen Path. I\'ll help in any way I can.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42137, 'enUS', 'Your willingness to help is admirable, and it gives me insight into what kind of leader you will be.$B$BI know you mean to gather priests from all factions and lead them in a battle against the Burning Legion. It\'s an extraordinary task, but one that you will not have to embark on alone.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42138, 'enUS', 'I have a good feelin\' about ya, $n. Dis terrible day really started to turn around when ya showed up.$B$BSome might call it luck, but I think it\'s fate. We were meant to cross paths.$B$BDis could be da beginnin\' a somethin\' great.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42139, 'enUS', 'So, I guess I\'ll be hangin\' out with Vanessa here a lot? Don\'t you worry \'bout nothin\'.$B$BShe and I are gonna be besties.$B$BSay, you gotta moment?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42140, 'enUS', 'Gold! The rogues, thieves, and cutthroats are gonna start rollin\' in.$B$B<Nikki looks over at Vanessa and says in a whisper.>$B$BMaybe we\'ll even get some unemployed Defias to sign up. Too soon?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42141, 'enUS', 'Good, Mylra was successful in her mission! Our recruiting efforts have paid off.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42142, 'enUS', 'Excellent. These troops will be invaluable in our defense of the Broken Isles. Deploy them on missions, just as you would with our champions.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42147, 'enUS', 'The Lunastre family is well-connected. They will be of great help to us when the time comes.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42149, 'enUS', 'You\'d better take those back to the Hall of the Guardian for safekeeping, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42158, 'enUS', 'The Temple of Storms is close by, so you should get there before that thieving vrykul.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42166, 'enUS', 'They\'re using fel magic. I knew there was something off about them, but I never suspected this!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42168, 'enUS', 'Yes, Felsoul Hold! Calydus knows where that is!$B$BCalydus can make a path that connects to one of the portals there!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42170, 'enUS', 'The Dreamweavers thank you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42171, 'enUS', 'Thank you for uncovering the truth about the Empyrean Society, $n!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42175, 'enUS', 'Good to see you here, $n. There is much to be done!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42184, 'enUS', 'The Earthen Ring champions sent to Skywall have successfully returned to the class hall.$B$BThe plane of air is currently in a state of turmoil, however our champions identified a powerful elemental who may be willing to aid our cause.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42185, 'enUS', 'Brann will hardly believe his ears when I tell him what happened. What an adventure!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42186, 'enUS', 'Thank you for coming, Grandmaster.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42187, 'enUS', 'Chen and Li Li are two of the greatest monks in recent history.$B$BAs long as they stay out of trouble, they will be great representatives of our order.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42188, 'enUS', 'I hear you have been making good progress down among the Broken Isles. Good. We, too, have been busy here at the Maelstrom.$B$BThere are important matters that await us...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42191, 'enUS', 'Excellent work, $n! I can see that the Order of the Broken Temple is in good hands.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42193, 'enUS', 'What is it you seek? Are you here to pilfer heirlooms like the others?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42194, 'enUS', 'Odyn truly guides your hand, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42197, 'enUS', 'Lord Neptulon has sent me to aid the Earthen Ring in the defense of Azeroth.$B$BI have been commanded to serve the Farseer of the Earthen Ring with the same loyalty I give to the Lord of Tides. I will fulfill this duty until the Burning Legion is driven from this world and the future of Azeroth is secured.$B$BI am yours to command, Farseer.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42198, 'enUS', 'Uniting the elements won\'t be easy, Farseer $n. You\'ll be needin\' all the help you can get!$B$BAye, These are dark times indeed... but we\'ll face \'em t\'gether, don\'t you worry.$B$BOl\' Mylra has yer back, Farseer.$B$BNow, let\'s get a move on then! There ain\'t no time to waste!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42200, 'enUS', 'The mission to Deepholm was a success. The champions of the Earthen Ring made contact with Therazane, but the situation there is worse than we feared...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42202, 'enUS', 'You have my thanks, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42204, 'enUS', 'It is done! The armies of Ulduar are bound by oath to join us now that we\'re in possession of the Gjallerhorn!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42206, 'enUS', 'I like you, $n. You don\'t hesitate to take action when necessary!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42208, 'enUS', 'It seems that our mission to the Firelands was a success, Farseer. We have much to discuss.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42210, 'enUS', 'It was very lucky that we were able to retrieve those scrolls. Number Nine Jia\'s help will be invaluable to our order.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42213, 'enUS', '<Archmage Khadgar has set aside a space here for the Tidestone of Golganneth, as well as the rest of the Pillars of Creation.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42214, 'enUS', 'Oh yes! There are some fine looking jewels here. Let\'s just scratch the goop off, and...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42222, 'enUS', 'Ravandwyr speaks very highly of how you dealt with the Empyrean Society, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42223, 'enUS', 'You could not have arrived at a better time, $R.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42224, 'enUS', '<You recognize the relic from Thalyssra\'s vision.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42225, 'enUS', '<As the magical barrier begins to fade, you hear the rustling of leaves and the clattering of mandibles just outside.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42226, 'enUS', 'Do you have any idea what you have done?!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42227, 'enUS', 'We must move swiftly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42228, 'enUS', '<Energy pulses around the ancient seed.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42229, 'enUS', 'Such a temporary home will serve us well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42230, 'enUS', '<The seed sits perfectly atop the stand and sinks in with a satisfying click.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42231, 'enUS', 'My order guards a powerful secret. We are the keepers of the final resting place of the mighty Tyr!$B$BRecent intrusions have proven his tomb\'s location to be a secret no longer. We must protect the sacred relic stored there... the Silver Hand!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42233, 'enUS', 'The Highmountain tribes thank you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42234, 'enUS', 'The valarjar thank you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42238, 'enUS', 'Yeah yeah, the new master sent you. I get it. I have to deal with my former master first.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42244, 'enUS', '<The advisor looks down at what you\'re offering her and then looks around nervously, straining to give you a rictus grin. She continues in hushed tones.>$B$BDo you know what you have here? You have kept the Alliance from getting their grubby little hands on some rather delicate information.$B$BI will see to it personally that this is safely filed away.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42271, 'enUS', 'Of course they would attack now.$B$BThose withered devils couldn\'t have chosen a more effective time to strike. My brood already suffers.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42365, 'enUS', 'Excellent, Archdruid. These will do nicely.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42366, 'enUS', 'Kyrtos, you old fool! You should have known the risks...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42367, 'enUS', 'With Arkethrax and his minions dealt with it should help prevent them from flanking Illidari Stand. Well done.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42368, 'enUS', 'That should stall these demons for a time. We may need to return in the future to ensure they have not regrouped.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42369, 'enUS', 'If you think the explosion was big on our side of the portal, you should see what the other side looks like. Ha!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42370, 'enUS', 'And... it looks like we\'re out of time for today\'s wand practice. Go on, then. Off to your next class!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42371, 'enUS', 'My hand is beginning to tire from taking so many notes. I think it\'s time we took a break.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42372, 'enUS', 'Keep your voice down unless you feel like being felbat food.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42375, 'enUS', 'Why? Why would demons, of all things, be this bad at summoning their own kind?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42377, 'enUS', 'A terrible loss. You have the Spark he held, though, and I have another.$B$BWe must press on. I will mourn Galford another day.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42383, 'enUS', 'Excellent. Stormcaller Mylra and Duke Hydraxis are worthy champions. We can trust them to carry out any task we ask of them.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42384, 'enUS', 'I\'ve received word from our scouts, and just in time it seems. There are plenty of people out there who could use our help.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42385, 'enUS', 'I don\'t know who sent you, but I sure hope you\'re here to help.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42386, 'enUS', 'Whatever you did out there, it worked. The hounds\' attacks have slowed.$B$BLet\'s hope that the villagers can get some rest, and live to fight another day.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42387, 'enUS', 'Thank you, $n. I think the children will be able to sleep better tonight knowing that those assassins aren\'t lurking just outside their door.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42388, 'enUS', 'I\'m so glad we\'re able to help people once again. Your work in Bradensbrook just proves how much the Unseen Path is needed.$B$BSince you\'ve been away, we\'ve had reports pouring in from all over Azeroth. With our ranks a little low, I\'m not sure we\'ll be able to keep up.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42389, 'enUS', 'It\'s been quite some time since I\'ve come across another from our order.$B$BIf you\'ve come to collect me, I\'m afraid that\'s not going to happen.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42390, 'enUS', 'You\'re from the lodge on the hill, am I right? I\'ve heard of your order, a respectable group no doubt, but a bit dull for my tastes.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42391, 'enUS', 'Thank you for securing Cora\'s release. She\'s still a bit skittish, but I think she\'ll recover in time.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42392, 'enUS', 'Well, you\'ve got my attention, $n. Not many hunters have what it takes to survive a night in these unforgiving mountains.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42393, 'enUS', 'It is so good to have Hilaire back at the lodge. Her dedication and skill will be useful in the times to come.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42394, 'enUS', 'Whether they know it or not, the people of Azeroth have the Unseen Path to thank for their safety.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42395, 'enUS', 'I fear that the Burning Legion is planning to invade Dalaran.$B$BI\'ve dispatched members of the Kirin Tor to spy on various demon strongholds, with hopes that they can uncover any plots involving the city.$B$BIn the meantime, Dalaran could benefit from the protection of the Unseen Path. I know its citizens will be safe with the Unseen Path watching over them.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42396, 'enUS', '<Phin grabs your shoulders and hops happily.>$B$BMlrglr! Grlrlrglrmg.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42397, 'enUS', 'You traveled all this way to see Baron? It\'s been a long time since we\'ve had visitors.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42398, 'enUS', 'I don\'t know what kind of bones you and Baron found in these fields, but he hasn\'t had this much energy since he was a pup!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42399, 'enUS', 'Good work recruiting Huntsman Blake. His hound could be the key to tracking down Khadgar\'s mages.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42400, 'enUS', 'Thank you for meeting me, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42401, 'enUS', 'The Houndmaster is an ancient and powerful demon who has attacked our world once before.$B$BHis return could have dire consequences for mages throughout Azeroth.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42402, 'enUS', 'Our allies have all gathered here at the lodge and are waiting to be updated on the situation.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42403, 'enUS', 'You\'re from the lodge up on the hill, aren\'t ya?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42404, 'enUS', 'If we can help, we should help. Hakkar isn\'t welcome in our world, and he won\'t be allowed to stay.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42405, 'enUS', 'With the faction leader\'s help and your leadership, Hakkar doesn\'t stand a chance.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42406, 'enUS', 'The Houndmaster has done some interesting things with this breed of felhound.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42407, 'enUS', 'This is unsettling news. If our weapons won\'t work against Hakkar\'s minions, how are we going to defeat him?$B$BWe should call in our allies and see what they can do to help.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42408, 'enUS', 'This should do.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42409, 'enUS', 'I\'ve been expecting you, $n. Ohn\'ahra\'s presence told me that change would be coming.$B$BThe Highmountain tribes have long been allies of the Unseen Path.$B$BMy ancestors welcomed Namuria and her hunters to our land, and together, they helped build the lodge you stand in today.$B$BI am honored to serve at your side.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42410, 'enUS', 'An old threat has resurfaced, stronger than ever. Azeroth needs hunters like you who are willing to survive at all costs.$B$BAs the leader of the Unseen Path, many will look to you for guidance. Show them that they can survive.$B$BI will stand beside you, and together we will send a message that we can endure, even in the face of an enemy as great as the Burning Legion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42411, 'enUS', 'I knew it was only a matter of time before us scouts would be called home.$B$BMy post has been a quiet one over the years, without much to act on. Yet in recent times, I\'ve seen the clans abandon their traditions in favor of following a king who chose to side with the Legion.$B$BThe people I sought to protect, allied with my enemy. I will not let others find a similar fate.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42412, 'enUS', 'You brought a tear to this old man\'s eye by bringing Baron back to life. I never thought I\'d miss his ear-piercing howls, but I did. It\'s a wonderful thing to see him working again.$B$BWe\'re happy to help wherever we\'re needed.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42413, 'enUS', 'Ya did a fine job takin\' down that bird.$B$BMaybe I was wrong about you hunters up in that lodge. Clearly ya know what you\'re doin\'.$B$BI\'d be happy to hunt by your side again, as long as you\'re huntin\' big game!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42414, 'enUS', 'I don\'t think Hemet himself could have taught me better, but I have to believe there\'s more to hunting than taking down big game.$B$BSticking with you, I think I\'ll be able to learn exactly what it means to be a true $C.$B$BHere\'s to you, and the many grand adventures that await us!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42415, 'enUS', 'You faced Hakkar with more strength and courage than I have seen in quite some time.$B$BAs Emmarel said, our battle with the Legion has only just begun. You can count on the Farstriders to be there when you need us.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42416, 'enUS', 'If it is true that Archmage Vargoth is exploring fel magic, I will be shocked! Still, we owe you our thanks in bringing this matter to our attention.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42418, 'enUS', 'Have we met before? Your face seems a bit familiar.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42420, 'enUS', 'The Court of Farondis thanks you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42421, 'enUS', 'The nightfallen thank you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42422, 'enUS', 'The wardens thank you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42423, 'enUS', 'Hmm. This appears to be Archmage Vargoth\'s notes on the Nightborne Soulstone. Supposedly the energy of captured souls stored within it can be channeled directly from the stone! If that\'s true, it is very powerful, indeed!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42424, 'enUS', 'Good news! Your champion found Archmage Vargoth entering the Arcway Vaults in Suramar.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42425, 'enUS', 'I can\'t believe it! I hoped it would work, but I couldn\'t be sure.$B$BYou recovered heirlooms passed down by my family for many generations.$B$BI thought them lost forever.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42428, 'enUS', 'Rensar sent you? As much as I\'d like to help, whatever you need is going to have to wait. As you can see, we have bigger problems.$B$BActually, we could really use your help. If you could lend us your aid then I\'ll do all that I can to help you with whatever it is you\'re here for.$B$BWould this be acceptable?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42429, 'enUS', 'Ah, your eyes gleam with newfound knowledge, $n.$B$BThat staff of yours has seen the passing of many mortal lifetimes. It can teach you a great many things, if you\'re willing to listen.$B$BAs for its memories... they may be unreliable. You may find a different reflection haunts the streets of Dalaran each day. I leave it to you to find them all.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42430, 'enUS', 'I\'ve heard from Delandros about how you rescued the Ashen and protected the shrine.$B$BWe all owe you a great deal for your heroism, $n. And it seems that you were able to recover the Fangs as well!$B$BI suspect this war is far from over.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42432, 'enUS', 'Finally, we are triumphant, $n! With Xavius\'s defeat, the Nightmare\'s presence will slowly recede from the Emerald Dream.$B$BThe tranquil realm of the sleepers is safe once again. Our druids will work on its restoration and recovery.$B$BThank you, Archdruid $n. Azeroth will see many more serene days and tranquil nights because of you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42433, 'enUS', 'Your champion has discovered some very powerful artifacts, $n!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42434, 'enUS', 'Good; you found me, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42435, 'enUS', 'Good. Now we should be able to enter the Empyrean Society enclave and have a look around.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42436, 'enUS', 'Our alliance with the Skyhorn is stronger than ever, thanks to your efforts.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42438, 'enUS', 'Thank you, $n.$B$BMy heart weeps for those who we\'ve lost this day. The Legion will pay for this, I swear it!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42439, 'enUS', '<Delandros nods.>$B$BThank you, hero. Now that my people are safe we might be able to turn the tide of this battle.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42440, 'enUS', 'What? Verstok fled with the Fangs? That fool, he\'s going to get himself killed!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42444, 'enUS', 'Caw?$B$B<The ravenbear chieftain seems preoccupied with the gathering of reagents for some sort of ritual. Perhaps you could help him?>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42445, 'enUS', 'Caw! Caw! $B$B<The ravenbear chieftain flaps his wings excitedly when he sees the reagents you\'ve brought.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42446, 'enUS', 'The Blackfeather chieftain bows respectfully to you. $B$BYou have helped ensure the survival of his tribe.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42447, 'enUS', 'It seems that Nithogg wasn\'t interested in the ravenbears\' tribute.$B$BIt\'s probably a good idea to get out of here before he comes back...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42449, 'enUS', 'The world of the living will forever revile us for the dark task that we begin this day...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42451, 'enUS', 'Good to see you again, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42452, 'enUS', 'From the texts you found, it is clear that Ebonchill is in the hands of Balaadur. There is no way he would not claim such a powerful staff.$B$BThat is a problem, but not an impossible one. All we need to do is get access to Balaadur.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42454, 'enUS', '<Archmage Khadgar has set aside a space here for the Hammer of Khaz\'goroth, as well as the rest of the Pillars of Creation.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42455, 'enUS', 'Excellent! Honestly, I\'m surprised you mages no longer use Mana Gems. I found them terribly useful.$B$BAt any rate, these will make up for the lack of additional mages.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42476, 'enUS', 'This is better than I hoped. A working ward prototype and the ritual notes as well!$B$BI\'m beginning to believe this is possible!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42477, 'enUS', 'Our order suffered a great loss that day. It is a shame we chose to hide it instead of study it.$B$BYou have another critical element to the ritual, and we are one step closer.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42479, 'enUS', 'Your ability continues to astound me! Balaadur lies dead in his own realm, and you now wield Ebonchill. I look forward to seeing what you will do next.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42483, 'enUS', '<A note from the goblins is left behind, along with an old magnifying glass>$B$BI wish I coulda been there to see the look on your face, but Raz and I got bigger fish to fry!$B$BThanks for the trophies and meat. I\'m sure they\'ll fetch a nice sum on the black market, along with all the goodies we got from those stupid tauren! I\'m sure they won\'t be needing them any more!$B$BSo long sucker!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42484, 'enUS', 'Well done, Deathlord. One of the Horde\'s greatest generals in life now serves you in undeath as your first horseman!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42486, 'enUS', 'Oh my sweet little Korine! Thank you, thank you!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42487, 'enUS', 'Vanthir is a very pleasant fellow.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42488, 'enUS', 'How lucky we are that it could be recovered... thank you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42489, 'enUS', 'This is a comfort beyond words.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42490, 'enUS', 'Thank you. It is one thing I no longer need to think about.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42491, 'enUS', 'Excellent! I will study this immediately.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42493, 'enUS', 'It is true, then. Archmage Vargoth has been corrupted by the legion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42494, 'enUS', 'Good job, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42504, 'enUS', 'Every second I held those blades was torture. They\'re all yours.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42508, 'enUS', 'I\'ll keep them busy outside while you head in.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42510, 'enUS', 'We must prepare. There is much to do.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42512, 'enUS', 'The village. It... it is just... gone. They told me what happened to Riverbend but I figured that was an exaggeration.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42516, 'enUS', 'Good. I see you have grown in power.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42517, 'enUS', 'So I take it things went well then?$B$BA ritual of that magnitude requires a bit of recovery time. You cannot expect to perform it more than once a day.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42519, 'enUS', 'Excellent. Emmarel Shadewarden and Loren Stormhoof are worthy champions. We can trust them to carry out any task we ask of them.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42520, 'enUS', 'The loss of Archmage Vargoth from our order is terrible to hear, $n. These are indeed dark times.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42521, 'enUS', 'I hope you are able to put Millhouse\'s determination to good use!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42522, 'enUS', 'Ready, $n?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42523, 'enUS', 'Good, your champions were successful with their mission! We may be seeing some new faces around here soon.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42524, 'enUS', 'Excellent. These troops will be invaluable in our defense of the Broken Isles. Deploy them on missions, just as you would with our champions.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42525, 'enUS', 'The scouting mission was more successful than we could have imagined, $n. Your troops were able to rescue Survivalist Bahn, a cunning strategist.$B$BIn thanks, he has agreed to lend his skill to our cause.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42526, 'enUS', 'Excellent choice, $n. Survivalist Bahn has made the lodge his home, so just speak to him when you want to make upgrades.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42533, 'enUS', 'For what purpose do you intrude upon my kingdom, $C? Speak quickly, for I have little patience...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42534, 'enUS', 'Soon the heads of my enemies shall line the walls of my kingdom! These shall be the first of many.$B$BNot even Sylvanas will dare to step foot upon the free kingdom of Stromgarde!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42535, 'enUS', 'You have done my kingdom a service, $C. Stromgarde will not forget the service you have done us this day.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42536, 'enUS', 'We have tarried here long enough, Deathlord. The time has come to open the tomb and raise our champion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42537, 'enUS', 'Today, a great king has risen from the dead to once more take up the sword in the name of liberty.$B$BIt will be an honor to fight at his side against the legions of terror.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42567, 'enUS', '$n? Is that you, my friend?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42568, 'enUS', 'If you\'re with me, drench your blades with poison now. This is going to get bloody.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42583, 'enUS', 'Good. I know Zen\'tabra and Naralex, and they will serve the Dreamgrove bravely.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42584, 'enUS', 'Excellent, $n. Zen\'tabra has done well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42585, 'enUS', 'Well done. I knew that Sister Lilith would come through for us.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42586, 'enUS', 'Not only was the mission a success, but our champions recovered an inscribed leaf of ancient knowledge. These may be of great interest to Leafbeard the Storied, the Ancient of Lore who resides to the north.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42588, 'enUS', 'Well done! I see that Leafbeard\'s advice has already been useful.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42590, 'enUS', 'Your kindness will not be forgotten. You are a friend to my family, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42593, 'enUS', 'The matron mother?$B$B<The archmage\'s face goes red as he chokes out a cough and looks around surreptitiously.>$B$BYes, of course. Anything for Malevolence.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42594, 'enUS', 'I\'ll make sure to give the grimoire to Malevolence so that she can unravel its mysteries.$B$BMeanwhile, we have some Black Temple scouting to conduct.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42596, 'enUS', 'Thank you, friend to Highmountain.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42597, 'enUS', 'It is as I predicted. You continue to grow in power and prove your worth.$B$BThe time has come for you to take command of my armies, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42598, 'enUS', 'You are ready to command your forces. Let us begin!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42601, 'enUS', 'Excellent choice, $n. Archivist Melinda will remain within Dreadscar Rift, so just speak to her when you want to upgrade more of the class hall.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42602, 'enUS', 'The scouting mission was more successful than we could have imagined, $n. Your troops were able to rescue Archivist Melinda, a brilliant strategist.$B$BIn thanks, she has agreed to lend her skill to our cause.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42603, 'enUS', 'Ritssyn and Calydus were successful in getting information, though we don\'t know how reliable it is, considering how it was obtained.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42605, 'enUS', 'Odyn\'s putting you in charge, eh? Count me in. I find it generally unwise to question the gods.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42606, 'enUS', 'I will gladly follow you, $n. I\'ve seen what you\'re capable of and you have no fear of death.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42607, 'enUS', 'Excellent. Hjalmar will have the valarjar whipped into shape in no time.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42608, 'enUS', 'It says a lot that Ritssyn would give up his position and look to you for leadership. He must believe that you are the key to rebuilding the council.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42609, 'enUS', 'We are well underway. Before long you will command an army to be reckoned with.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42610, 'enUS', 'Excellent! With the runecaster\'s powers your armies will be even stronger!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42611, 'enUS', 'A wise choice, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42614, 'enUS', 'I spent enough time in the afterlife. Point me at the enemy and I will end them!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42616, 'enUS', 'I was sworn to protect Ulduar and if it wasn\'t for yer aid, I would\'ve failed that promise.$B$BYe can count on me!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42618, 'enUS', 'You showed bravery in Ulduar, $n. I will fulfill my oath and answer the call of the Gjallarhorn.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42619, 'enUS', 'I thank you for aiding me, $n. I will gladly fight along your side in Odyn\'s army.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42622, 'enUS', 'Nice! Got \'em! Feel free to play the drums, but leave them down here, will you? You\'re alright by me, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42627, 'enUS', 'Every second I held those blades again was torture. They\'re all yours.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42630, 'enUS', 'That was some nice work you did there, $n. Thanks for the assist.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42634, 'enUS', 'Who would have thought he would be working with us?$B$BWe are now one step closer to taking the fight directly to the Burning Legion on their own worlds.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42635, 'enUS', 'Excellent! Luckily I brought a copy of the vrykul cipher that the League procured from Northrend.$B$BI\'ll get to work on this straightforth! Let us hope the dialects are not too dissimilar.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42639, 'enUS', 'You have the amulet! Most excellent!$B$BOf course, that probably won\'t help you with the pirates that are already mad as hatters, but small victories, eh chap?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42640, 'enUS', 'Well that was most noble of you to save these ancient relics from a water-logged fate.$B$BI will be sure that the Explorer\'s League puts these to good use!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42641, 'enUS', 'Oh, the stake didn\'t work you say? My apologies, I must\'ve had my immortal evil undead mixed up.$B$BYou\'re all in one piece though, and the evil has seen its end. Hopefully, at least.$B$BVampyr can die, can\'t they?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42645, 'enUS', 'Good riddance to bad rubbish, I say. $B$BThose louts were ne\'er-do-wells before they went crazy. Just imagine what they would do if we let them run rampant!$B$BCheers to your bravery, sir.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42650, 'enUS', 'I can feel it. My soul is my own again!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42651, 'enUS', 'Jorhuttam! We must track the great worm at once. It will surely be a great battle.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42653, 'enUS', 'I am encouraged that we have come to an understanding. I admired Altruis when he opposed the direction Illidan was taking all those years ago. While the annihilation of the Burning Legion is of paramount importance, in the process, we must not become that which we hope to destroy.$B$BIf you would have me as a champion, I will bring all of my knowledge to bear on the task at hand. With time, I believe that we might even come to trust each other.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42654, 'enUS', 'A little bit of oak can go a long way when making ammo.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42655, 'enUS', 'This looks like more than enough ore to craft weapons and ammo for our allies.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42656, 'enUS', 'Halduron\'s blacksmith does fine work, but these weapons still need to be enchanted before they will work against Hakkar\'s hounds.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42657, 'enUS', 'The Sentinels told me you would be coming.$B$BI apologize for the state of my home. I\'ve been having some trouble with unwanted guests, recently.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42658, 'enUS', 'I\'d get a lot more work done if I could convince you to stay, but I know you have pressing matters elsewhere.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42659, 'enUS', 'You have no idea how relieved I am to see you!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42660, 'enUS', 'Once this heart is devoured, the Bloodstone will be strong enough to control the eredar sisters.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42662, 'enUS', 'The blue dragonflight has always represented magic on Azeroth, and it is fitting that we work together against the Burning Legion now more than ever. I would be honored to fight for you as your champion in these dark times.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42663, 'enUS', 'Archmage Kalec and Archmage Modera are two of the greatest mages in Azeroth\'s present and past. They will be exemplary representatives of our order.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42664, 'enUS', 'I have always admired Illidan\'s singular vision. After all, the annihilation of the Burning Legion is of paramount importance. Nothing else matters. Nothing else can be allowed to stand in our way.$B$BYou will take me as your champion. In return, I will bring all of my knowledge and power to bear on the task at hand. In time, we will destroy all of our enemies... perhaps even Akama as well?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42665, 'enUS', 'Up until now, the Illidari have been a fairly exclusive club. Demon hunters only. But, as you have so clearly demonstrated, my dear, if we are to move forward trusting one-another, then bringing Akama in is an important step.$B$BIt gives one hope.$B$BAnd, of course, making Kor\'vas one of your champions is the obvious choice. No one fights as well as she does.$B$BWhat\'s that?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42666, 'enUS', 'Commander. I am glad to see that Asha was able to find you so quickly.$B$BThere is something important that you must attend to as soon as possible.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42669, 'enUS', 'And now we know that Caria and Varedis are hiding away on the demon world known as Niskara.$B$BTime to finish this.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42670, 'enUS', 'You have selected your first two champions. There are great things ahead of us, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42671, 'enUS', 'You have selected your first two champions. There are great things ahead of us, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42673, 'enUS', 'It\'s about time, you big lummox. For a while there, when you chose Asha Ravensong first, I started to doubt your sanity.$B$BNot that there\'s anything wrong with Asha. But, we both know who the better fighter is.$B$BRight?$B$BAnyway, of course, I\'d be honored to be your champion. I accept!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42677, 'enUS', 'Well, at least we\'re going to have some fresh faces around here. If a broken\'s face can ever be called fresh, that is.$B$B<Kor\'vas smirks.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42678, 'enUS', 'We have it. Finally, we will be able to crack SI:7\'s coded letter.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42679, 'enUS', 'Outstanding. These new Ashtongue will give you the flexibility you need to position troops wherever you see fit.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42680, 'enUS', 'I must admit, I was not expecting that. Mathias Shaw taken prisoner by the Legion.$B$BThat, at least, explains all of the strange actions SI:7 has been taking lately. They have a dreadlord in charge of them.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42681, 'enUS', 'They\'ve returned with him. It\'s Loramus, alright. But, he\'s trapped within the body of the dreadlord, Razelikh the Defiler!$B$BUntil we can make sure he doesn\'t pose a danger, I\'ve ordered him kept in one of our demon traps, below.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42682, 'enUS', 'Do we really need all of these ingredients to contact the Master\'s soul?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42683, 'enUS', 'That sounds like good news. He is already contributing to the cause and we are that much stronger for his help.$B$BStill, he is not fully in control of Razelikh. I think it best that we leave him in that trap until we can find him a new body. Don\'t you?$B$BAnd, if he proves to be too much of a problem, we can take \'other\' measures.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42684, 'enUS', 'Surprisingly nice bit of work there. What I am hearing from our scouts is that the diversions are working perfectly.$B$BAs an added bonus, some of my suspicions about a particular item, which will prove useful in deciphering the SI:7 letter, have come to light in Stormheim.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42685, 'enUS', 'It is good to see the Tirisgarde rise again, $n. While not everyone on the Council of Six agrees with me, I believe it is imperative for us to work together and defeat the Burning Legion once and for all!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42687, 'enUS', 'It was very lucky that we found Chronicler Elrianne among the survivors. A well-respected archivist from the Kirin Tor, she also spent several months studying with the pandaren in their library in Tian Monastery.$B$BHer knowledge of ancient magic will be invaluable to our order.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42688, 'enUS', 'Mlrgmlr! Rgmrlmg, grmlmglr lmrglmrg mrlgmlglr! Mlrgmlrg grmlgrl.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42689, 'enUS', 'Faronaar is crawling with demons, some familiar, and some peculiar.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42690, 'enUS', 'You honor me, $n. Of course I will serve as your champion and right-hand man. How could I refuse?$B$BWe have only just begun to change the way in which the Illidari operate, but already, you have made great strides. If we are to defeat the Burning Legion, it must be done in concert with everyone working together. Not just the Illidari standing alone.$B$BAnd not standing upon the smoking husk of a world that we have carelessly destroyed while trying to save it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42691, 'enUS', 'These entrails are rich with magic. They\'ll make excellent bait.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42692, 'enUS', 'This Prince Farondis opposed Queen Azshara, so she got mad and blew everything up? That\'s awesome!$B$BHey Olothil, listen to this!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42693, 'enUS', 'Perfect. Let\'s get this ritual started, shall we?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42694, 'enUS', 'After over ten thousand years... to see mother and father again...$B$B<The elven mage is at a loss for words.>$B$BThank you, $n. Thank you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42695, 'enUS', 'An honor, $n. Of course I will serve as your champion and second-in-command. Could it have been any other way?$B$BWe have only just begun to move forward with the master\'s plan, but already, you have made great strides. If we are to defeat the Burning Legion, we must remain vigilant. Any other goal pales in comparison. The fate of everything hangs in the balance.$B$BAt the end of the day, we will stand victorious... no matter the cost!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42696, 'enUS', 'Excellent work, $n! I can see that the Hall of the Guardian is in good hands.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42697, 'enUS', 'You want me to be one of your champions?$B$B<Asha thoughtfully ponders your request a moment.>$B$BI accept, but on one condition. I want you to put me into field duty. While I am of use here on the Fel Hammer, my talents will be put to better use back on Azeroth.$B$BBeyond that, I trust that the plan is still to bring the Burning Legion to its knees?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42701, 'enUS', 'What a rare honor. To be one of the Illidari, instead of a servant. I must admit, I was worried you wouldn\'t choose me as one of your champions.$B$BBut now you have, and I could just kiss you!$B$BIt never made any sense to me that all worlds should be purged in flame when there are so many delicious playthings to have fun with. Sargeras can be such a bore. Together, we will bring the Burning Legion to its knees and make them grovel in the dirt.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42702, 'enUS', 'Your Hall here isn\'t too shabby, $n. I\'m sure there are lots of nifty secrets I can uncover here. I think I\'ll stay! Er, if you don\'t mind, of course.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42703, 'enUS', 'Greetings, $n. The fires of Azeroth give us the power to see beyond ourselves.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42704, 'enUS', '<The Arcane Destroyer makes a high pitched, quizzical chirp and looks at you expectantly.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42705, 'enUS', 'I have been Archmage Vargoth\'s apprentice for far too long. Perhaps it is time for me to serve a new master. I would be honored if you would accept me as your champion, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42706, 'enUS', 'You and I have proven to be quite successful together. I\'d be happy to lend you my swords and spells against the Burning Legion anytime, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42707, 'enUS', 'Good -- you\'re back just in time! This will sustain Meryl while we search for his attacker.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42708, 'enUS', 'Sylvanas will not be pleased with our actions, but we have more to worry about than offending the Dark Lady.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42719, 'enUS', 'Oh! Clean water, so pure and magical! Thank you, hero!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42722, 'enUS', 'You let them go? I\'m glad. I didn\'t like being in a cage either...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42728, 'enUS', 'Mrrgml... mlrgmlrg. Mlrmglrg gmrlr!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42730, 'enUS', 'No hard feelings, right? Business is business, baby, and business is good. I saw an opportunity and I took it, just like you.$B$BTo show my continued allegiance with your little organization, and as a gesture of goodwill, here\'s a little sample of the product. It\'s magic. Bottoms up!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42731, 'enUS', 'Well, we did everything that she asked, but that wasn\'t enough for Sira Moonwarden.$B$BShe\'s asking for one more thing and she wants you to deal with it personally.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42732, 'enUS', 'That stuff\'s hard to get and expensive. Impressive! I can\'t wait to see the results.$B$BReady for the next big task? No rest for the wicked.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42733, 'enUS', 'Of course. Like all Legion constructs, the Fel Hammer is powered by souls. You have collected some of the most powerful souls around.$B$BThey should be enough to take us anywhere you want to go.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42734, 'enUS', 'You have done the unimaginable, $n.We are all in your debt. I am proud to henceforth name you Archmage $n!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42735, 'enUS', '$n, is that you? This is a rather odd turn of events, don\'t you think?$B$BYou\'re free and now I am the prisoner.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42736, 'enUS', 'I guess I underestimated you. Good. I like to learn and grow.$B$BUp to helping me out with one more little thing?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42737, 'enUS', '<The runestone begins to vibrate as you approach, rune in hand.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42738, 'enUS', '<Ragnar\'s rune grows warm as you approach the runestone.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42739, 'enUS', '<The rune and the runestone begin to glow and thrum with increased power.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42740, 'enUS', 'Ah, $n, you\'re up! I\'m relieved you made it out of that bloodbath alive. We lost so many good women and men down there...$B$B$B$BDamn the Horde for serving us up to the Legion!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42747, 'enUS', 'I wish it did not have to come to this, truly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42748, 'enUS', 'The owlbeasts are... melting the dryads down and using their bones to create minions?! How... how could this even be?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42750, 'enUS', 'I knew Leirana... she was one of Remulos\' favored, and kindhearted soul. If he has been captured as she believes, we have no time to mourn her passing.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42751, 'enUS', 'My wounds are great, and my magic has been severely drained. I must recover from this enervation and return to the Dreamgrove.$B$BThe owlkin here are beyond saving by mortal hands, but perhaps Elune will one day shine her light upon them again.$B$BThank you, $n. May your path be blessed.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42752, 'enUS', 'Finally, revenge against Cordana Felsong for all of the demon hunters whom she tempted into becoming Felsworn. Cyana, Tirathon, Glayvianna, Cailyn, Illysanna, and more.$B$BHer death has been a long time coming.$B$BThe Sargerite Keystone is once more in our possession. Now, to look to the future.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42753, 'enUS', 'Finally, revenge against Cordana Felsong for all of the demon hunters whom she tempted into becoming Felsworn. Cyana, Tirathon, Glayvianna, Cailyn, Illysanna, and more.$B$BHer death has been a long time coming.$B$BThe Sargerite Keystone is once more in our possession. Now, to look to the future.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42754, 'enUS', 'These will do nicely. We couldn\'t have asked for better.$B$BTell me, were the demons angry when you stole their precious parts?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42756, 'enUS', 'Hah! Ha ha ha haaaa!$B$BI haven\'t felt this alive in YEARS!$B$BWhat you\'ve done, $n - not only to replenish my mana pools, but also to save my brood - will not be forgotten. The blues of Azsuna are ever in your debt.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42758, 'enUS', 'Blimey! This one still has blood on it! Looks like he got a good bite on ye good, lad!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42762, 'enUS', 'You seek my staff? You make me laugh!$BYou say you want my help and time?$BOkay then, wikket, hear this rhyme:$B$BThree new riddles will I ask,$BThree true answers are your task.$BProve you\'re smart, show you\'re worth it.$BAnswer the King and we\'ll unearth it!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42765, 'enUS', 'I knew you\'d succeed, $n. I\'m honored to be at your service.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42766, 'enUS', 'Them greenies were really curious about this smelly brew. It\'s powerful and smelly, I wonder if it\'s delicious too?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42767, 'enUS', 'For this grain, the wikkets work real hard. They toil and struggle so they do not starve.$B$BWith these bags safe from the greenies, we should do the right thing and give them back.$B$BOkay, maybe we take a bit for ourselves, probably just one sack.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42768, 'enUS', 'This splashie spirit core holds far more water than you might think. Enough to fill a big bowl or a small sink!$B$BI bet we can find some good use for it, like squeezing it out to make ookin\' excellent slerp!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42770, 'enUS', 'These brave watchers require our aid. The Light may well ignore our prayers if we choose not to help our brethren.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42771, 'enUS', 'Those poor souls are finally at peace. Thank you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42772, 'enUS', 'Good. Given time, the last few lingering souls will make their way home.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42773, 'enUS', 'Tirion... could it be?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42774, 'enUS', 'We\'re ready to depart when you are.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42775, 'enUS', 'With the Sargerite Keystone in our hands, all that we have to do is prepare our forces and formulate an invasion plan.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42776, 'enUS', 'You now have six champions, all of the Illidari and its forces, as well as a growing army of troops, all willing to make the ultimate sacrifice to bring down the Burning Legion.$B$BTime to prepare for the endgame.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42777, 'enUS', 'You are choosing me as one of your champions?$B$B<Belath looks both surprised and pleased.>$B$BThis is a great distinction. I pledge myself to you again, $n. I will see to it that the enemies of the Illidari are dealt with in your name.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42782, 'enUS', 'It\'s good to see you\'ve prepared yourself. You never know what you\'ll be facing out there.$B$BWe\'ve commissioned these rings for high-ranking members of the Alliance. May this one protect you in the battle to come.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42786, 'enUS', 'These remains... this is horrible! They are turning dryads into mindless piles of ooze!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42787, 'enUS', 'The Wardens should have cooperated with us much sooner than this. Still, we now know that we need to go find the Warden, Malace Shade, in Stormheim. She was the one entrusted with safeguarding the Sargerite Keystone.$B$BThat information, combined with some scouting I did on my own, will point you in the right direction.$B$BWe\'ll have the Keystone before you know it, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42792, 'enUS', 'They will not so easily dismiss the Dusk Lily now. Well done.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42800, 'enUS', 'Of course I will serve as your champion. In for a copper in for a gold as they say.$B$BWe work well together. I bring out the best in you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42801, 'enUS', 'Belath is such a dear. Very thoughtful of him to arrange for some scouting.$B$BI do hope that not too many of the broken died to get us this information.$B$BIn any case, I now have the means and the perfect location within the Black Temple to make our grand entrance.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42802, 'enUS', 'Ariana Fireheart?! I thought she died the first time we were here. How horrible that she\'s been down there all this time. But, what an amazing survivor!$B$BI remember her being an excellent trainer of demon hunters. We should put her talents to good use immediately.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42808, 'enUS', 'Glad to hear that Ariana has recovered and is ready to train up our first new demon hunters.$B$BIt\'s been awhile since we had some fresh blood in our ranks.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42809, 'enUS', 'We\'ve won the day! Caria and Varedis are no more, and we\'ve sent a clear message to the Burning Legion that they are vulnerable, even on their own worlds.$B$BIt\'s about time that we celebrated, but first...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42810, 'enUS', 'Kil\'jaeden?! If that\'s not the gauntlet being thrown down, I don\'t know what is.$B$BCan we survive this, $n?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42811, 'enUS', 'It is fitting that you are here.$B$BTime and again, you have fought to save our world. Now, I fear I must ask you to undertake an even greater act of service.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42812, 'enUS', 'It is fitting that you are here.$B$BTime and again, you have fought to save our world. Now, I fear I must ask you to undertake an even greater act of service.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42814, 'enUS', 'I am relieved you survived the Broken Shore when so many brave heroes were lost.$B$B<Danath hangs his head in a moment of silence.>$B$BI have been recalled from Honor Hold to aid the Alliance in its darkest hour. It is crucial that we learn from our mistakes.$B$BDo you have time to speak?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42815, 'enUS', 'Welcome to the Halls of Valor, hero. Normally one must die to gain entrance, but times have changed.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42818, 'enUS', 'It is good that you are here, Deathlord $n. The battle has already begun.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42821, 'enUS', 'Soon, the Scarlet Crusade shall be overrun, Deathlord $n. This battle is nearly finished...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42823, 'enUS', 'Our path is clear now, Deathlord. The time has come for us to offer Sally Whitemane the opportunity for redemption.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42824, 'enUS', 'I have heard that the battle at Scarlet Monastery was a success, thanks to you.$B$BInitiate Whitemane has already begun her training as a $C. She shows much promise, and I have no doubt she will make a formidable horseman.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42828, 'enUS', 'Hmm, yes. It is as I suspected.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42829, 'enUS', 'Let me show you around, then.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42832, 'enUS', 'You may want to cleanse your palate - we craft some strong flavors here!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42833, 'enUS', 'Welcome, enjoying your tour?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42834, 'enUS', 'Simple, no?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42835, 'enUS', 'I will be certain to have a bottle of your arcwine prepared for you before you leave.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42836, 'enUS', 'Much better. You have my thanks.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42837, 'enUS', 'I will have these... ah... souvenirs... boxed for you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42838, 'enUS', 'Margaux... no!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42839, 'enUS', 'Steel yourself, $n.$B$BMargaux\'s loss is regrettable, but not likely to be the last in this effort. Far from it, I fear.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42840, 'enUS', 'Glad to know you understand the value of my services, partner.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42841, 'enUS', 'Pleasure doing business with you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42844, 'enUS', 'Thank you for coming so quickly, Highlord.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42846, 'enUS', 'Excellent. Both Lord Tyrosus and Lady Liadrin will serve proudly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42847, 'enUS', 'Maxwell Tyrosus has returned with important news. First, he did recover some survivors. They are recovering in the chapel now. Among them was Commander Ansela, a veteran $C and trainer.$B$BAs for the second, I will let Sir Tyrosus tell you himself.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42848, 'enUS', 'Good. These squires will fight well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42849, 'enUS', 'Our mission was a success! Not only did we defeat the enemy, but we recruited Alamande Graythorn, a noted scholar from the Hearthglen archives.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42850, 'enUS', 'Excellent. I knew Sir Graythorn would come through.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42851, 'enUS', 'Highlord, I cannot thank you enough for both saving my life, and opening my eyes.$B$BIt is true I harbor great hatred against the Burning Legion, but you have reminded me that my choices define the path I take.$B$BI choose to live a path of righteousness, and I will follow your leadership and guidance, Highlord.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42852, 'enUS', 'For years I have heard of your deeds, Highlord. Now that I have fought at your side, I can say the stories were true.$B$BAllow me to represent the Order of the Silver Hand as a champion of the light, $n. I will fight justly and bravely, and carry out your orders to the end.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42857, 'enUS', 'Ah yes, this is the grell food supply. Perhaps I can use this to lure them away. Thank you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42865, 'enUS', 'I don\'t know if grell have mothers, but I hope that one never kissed his mother with his mouth.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42866, 'enUS', 'I see that you have an urgent message for me. What is it?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42867, 'enUS', 'Thank you for gathering everyone together.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42868, 'enUS', 'This brew be excellent! Its taste be the best!$B$BYou\'ve proved yourself well, now I\'ll tell you where my staff rests.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42869, 'enUS', 'I have exciting news to share with you, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42872, 'enUS', 'I look forward to joining the rest of our forces.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42881, 'enUS', 'Good tidings, $n. I am told that you seek to stop the demon\'s reign of terror. Is this true?$B$BThe Legion has hunted our people across countless worlds... taken countless lives. With each of our paladins that falls the Light reels in pain.$B$BI have had enough - I will fight by your side.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42882, 'enUS', 'The Scarlet Crusade will pay for their crimes. Soon the monastery shall fall, and with it so too does the Scarlet Crusade\'s last hope for survival.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42883, 'enUS', 'Thank you, $n. You are welcome in our village anytime.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42884, 'enUS', 'The grell trapped our young within the huts. They are no longer at risk, thanks to your generous efforts.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42885, 'enUS', 'Good. This intel will prove vital to our operations.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42886, 'enUS', 'Excellent, Highlord. You\'ve arrived.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42887, 'enUS', 'Glorious.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42888, 'enUS', 'No... we underestimated the enemy.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42889, 'enUS', 'When you suddenly vanished from our awareness we thought the worst.$B$BI do not know what to make of your adventures... I will need time to process this tragedy.$B$BRegardless, I am glad you are back safe and sound.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42890, 'enUS', 'Our mission to Faronaar was successful, no thanks to me.$B$BI let my anger get out of control, and I would have paid for it dearly were it not for you.$B$BThank you, Highlord.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42911, 'enUS', 'That\'s it! This will do nicely. Please bring me as many of these as you can!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42914, 'enUS', 'I have been fighting the Burning Legion for an eternity, $n. I would be honored to impart my wisdom to you as you lead the fight against them once again. I believe I have picked up a few tricks they will not expect!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42917, 'enUS', 'You have saved my reputation, not to mention my life! Without your persistence, I would still be hanging above the Nexus yet, $n. I hope you will accept my everlasting gratitude.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42918, 'enUS', 'Excellent! The Legion will rue the day they set their sights on Azeroth!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42919, 'enUS', 'Our mission is clear, but what are our next steps?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42920, 'enUS', 'We have won the day! Caria and Varedis are no more, and we have sent a clear message to the Burning Legion that they are vulnerable, even on their own worlds.$B$BIt is about time that we celebrated, but first...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42921, 'enUS', 'Who would have thought he would be working with us?$B$BWe are now one step closer to taking the fight directly to the Burning Legion on their own worlds.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42928, 'enUS', 'Thank you, $n.$B$BThese bandages will help heal our injured allies.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42929, 'enUS', 'Thank you, $n.$B$BThese salmon will help nourish our tribe.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42930, 'enUS', 'Thank you, $n.$B$BThis meat will help strengthen our troops.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42931, 'enUS', 'The Doomhammer could be anywhere here. And that demon is still alive.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42932, 'enUS', 'You there! What is this nonsense falling into my domain? Green fire raining from the Maelstrom! Are you surface dwellers behind this?$B$B<You explain everything to the Stonemother.>$B$BA missing artifact, hm? I have not seen it, but I know where to start. You help the Stonemother, yes, and she will help you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42933, 'enUS', 'Troggs. So tiresome. Pebbles for brains. Easily swayed by any cult, demon, or dragon that tries to interfere with my rule. Thank you for giving them a solid whomping.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42935, 'enUS', 'Very very good, $C. The cavern is once more filled with their delightful wails.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42936, 'enUS', 'How delightful! Aeosera is very pleased with you, $C. As am I.$B$BNow then, it\'s time to find that artifact of yours. Thanks to your efforts, the stone drakes will help us.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42937, 'enUS', 'Oh ho ho ho! I heard the cavern shake from here, $n! It\'s good to rattle some stones and remind everyone who\'s the boss down here, I must say.$B$BNow about that hammer of yours. Your companions have come up empty, but I think you know where to go next, hm?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42940, 'enUS', 'Your champions have done well. I think I should be able to get you into the Oculus now.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42954, 'enUS', 'Books on magical illnesses? I might know where such a thing exists...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42955, 'enUS', 'Power in its purest form. It is a lovely color, is it not? A fitting gift for a book of healing. Will you come out old one, now that you are no longer lost and forgotten?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42956, 'enUS', 'Ari found just the book I needed! And she included a ring for you as well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42957, 'enUS', 'Ah, there the wikket is. Now, we see how well you can brew!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42959, 'enUS', 'These are wonderful! I couldn\'t keep them for myself, of course. But... Can you hear the bees humming in the honey brew? They sing so sweetly... Oh! What a lovely idea! Thank you, little friends.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42966, 'enUS', 'Excellent work.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42967, 'enUS', 'Well done. That should halt the Legion attacks for a while.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42968, 'enUS', 'Excellent. Our paladins will be well equipped for battle.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42970, 'enUS', 'Magni\'s information was crucial to our efforts against the Legion. And it was good to see him again.$B$BNow to find that tome about the Pillars of Creation...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42971, 'enUS', 'Now the other elements will truly fear you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42974, 'enUS', 'I thank you, $n. Without your help, one of Azeroth\'s mightiest guardians would have fallen into the hands of the Legion.$B$BYou have proven you are capable of leading my armies and defeating the Legion in their own territory.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42977, 'enUS', 'What does the Earthen Ring want with an old servant of the Windseeker?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42978, 'enUS', 'It\'s an honor, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42982, 'enUS', 'Well-earned, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42983, 'enUS', 'Excellent. You have exactly the right amount of Mistral Essence necessary to restore the pillar!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42984, 'enUS', 'Yes, this is it! With this, I will be able to bind the element of air nicely. And, maybe do some impressive tricks at future festivities.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42985, 'enUS', 'The pleasure is mine, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42986, 'enUS', 'Excellent work, Farseer. With events in his realm calmed, Windlord Thunderaan can focus his efforts on the war effort.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42987, 'enUS', 'You have impressed me, $n. No simple feat.$B$BBe sure you continue to do so.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42988, 'enUS', 'Impressive, truly impressive, Farseer! Everything I believed about your prowess has been proven true.$B$BYou have helped mend the rift caused by our enemies on the Broken Isles. We can rest easier, knowing what we have accomplished.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42989, 'enUS', '<Ma\'haat the Indomitable speaks with a low, rumbling voice>$B$BWhat... do you ask... of the earth?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42990, 'enUS', 'Yes, this is exactly what we need! I can get to work at once!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42995, 'enUS', '<Ma\'haat the Indomitable guzzles the Blood of Sargeras down his throat as he speaks.>$B$BYesh... thish ish... just what I wanted. The egg ish... yoursh!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42996, 'enUS', 'It is good to see you, Farseer. We have much to discuss!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (42997, 'enUS', 'Ah, good timing Farseer! I was hoping you would come by.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43002, 'enUS', 'This blade could indeed be the key to resurrecting the Windseeker. However, it has been damaged and the elemental soul within has diminished in power.$B$BTime may very well be running out...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43003, 'enUS', 'It\'s true! The Egg of Gaiath does exist... right before my very eyes!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43007, 'enUS', 'It is good that Valeera was able to find you so quickly.$B$BThere is something important that you must immediately attend to.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43013, 'enUS', 'I saw. Not the healthiest-lookin\' bunch, but I\'m sure they\'ll do in a pinch.$B$BRegardless, they\'ll be out with Vanessa and Garona, so what could go wrong?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43014, 'enUS', 'Phew!$B$B<Nikki wipes her brow with a sense of relief.>$B$BWhatever we offered him, I\'m glad he was agreeable. I can tell you if he wasn\'t happy, I\'d be on the first flight off this rock for sure.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43015, 'enUS', 'Things are already looking up. But, of course, in my experience, there is always some amount of bad to temper the good.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43054, 'enUS', 'Wonderful, yes yes! These supplies will fill our storehouse for weeks to come. Thank you so much, Grandmaster.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43055, 'enUS', 'Candy buckets like this are located in inns throughout the realms. Go ahead... take some!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43056, 'enUS', 'Candy buckets like this are located in inns throughout the realms. Go ahead... take some!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43057, 'enUS', 'Candy buckets like this are located in inns throughout the realms. Go ahead... take some!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43058, 'enUS', 'Yes, these will do nicely. I\'ll get them salted and cured right away!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43060, 'enUS', 'What a beautiful catch! I\'ve never seen fish this size! Thank you, Grand Master.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43061, 'enUS', 'These bandages will help save many lives. Thank you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43062, 'enUS', 'Very impressive indeed, $n. I had no doubt that your form is still top notch.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43090, 'enUS', 'I thank you, $n. That Hodir is gone is unfortunate, but things could have gone much worse and thanks to you Ulduar did not fall to the Legion today.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43100, 'enUS', 'Gul\'dan says any of power may join. What if friend joined? Then when close take the Scepter and run!$B$BYes! Could work but must work hard to earn trust. Gul\'dan still needs Eye. Friend should help with that, earn more respect.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43106, 'enUS', '<As you offer the mana crystals, they blink out of your hand one by one.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43151, 'enUS', 'Thank you, $C. I\'ll make good use of this.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43153, 'enUS', 'Yes, yes! Found the Eye! Helped Shadow Council! Now you go to ritual. Scepter will be there.$B$BTricky it will be friend, but Calydus have great faith in you!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43162, 'enUS', 'My dear sister laid to rest,$BA tortured hero proves their best,$BToday I do lift this curse,$BAnd offer you a token, a small purse,$BMy other sisters are still gone,$BThere comes a day to right their wrong...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43179, 'enUS', 'The kirin tor thank you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43182, 'enUS', 'I am relieved that this weapon of destruction is no longer in the hands of our enemies.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43184, 'enUS', 'Very astute of you to have saved the best for last.$B$B<Allari smirks playfully.>$B$BIn all seriousness, I am deeply honored that you have chosen me, $n. Something tells me that the worst is yet to come. We must remain vigilant and bring the Burning Legion to an end.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43185, 'enUS', 'Me? You want me to be one of your champions?$B$BYes, of course. A million times, yes! Just tell me where you want me to go, what you want me to do, and consider it done.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43186, 'enUS', 'Your leadership has provided us with victory after victory. We gladly serve and will sacrifice everything in your name.$B$BAll hail, Slayer $n!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43249, 'enUS', 'Now, what do you say you and I go to Val\'sharah and recover the most powerful jewel in existence?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43250, 'enUS', 'Now that you are finally here, we can begin.$B$BThe elves here have somehow risen from the dead. They are deluded. They think that we are the Burning Legion and have come here to destroy Black Rook Hold.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43251, 'enUS', 'A ledger? Wait, let me look.$B$B<Valeera reaches out and begins thumbing through the tome\'s pages.>$B$BThis is the key!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43252, 'enUS', 'Thank you, $n. It means a great deal to me that you have given my ancient ancestors the peace they deserve.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43253, 'enUS', 'The legend was true! I was right about my suspicions. I had heard about Ravencrest\'s almost perfect espionage team during the War of the Ancients. Now we know how they got their information.$B$BThe others will not believe it when we tell them. Of course, we could keep it to ourselves.$B$B<Valeera considers for a weighty moment.>$B$BNo. That is how the foolish and greedy lose their heads. We will spread the risk around to everyone.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43254, 'enUS', 'Calydus not believe that worked! Ritual messed up, Shadow Council wiped out, and we not dead!$B$BOh, and you have Scepter! Big win for friend!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43259, 'enUS', 'So you\'ve come to the crooked tree,$B$BTo name a foe you ask of me,$B$BBut listen first to my tragic tale,$B$BThen you will hear my sister\'s wail...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43261, 'enUS', 'After all that, you want me as your champion?$B$B<Vanessa gives you a look of disbelief as she takes a moment before replying.>$B$BFine, but I do things my way. Agreed?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43262, 'enUS', '<Garona spins one of her razor-sharp blades around her fingers before deftly sheathing it at her waist.>$B$BAs long as there\'s a challenge to the kill, I\'m game for whatever little missions you have in mind.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43264, 'enUS', 'Well done, Deathlord. Nazgrim and Thassarian are powerful champions. I am sure they will carry out their orders with deadly precision.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43265, 'enUS', 'It appears that Nazgrim and Thassarian were successful in their mission. We have identified several promising candidates to aid us in the war against the Burning Legion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43266, 'enUS', 'Good work, Deathlord.$B$BThese ghouls will be invaluable in the war effort on the Broken Isles. Deploy them on missions just as you would your other champions.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43267, 'enUS', 'Excellent work, Deathlord. The mission was a complete success.$B$BWith continued success in the field, the Burning Legion will surely be beaten back.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43268, 'enUS', 'That was an excellent choice, Deathlord. Feel free to speak to Zubashi whenever you require further upgrades.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43270, 'enUS', 'Excellent. Calia Menethil and High Priestess Ishanah are worthy champions. We can trust them to carry out any task we ask of them.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43271, 'enUS', 'Well met, $n. It\'s an honor to serve at your side.$B$BI\'m happy to help in any way I can.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43272, 'enUS', 'Your efforts to restore Saa\'ra have not gone unnoticed. As a humble servant of the Sha\'tar, I thank you.$B$BAs leader of the Aldor, it is my duty to safeguard all that is holy. This temple is a beacon of light that must be protected.$B$BYou can count me among your allies, willing to do whatever is necessary to destroy the Burning Legion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43273, 'enUS', 'Calia\'s mission was a success! We may be seeing some new faces around here soon.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43275, 'enUS', 'Excellent. These troops will be invaluable in our defense of the Broken Isles. Deploy them on missions, just as you would with our champions.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43276, 'enUS', 'The scouting mission was more successful than we could have imagined, $n.$B$BYour troops were able to rescue Archon Torias, a skilled researcher whose knowledge extends far beyond light and shadow.$B$BIn thanks, he has agreed to lend his expertise to our cause.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43277, 'enUS', 'Excellent choice, $n. Archon Torias will continue to conduct his research in Netherlight Temple. Speak to him when you want to make additional upgrades.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43309, 'enUS', 'Ahh, $n.$B$BSo good to see you once again. I trust you are ready to assist me with my campaign.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43310, 'enUS', 'I love Lady Lunastre like a sister, but I am afraid my hands are tied.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43311, 'enUS', 'Very well. Let us talk strategy.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43312, 'enUS', 'He is unharmed! I owe you- and Ly\'leth- a great debt.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43313, 'enUS', 'The city is buzzing with very interesting gossip, $n. Victory is that much closer.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43314, 'enUS', '<Thalyssra clutches the spellstone tightly for a moment.>$B$BHe brought this upon himself.$B$BI cannot linger in the past. Elisande is weaker without him, and we are one step closer to righting the wrongs inflicted upon the shal\'dorei.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43315, 'enUS', 'It seemed as though you had that well in hand. I did not want to... interrupt.$B$BThat is one less power hoarding noble to worry about. Well done, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43317, 'enUS', 'This may not end as cleanly as I would have preferred.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43318, 'enUS', 'We made great strides today. I will not forget this.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43319, 'enUS', 'I will do my best to teach the way of the tiger, Grandmaster: to observe the enemy, and strike without hesitation. Soon, our initiates will be ready for battle.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43323, 'enUS', 'A moment to reminisce on how far we have come. A day to look to the future and where we might go. A year of reflection on what it means to grow and a lifetime of memories made by those brave enough to seize it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43331, 'enUS', 'With the Sixtrigger brothers ended, you\'re finally able to collect your payment for services rendered.$B$BYou rummage through their most prized possessions and take your pick.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43334, 'enUS', 'Welcome $C! You seek the weapons of the storm god Ra-den?$B$BMany have traveled here to Pandaria, but none have proven themselves worthy.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43335, 'enUS', 'You built your campfire with ease, and put a perfect sear on that steak. I\'m impressed... and hungry.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43338, 'enUS', 'That tiger is serious about this, isn\'t he?$B$BWhile you were here, others came to the Temple of the White Tiger to present their offerings to him. It looks like we\'re going to have some competition.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43341, 'enUS', 'Excellent work, $n. We still have a long road ahead of us to rid this world of the Legion, but this brings us one step closer.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43349, 'enUS', 'The Aegis of Aggramar is secure within the well-defended city of Dalaran.$B$BYour quest to drive back the Legion is one step closer to fruition.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43352, 'enUS', 'You\'re becoming quite the dependable associate.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43359, 'enUS', 'May the new powers of your weapon aid you in the times ahead.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43360, 'enUS', 'Thank you. This place will never recover, but their madness need not harm others.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43361, 'enUS', 'I will study these carefully. If we are fortunate, there will be answers.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43362, 'enUS', 'I do not know how you obtained this, but I know it was not easy. Much stands against us, but you prevailed. Come. Let us restore the arcan\'dor.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43363, 'enUS', 'A small tag on this present reads:$B$BHappy holidays, $n!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43364, 'enUS', 'This present looks like it has been shaken a few times. The tag on it reads:$B$BTo a very special $R $C.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43365, 'enUS', 'Thank you... it gives Brightwing much peace to know that life continues.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43368, 'enUS', 'Your heroic efforts within the Emerald Dream were inspiring, $n. The Dream is safe for now, but it remains threatened as long as Xavius lives.$B$BI will lend you my aid. Together, let us keep Azeroth safe from those who would seek its destruction.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43370, 'enUS', 'Here you go, $n. Take care of Hati and the Titanstrike and be safe in your adventures.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43371, 'enUS', 'Hopefully our priests have a chance to rest before heading back into battle.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43372, 'enUS', 'Gilner\'s hearing voices, is he? All that dabbling in the shadows has finally caught up to him.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43373, 'enUS', 'It\'s a good thing ya showed up when you did.$B$BSo Velen wants to induce a vision? That\'s no easy task, but it\'s nothing Yalia and I can\'t handle.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43374, 'enUS', 'Your quick thinking got me out of a terrible situation. Thank you, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43375, 'enUS', 'There\'s no tellin\' how many lives ya saved by recoverin\' these vials.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43376, 'enUS', 'We\'ve found the ingredients we\'ll need for Velen\'s elixir.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43377, 'enUS', '<Saa\'ra\'s soothing voice fills your mind.>$B$BYour gift of Light is a welcome one, $C.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43378, 'enUS', 'You\'ve returned, and just in time it would seem.$B$BYalia and Zabra have just finished crafting the elixir. This lens will allow you to see what I see when the vision begins.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43379, 'enUS', 'We will not let this demon determine our fate. You have the power to change our future.$B$BI have seen the path to salvation, and you will lead us there.$B$BI must retire for now. The weight of this vision has taken its toll on my mind and body.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43380, 'enUS', 'Born of Light, I fight for Light.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43381, 'enUS', 'I owe you my life, and so much more.$B$BYou saw something in me worth saving, and allowed me to eventually believe that as well.$B$BLet me live my life with purpose, $n. Let me fight by your side.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43382, 'enUS', 'You pulled my spirit from the Void, which is no easy feat. I cannot deny the part of me that would stay there forever, embraced by the shadows.$B$BThe Void is filled with many whispers, $n. The kind that should have us all worried.$B$BWe cannot afford to be separated by our beliefs. We must come together as priests of both Light and Shadow to face the Burning Legion together.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43383, 'enUS', '<The room begins to warm as the Light expands.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43384, 'enUS', 'These are in excellent condition! Thank you, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43385, 'enUS', 'Your efforts have provided us with the information we need to move forward.$B$BIt\'s been discovered that there are a few defectors among the Scarlet Onslaught.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43386, 'enUS', 'Why are you here? Why bother saving me? I was prepared to die. I should pay for the terrible things I\'ve done...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43387, 'enUS', 'The Light truly shines upon me, $n. Your presence has proven that.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43388, 'enUS', 'The mercy you have shown brings tears to my eyes.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43389, 'enUS', 'Is this the enemy we should welcome as an ally?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43390, 'enUS', 'Alonsus sent you, did he? He\'s never shown much interest in us before.$B$BOf course, we\'ve never been ones to follow the Light, at least not in the way that most would want us to.$B$BWe embrace the Shadows as well, finding our faith in the balance between both extremes.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43391, 'enUS', 'This is it! This is the journal that contains the spell to locate Natalie\'s spirit!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43392, 'enUS', 'The lure of the Void is strong. There were times I thought I would be lost there forever.$B$BThank you for freeing me, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43393, 'enUS', 'The Forsaken will rejoice at Natalie Seline\'s return, and we will as well, knowing that the prophecy is being fulfilled.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43394, 'enUS', 'Thank the Light, $C. I didn\'t want to give up hope.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43395, 'enUS', 'I already heard of your heroism from Delas Moonfang. Thanks to you, many lives were saved.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43396, 'enUS', 'The intelligence you have gathered is further proof that the prophecy cannot be ignored. The Legion\'s attack is imminent, and we will not survive without the paladins as our allies under the Light.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43397, 'enUS', 'We will help defend Netherlight Temple and lay a trap for Balnazzar.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43398, 'enUS', 'I knew from the moment we met in the quiet fields of Tirisfal that you would be the one to unite the priests.$B$BI\'d like to take credit for finding our leader, but I really think the truth of it is, you found us.$B$BOur time together has only just begun, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43399, 'enUS', 'This should be enough to make the necessary improvements to our defenses.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43400, 'enUS', 'There\'s enough lumenstone here to craft armor and weapons for an army. Nice work, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43401, 'enUS', 'You fought well, High $C.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43402, 'enUS', 'You are a leader worthy of our praise, High $C.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43403, 'enUS', 'You have represented the Dreamgrove honorably, Archdruid. Your aid has helped many, and your victories will be spoken of for years to come.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43407, 'enUS', 'May the new powers of your weapon serve you well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43409, 'enUS', 'With this new power, the Legion will fall!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43412, 'enUS', 'May the new powers of your weapons serve you well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43414, 'enUS', 'With this new power, nothing shall stop us!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43415, 'enUS', 'May this power aid you in the times ahead.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43418, 'enUS', 'May this power aid you in the times ahead.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43420, 'enUS', 'May the new powers of your weapon serve you well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43422, 'enUS', 'May your new weapons serve you well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43423, 'enUS', 'May the new powers of your weapon serve you well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43424, 'enUS', 'May this blessed power aid you in the times ahead.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43425, 'enUS', 'May your new weapon serve you well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43441, 'enUS', 'It is decided then.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43461, 'enUS', 'A moment to reminisce on how far we have come. A day to look to the future and where we might go. A year of reflection on what it means to grow and a lifetime of memories made by those brave enough to seize it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43462, 'enUS', 'Good riddance.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43468, 'enUS', 'That ought to do it. I will make sure that The Wolf gets every drop.$B$BThank you, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43469, 'enUS', 'Well, now we know that our SI:7 friend is being held at Felsoul Hold in Suramar. Not sure why we didn\'t check there first.$B$BI trust that you already have a general plan for how to retrieve him? I know that I do. Perhaps we can put our heads together.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43470, 'enUS', 'There, now that is much better. I would say that our garden is much more beautiful.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43471, 'enUS', '$n, you\'re here. You must have received my letter.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43472, 'enUS', '$n, you\'re here. You must have received my letter.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43473, 'enUS', 'Want to earn a few quick coins? I need subjects to try one of my potions.$B$BThis one gets its unique aroma from frog eyes, frog hearts... wait a minute. Let me check the ingredient list here.$B$BMm-hmm, mm-hmm, OK, yeah.$B$BThis is pretty much just liquid frogs. Bottoms up!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43474, 'enUS', 'Want to earn a few quick coins? I need subjects to try my newest potion.$B$BUnfortunately, I can\'t taste this one myself because it contains a few ingredients that I\'m allergic to. Drinking this would be incredibly toxic to me. In fact, as far as I\'m concerned, this is just one big bottle of poison.$B$BDrink up!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43475, 'enUS', 'Want to earn a few quick coins? I need subjects to try this potion.$B$BI spent most of my development time focusing on the potion\'s effects, and not a lot on its... pleasantness. You may have to ignore the taste, smell, mouthfeel, and appearance.$B$BActually, I think I heard a few SOUNDS coming from this particular potion... you should ignore those, too.$B$BCheers!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43476, 'enUS', 'Want to earn a few quick coins? I need a new subject to try one of my favorite potion recipes.$B$BI have to admit, the last few times I tried to make a potion like this, it didn\'t work out so well for the test subjects. In fact, this is why I have to pay people to drink my potions now.$B$BPlease enjoy.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43477, 'enUS', 'Want to earn a few quick coins? I need test subjects to try my newest potion.$B$BI\'ve had several requests for vegetarian potions. You\'d be surprised how many potions have meat in them!$B$BTo compensate for the complete lack of carcasses in this potion, I\'ve had to make a few substitutions. I hope you like crushed-up bits of glass and rotten fish guts!$B$BFish aren\'t animals, right?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43478, 'enUS', 'Want to earn a few quick coins? I need test subjects to drink a potion while I watch them.$B$BI\'ve had a lot of trouble getting this potion to perform its desired effect. Mostly it just seems to make people mad at me for making them drink it.$B$BGo on, then. Drink up.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43479, 'enUS', 'A wise choice of targets indeed. The Uncrowned are fortunate to count you amongst our ranks, Mister $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43485, 'enUS', 'That was a big distraction!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43486, 'enUS', 'Aponi sent you? How is she? It is hard to keep in touch with friends in these times.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43487, 'enUS', 'Yes, I believe this is it! Just look at it, $n. I will put this knowledge to good use.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43488, 'enUS', 'Yes, this will do nicely.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43489, 'enUS', '<The book is written in Aponi\'s hand. What happened here?>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43490, 'enUS', 'Thank the Light, Highlord. I didn\'t want to give up hope.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43491, 'enUS', 'I already heard of your heroism from Aponi Brightmane, Highlord. Thanks to you, many lives were saved.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43492, 'enUS', 'Highlord, I owe you my life and my thanks. You live by the Light, as my Sunwalkers believe.$B$BIt is an honor to fight by your side, and with your permission, I would like to continue fighting for the Order of the Silver Hand.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43493, 'enUS', 'Incredible, Highlord. With the threat at Black Rook Hold contained, we can focus efforts on other areas.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43494, 'enUS', 'Wonderful! These knights will serve the order well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43496, 'enUS', 'Senegos has generously offered us his assistance in the journey ahead.$B$BA truly kind soul.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43501, 'enUS', 'Senegos has generously offered us his assistance in the journey ahead.$B$BA truly kind soul.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43502, 'enUS', 'It would seem our tree is quite thirsty.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43503, 'enUS', 'Senegos has generously offered us his assistance in the journey ahead.$B$BA truly kind soul.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43505, 'enUS', 'Senegos has generously offered us his assistance in the journey ahead.$B$BA truly kind soul.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43506, 'enUS', 'It is done. Let us prepare the Valarjar for glorious battle!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43508, 'enUS', 'Hurry, $n. We must get him out of here before the demons raise the alarm.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43509, 'enUS', 'Were you able to overcome Odyn\'s challenge?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43514, 'enUS', 'Well done. We can use this to disable the magic protecting the Heart.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43517, 'enUS', 'The ancient is at peace once more.$B$BMay his sacrifice not be in vain.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43518, 'enUS', 'Fantastic! This will do quite nicely.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43519, 'enUS', 'Well done! Everything went as planned.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43520, 'enUS', 'That is... far more than we needed.$B$BThank you, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43521, 'enUS', 'Your bravery rivals that of my own kind.$B$BWell done.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43522, 'enUS', 'That is all I can do for you, little one. If you seek more power, you must look elsewhere.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43523, 'enUS', 'Let us speak with Thalrenus and discuss our plan of action.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43524, 'enUS', 'That\'s the one! Oh, thank you, $n. Thank you!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43525, 'enUS', 'Excellent. This will work quite well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43526, 'enUS', 'I\'m... so sorry, $n. I was so sure that would work...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43527, 'enUS', 'It seems we have gained new allies. Let us figure out a plan of action.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43528, 'enUS', 'We\'ve found a back entrance into the Nighthold that should provide some relief from the armies at the main gate.$B$B\'Some\' being key.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43530, 'enUS', '<Thalrenus\' eyes widen at the sight of the Millenia Tome.>$B$BIf Elisande has seen reason... perhaps there is still hope for the Guard after all.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43531, 'enUS', '<Kalec sifts through the pile of Nightshards.>$B$BYes, these are perfect! There\'s just one more thing we need.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43532, 'enUS', 'Let us not waste another moment.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43533, 'enUS', 'Your artifact\'s new form is even more fantastic than I imagined.$B$BPlease, take what remains of the Heart as a token of my gratitude for such a marvelous adventure - there is still a fair bit of power left inside it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43534, 'enUS', 'Yes, this is just what we need to complete our preparations. These must have been difficult to come by. Thank you, Highlord.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43535, 'enUS', 'Thank you for bringing Delas with you, $n. I knew she could help us.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43539, 'enUS', 'The Ebon Blade champions sent to the Realm of Shadows have successfully returned to Acherus.$B$BSalanar the Horseman will be arriving shortly to begin preparations for the dread steeds. You should meet with him when he arrives.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43540, 'enUS', 'The Legion has plans to attack the priests\' center of command? It is critical that you discovered this information in time, Highlord.$B$BIt makes sense that the Legion would target Prophet Velen and his followers. We cannot allow Balnazzar to succeed.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43541, 'enUS', 'I believe you have chosen well, Highlord. We will help defend Netherlight Temple and lay a trap for Balnazzar.$B$BThe priests of the Conclave are formidable allies. With our combined strength, we may just have a chance against Balnazzar.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43545, 'enUS', 'Were you able to defeat Lord Ravencrest?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43546, 'enUS', 'Were you able to overcome the Emerald Nightmare?', 0);
