INSERT INTO `quest_offer_reward_locale` VALUES (43557, 'enUS', 'Were you able to overcome the Assault on the Violet Hold?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43558, 'enUS', 'And so you return with the bindings in hand. The Firelord shall be very displeased to have lost these.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43560, 'enUS', 'The bindings now belong to me. When the time comes, the Firelord shall be imprisoned as I once was. But that time is not now.$B$BYour reward is this, a small fragment of my power. Unleash it upon your blades, $R, and you shall have what you seek.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43562, 'enUS', 'We must take drastic measures.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43563, 'enUS', 'These will do nicely.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43564, 'enUS', 'If my map of the arcways is accurate, that should be all of the outlets we need to worry about.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43565, 'enUS', 'Excellent. With this, the chances of me teleporting you all to the bottom of the sea are much lower!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43567, 'enUS', 'Behold. The redemption of the Nightfallen.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43568, 'enUS', 'At last... we are free.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43569, 'enUS', 'I am not hungry any more. I can think- I will live! Oh, Arluin...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43571, 'enUS', 'Well done, Deathlord. The cords of this braid will be used in the fashioning of reins for our steeds.$B$BI assume Dargrul was more than willing to part with it, yes?$B$B<Salanar flashes an evil grin.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43572, 'enUS', 'At long last, the Nightmare Lash! Holding it in my hands, I can feel the truth of the legends.$B$BSuch power... such darkness... such... anguish!$B$BYes, this will do nicely.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43573, 'enUS', 'The Ebon Blade\'s success on the battlefield has not gone unnoticed by the Burning Legion.$B$BAs we continue the war effort, we must be mindful of increased attention from the forces of Sargeras...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43574, 'enUS', 'The legendary Maul of the Dead... it resonates with the hatred and despair of countless anguished souls. As a tool of misery, it is the embodiment of perfection.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43576, 'enUS', 'Already my mind is sharper.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43577, 'enUS', 'The Valarjar have captured the Legion\'s gateway at Felblaze Ingress.$B$BThe time has come to deliver a decisive blow to the enemy. We shall not wait for them to strike here!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43581, 'enUS', 'Your next steps will be difficult, young one, and more dangerous than any threat you\'ve faced, but they must be taken.$B$BFor the good of Azeroth.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43582, 'enUS', 'That was quite the spectacle, $n.$B$BSu\'esh will be a valuable ally in the days to come. I will keep an eye on her for the time being.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43585, 'enUS', 'You and your armies have accomplished much. Odyn chose his commander well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43586, 'enUS', 'A glorious victory! It\'s unfortunate that Helya survived, but she will think twice about moving against us with you leading the armies of Skyhold.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43587, 'enUS', '<As you imbue the feed with the mana the structure stirs to life. Your skin tingles as the surrounding air becomes charged with arcane power.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43588, 'enUS', '<As you imbue the feed with the mana the structure stirs to life. Your skin tingles as the surrounding air becomes charged with arcane power.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43590, 'enUS', '<As you place the broken piece onto the pillar and begin infusing it with mana, arcane energy begins to repair the break. It slowly begins to turn as the leyline is activated.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43591, 'enUS', '<As you insert the fragments back into the pillar the arcane energy begins repairing the cracks. You infuse the feed with ancient mana and the structure stirs to life.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43592, 'enUS', '<As you imbue the feed with the mana the structure stirs to life. Your skin tingles as the surrounding air becomes charged with arcane power.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43593, 'enUS', '<As you imbue the feed with the mana the structure stirs to life. Your skin tingles as the surrounding air becomes charged with arcane power.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43594, 'enUS', '<As you imbue the feed with the mana the structure stirs to life. Your skin tingles as the surrounding air becomes charged with arcane power.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43595, 'enUS', 'I will see that these blades are returned where they belong.$B$BThe dead smile upon you, outsider.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43596, 'enUS', 'With the dread ship sundered, the souls of the dead will know their judgement. $B$BOdyn will have his champions, and the Tideskorn will have their honor.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43604, 'enUS', 'Very well then. Let it be done!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43643, 'enUS', 'Thank you, Battlelord. The Valarjar will be even better equipped once I\'ve made my adjustments.$B$BIt has also inspired me to think of your weapon. The Blade Breaker. In my mind\'s eye the axe is called that.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43644, 'enUS', 'Very good!$B$BIf you haven\'t been to this realm before, I have learned a trick or two to give you your \"Sea Legs,\" allowing you to breathe underwater for the duration of our mission here.$B$BNow, let\'s find out missing $C and the scepter she was looking for!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43645, 'enUS', '<You report your findings to Erunak, who listens distractedly while flipping through the journal you located.>$B$BSo... the naga have conscripted sea giants to their cause? This is disturbing.$B$BAdelee\'s journal confirms my fears. The naga have infiltrated the Abyssal Maw once again, and this time they have a powerful weapon with them: Sharas\'dal. Our task is clear.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43686, 'enUS', 'I see now what I did not see before. My destiny was written long ago.$B$BThis burden has always been mine to bear.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43687, 'enUS', 'It is done. I hope you\'re right about this, Highlord.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43697, 'enUS', 'Thank you for leading us to victory. All hail, Highlord $n!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43698, 'enUS', 'There\'s enough lumenstone here to craft armor and weapons for an army. Thank you, Highlord.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43699, 'enUS', 'Thank you, Highlord. Too many dangers abound in these dark times. With heroes like you out there, we are all a little bit safer.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43700, 'enUS', 'Victory is ours, Highlord.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43701, 'enUS', 'I am sure you have many questions, Highlord $n. It was fate that our paths crossed that day on Niskara.$B$BI serve High Exarch Turalyon and Lady Alleria Windrunner. When the Legion turned its armies toward Azeroth, I was sent here to help protect it.$B$BHow I got to Niskara is a tale for another time, but had it not been for you, I would still be Balnazzar\'s prisoner.$B$BNow, I can fulfill my original mission. Let me fight for you. Together, we will drive back the Burning Legion!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43702, 'enUS', 'This place remains deadly, but we can now press forward.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43705, 'enUS', 'You have my thanks, and the gratitude of the Broken, hero. Many would have considered us an acceptable loss, yet you have shown us great compassion and kindness. An act that I - we - will not soon forget.$B$BNow we will return to the Vault of Lights and assist Velen as best we can.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43723, 'enUS', 'I am honored beyond words, $n. I will gladly serve as your champion.$B$BPoint me in the right direction. I can sneak anywhere. Find out anything.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43724, 'enUS', 'Shall we form an alliance, you and I? Of course, I dare not officially become one of the Uncrowned, let alone the Council of Shadows.$B$BI am the leader of SI:7 after all.$B$BBut, when you need my assistance or guidance, you need but ask. I will be there. We will work together through back channels to ensure that the Burning Legion is destroyed.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43726, 'enUS', 'Hey, wow! It IS a book!$B$BI\'m always looking for my next good light novel. What\'s this one about? A $C who fights some stuff? Neat!$B$BHere, have some coins.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43749, 'enUS', 'You are lovely. Just lovely. I\'ll get to work right away.$B$BKeep us in mind with any resources the Tirisgarde can spare. If you can keep the researchers busy, we should unfold everything there is to know about your weapon in no time.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43750, 'enUS', 'Ah yes, the Gjallarhorn.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43785, 'enUS', 'Highlord $n, for many years I sought to follow the footsteps of my father, Turalyon.$B$BIn you, I see an exemplary leader, one who can still teach me so much. In you, I see a champion rivaling my father himself.$B$BI would gladly lay down my life and fight for the Order of the Silver Hand.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43797, 'enUS', 'With the paladins on our side, united under the Light, the prophecy is fulfilled.$B$BWe must now prepare. Balnazzar will attack, and we need to be ready.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43806, 'enUS', 'Ah, $n, you\'re up! I\'m relieved you made it out of that bloodbath alive. We lost so many good women and men down there...$B$B$B$BDamn the Horde for serving us up to the Legion!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43808, 'enUS', '<The beacon glows as you infuse it with Ancient Mana.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43809, 'enUS', '<The beacon glows as you infuse it with Ancient Mana.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43810, 'enUS', 'Any regret I had for these people vanished when they went under that shield.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43811, 'enUS', '<The beacon glows as you infuse it with Ancient Mana.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43812, 'enUS', 'Excellent. We will be able to defend our borders for now.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43813, 'enUS', '<The beacon glows as you infuse it with Ancient Mana.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43829, 'enUS', 'Why is Mathias Shaw stepping up the number of agents that he has in Horde territory?$B$BWe must keep a close and watchful eye on this situation.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43832, 'enUS', 'You are as dependable as you are resourceful.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43841, 'enUS', 'Arrr! Now that be what I like t\' hear.$B$BWhat do you think, Crackers... will a bunch o\' freebooters class up this crow\'s nest or scuttle th\' ship? I say it\'s a fair toss o\' th\' bones.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43851, 'enUS', 'It is an honor to serve you, High $C.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43852, 'enUS', 'Now that\'s more like it. Get them some holystone and put them t\' work scrubbin\' th\' deck.$B$BThat and a few black jacks o\' rum will put courage in their sails.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43877, 'enUS', 'Excellent. I\'ll get back to you with the results as soon as I can.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43878, 'enUS', 'Excellent. I\'ll get back to you with the results as soon as I can.', 0);
