INSERT INTO `quest_offer_reward_locale` VALUES (43882, 'enUS', 'Were you able to overcome the The Nighthold?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43883, 'enUS', 'Excellent. I\'ll get back to you with the results as soon as I can.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43884, 'enUS', 'Excellent. I\'ll get back to you with the results as soon as I can.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43885, 'enUS', 'On it, boss. Will get back to you soon!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43886, 'enUS', 'Thank you. I\'ll get back to you with what I\'ve learned soon.', 0);
