INSERT INTO `quest_offer_reward_locale` VALUES (43895, 'enUS', 'A simple exchange with complex results. That\'s the art of doing business.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43896, 'enUS', 'A simple exchange with complex results. That\'s the art of doing business.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43897, 'enUS', 'A simple exchange with complex results. That\'s the art of doing business.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43898, 'enUS', 'We\'ve found a back entrance into the Nighthold that should provide some relief from the armies at the main gate.$B$B\'Some\' being key.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43899, 'enUS', 'Excellent work, Deathlord. The missions for the Steeds of the Damned were successful. Salanar the Horseman now has the first set of necessary components for conjuring the steeds.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43902, 'enUS', 'Were you able to overcome the Emerald Nightmare?', 0);
