INSERT INTO `quest_offer_reward_locale` VALUES (43923, 'enUS', 'Good work, $n.$B$BThese supplies are crucial to crafting the elixirs we will need for the upcoming battle.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43924, 'enUS', 'Good work, $n.$B$BThese supplies are crucial to crafting the elixirs we will need for the upcoming battle.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43925, 'enUS', 'Good work, $n.$B$BThese supplies are crucial to crafting the elixirs we will need for the upcoming battle.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43926, 'enUS', 'The ships are leaving from the dock in Bladefist Bay.$B$BBefore you leave, prepare yourself. I have the feeling that this fight won\'t be an easy one.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43928, 'enUS', 'With the Aggregates of Anguish procured, our work is nearly complete. Soon, the Steeds of the Damned will rise... and the Burning Legion will fall!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43929, 'enUS', 'Greetings, $n.$B$BIt is my understanding that you have been one of the foremost scribes responsible for equipping our forces with Vantus runes. Do not think that your efforts as an artisan have gone unnoticed.$B$BWe noticed.$B$BI would like to present you with this technique. Now go, and use it to help us win this war.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43933, 'enUS', 'Highlord, I am proud to begin the first steps of this new journey.$B$BThank you for taking me under your wing. I vow to follow the guiding principles - to act honorably, to uphold what is righteous, to fight against injustice, and to celebrate with my new brothers and sisters of the Silver Hand.$B$BUnder the Light, we stand as one!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43934, 'enUS', 'Thank you, Highlord.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43935, 'enUS', 'Excellent. You can begin as soon as you are ready.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43942, 'enUS', 'Just what I\'ve been looking for! <King Mrgl Mrgl studies the artifact> Ah! Yes. But there must be more of these Timeworn Artifacts still on the shore. Any more you can bring back would be greatly appreciated!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43945, 'enUS', 'Very well. Your allies have gathered here on the precipice - they will know how best to proceed.$B$BMay the winds be ever in your favor, Farseer.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43949, 'enUS', 'A powerful weapon for a powerful champion of the Halls. Let us begin.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43958, 'enUS', 'So it\'s true? An SI:7 agent was assassinated in our own backyard?$B$BIf SI:7 links us to the murder, this will be bad for business. We\'ll need to get to the bottom of this sooner rather than later...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43962, 'enUS', 'Very well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43969, 'enUS', 'I will help you, but first I need you to do something for me.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43973, 'enUS', 'A wise choice.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43975, 'enUS', 'I will rally the worthy in Odyn\'s name.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43980, 'enUS', 'A sound choice.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43984, 'enUS', 'Yes, very good choice!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43991, 'enUS', 'Did you sense the protectors of the wilds? Their presence is ever with us.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43994, 'enUS', '<She tenderly plucks the crystals from your hand one by one.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (43995, 'enUS', '<She hesitates for a moment before accepting the crystals.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44004, 'enUS', 'Kil\'jaeden took the child from Velen, let Velen believe that the boy had been killed, then raised the child as an agent of the Burning Legion with the express purpose of murdering his own father? That bastard waited 13,000 years to exact vengeance upon Velen for defying Sargeras and the Legion? The Deceiver indeed...$B$BFor Velen to have to experience such tragedy after what he and his people have already been through is heartbreaking. Such a thing would test anyone\'s faith.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44006, 'enUS', 'The path ahead is clear. Your allies await you on this ledge. May the spirits walk with you, Farseer!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44009, 'enUS', 'Most curious indeed! This is no object of the Legion\'s making. Let me have a closer look.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44034, 'enUS', 'Yes, I think that will do rather nicely as well.$B$BGood choice.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44040, 'enUS', 'I know of Coryn. We will not underestimate his venom, rest assured.$B$BThank you for helping Aurore. She is a dear friend of mine.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44041, 'enUS', 'Let me get this straight...$B$BYou are saying that Master Mathias Shaw ordered the death of one of his best agents? This is far more serious than I first thought.$B$BWe\'ll need to continue the search for clues...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44043, 'enUS', 'A wise path to follow - may it take you far.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44051, 'enUS', 'I heard rumors that you intend to leave the City... that there is another place for the Nightborne where we are not beholden to Elisande\'s insanity.$B$BI wish to go with you.$B$BI can offer my harp and my hands, as they are not wanted here.$B$BSay the word and I will go with you through the teleporter and share my music with whomever awaits me on the other side.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44052, 'enUS', 'It is a relief, if a small one. You have done well - rest for now.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44053, 'enUS', 'She certainly is a worthy companion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44055, 'enUS', 'The other demons we will contend with in time. But that pit lord, it was a creature of great evil and beyond our devices to defeat on our own. Your skills were appreciated.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44057, 'enUS', 'Yes, its all here, the location of the hunt for Volpin. $B$BI\'m sure there are better uses for a wonderful creature such as he than a pelt on some Noble\'s shoulders, don\'t you agree?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44063, 'enUS', 'Excellent. There\'s no time to waste.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44074, 'enUS', 'Thank you, Archdruid.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44075, 'enUS', 'Excellent, Arch $C.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44076, 'enUS', 'I am sad to hear of Oakheart\'s demise, but his soul will live on.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44077, 'enUS', 'Wonderful. This is exactly what we need.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44082, 'enUS', 'Greetings, Deathlord. It is an honor to serve you.$B$BI have been keeping an eye on the casualties of the Alliance and Horde upon the battlefield. Supply is limited, but there are some very promising prospects...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44083, 'enUS', 'The altar is coated with hundreds of years of dust, but the candles somehow still glow in the distance.$B$BThis must be the site for the ritual.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44084, 'enUS', '<Thalyssra is speechless for a moment.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44087, 'enUS', 'Commander. I am glad to see that Asha was able to find you so quickly.$B$BThere is something important that you must attend to as soon as possible.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44089, 'enUS', 'Friend is very wise! You can never have too many weapons!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44090, 'enUS', 'I see you received my message.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44092, 'enUS', 'You\'ve done it! You\'ve broken an invasion!$B$BIf only that had ended our campaign. But the Legion will never relent until they are destroyed... or have destroyed us.$B$BDon\'t let up! Fight off more of these wretched invasions, $n. The wyrmtongue we\'re holding captive here will reward your efforts.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44098, 'enUS', 'Good to see you, $n. My apprentices are learning rapidly and are ready to serve you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44099, 'enUS', 'It\'s so good to see friend once again.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44100, 'enUS', 'I see you received my message.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44101, 'enUS', 'Very well, I yield - I yield!$B$BCurse you, $C, and that weapon of yours. Without it the Grimtotem would\'ve been victorious.$B$BTake your lousy supplies. But we will be back!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44106, 'enUS', 'Welcome, $n. News of your heroism spreads from the Dreamgrove.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44112, 'enUS', 'You\'ve crafted this rather well. I\'m slightly impressed.$B$BNow let me see that silk of yours...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44116, 'enUS', 'Ye had best keep ye voice below whispers, matey... thar be a band \'o pirates ahead! Fer sure, these be not th\' type ye want to mess around wit\'...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44117, 'enUS', '<Fleet Admiral Tethys pops the cork from a bottle and takes a long gulp.>$B$BAye, \'tis be th\' stuff, $n. Ye\'ve done well!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44120, 'enUS', 'I see by the blood spatters that Jace revealed the demons to you. I trust the young king is safe.$B$BWe have more work ahead of us, $C. Much more.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44137, 'enUS', 'You are a most welcome sight, $n. And, you brought considerable firepower in the form of Archmage Khadgar.$B$BMalevolence has been portaling us back and forth between here and the Fel Hammer. We pushed the demons out of these ruins, but they are stronger than any we have encountered before.$B$BYour leadership is greatly appreciated. If we do not crush this Legion invasion now, they will overrun Azsuna and then the rest of the Broken Isles.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44140, 'enUS', 'Oh, $n, it\'s you. Good, we\'ve got a little problem here.$B$BKayn didn\'t think that Cyana and I could handle this on our own? He might have been right this time.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44152, 'enUS', 'I must find a way...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44153, 'enUS', '<A force within Light\'s Heart activates as you lay it down.>$B$B<You feel hopeful.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44155, 'enUS', 'Aye, what do ye have thar? \'tis be a letter from Master Mathias Shaw himself! Writ\' to th\' Red Blade no less.$B$BAye, it be just as I thought... these orders be fishier than a bucket \'o chum!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44156, 'enUS', 'We must find a solution. We are running out of time.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44159, 'enUS', 'Have at it, $n. Make your choice.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44161, 'enUS', 'Well, at least we\'re going to have some fresh faces around here. If a broken\'s face can ever be called fresh, that is.$B$B<Kor\'vas smirks.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44164, 'enUS', 'Ah, $n, you have returned. An otherworldly air hangs heavy about you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44166, 'enUS', 'Ah, $n, you have returned. An otherworldly air hangs heavy about you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44167, 'enUS', 'Ah, $n, you have returned. An otherworldly air hangs heavy about you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44171, 'enUS', 'Well done, $n. I knew you could do it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44172, 'enUS', 'Well done, $n. I knew you would do it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44173, 'enUS', 'I trust your battles went well. And that\'s not just a turn of phrase. I know they did. I knew they would.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44174, 'enUS', 'Well done, $n. With courage, you have faced every challenge along the way, and battled every day to claim your rightful place.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44175, 'enUS', 'Well done, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44176, 'enUS', 'The heavy chest offers plenty of room to carry all of your belongings.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44177, 'enUS', 'SI:7 made a secret deal with The Red Blade to hunt down Amber Kearnen?$B$BIt seems that Master Mathias Shaw was willing to pay any cost to have her dealt with...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44178, 'enUS', 'Aww, yesss! That\'s the stuff!$B$B<Noggenfogger pops the cork and dabs some of the potion on his finger.>$B$BHave mercy! WOWZA! I\'m going to need some time alone with this stuff!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44180, 'enUS', 'Look, $n. I\'ll level with ya...$B$BWithout your thieving prowess I\'d be a much poorer goblin than I am today. I think we should keep this gold-en partnership going!$B$BYou scratch my back, I\'ll scratch yours. Together, we\'ll put an end to this Burning Legion invasion and line our pockets with all the wealth in Azeroth!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44181, 'enUS', 'Aye, matey! We\'ve had some good voyages together! Blood was spilt, rum was drank, n\' our search fer clues was a success!$B$BI\'ll level wit\' ye, $n. I be not havin\' such an adventure in some years now. Sailin\' wit\' ye felt like early mornin\' on th\' poop deck when th\' salty ocean rum splashes ye wide awake!$B$BHow abouts I come aboard n\' join yer crew as first matey?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44182, 'enUS', 'I shored up Karazhan\'s defenses as best I could, but I have little confidence they\'ll hold. We have other matters to focus on in any case.$B$BGul\'dan has set his demon dogs loose upon Dalaran. He wants this city gone... but we\'re not going to let him have his way.$B$BI believe Dalaran will become the focal point of our campaign against the Legion, neutral ground where the heroes of every kingdom can join together against our mutual foe.$B$BLet\'s get to work, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44183, 'enUS', 'This is a dangerous mystery we\'ve stumbled upon, $n. It would not be fair for me to stand idly by as you risk your life to uncover this corruption.$B$BAfter all, without honor and brotherhood among thieves, none of us will stand to profit!$B$BFrom this point on, I\'ll pledge my personal services against the threat of the Burning Legion and the dark mystery we are unraveling. My blade is yours, $n...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44184, 'enUS', 'Ah, $n, it\'s good to see you on your feet! The members of the Council of Six are recuperating from their ordeal.$B$BThe intensity of the teleportation spell can be disorienting. It seems you lost consciousness for a time, but at least you didn\'t awaken to find yourself stuck in a wall!$B$BDalaran has been relocated to the Broken Isles. From here, we will spearhead the effort to acquire the Pillars of Creation and drive the Legion from Azeroth once and for all!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44195, 'enUS', 'The orders been sent, my people are on the case. Check back soon and you can pickup the shipment right here.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44202, 'enUS', '$n, I hope you don\'t mind me dropping by unexpectedly. I was in the area on business.$B$BMy people procured what look to be some rather nice armaments for the cause. I\'m sure that you know best how to distribute them.$B$BDo not doubt that our continued cooperation, even if it is a bit cloak and dagger, is making a huge difference in the war against the Burning Legion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44203, 'enUS', 'Shadowblade $n, always a pleasure. I was in the area on Alliance business and decided to drop in. It looks like our operations are faring well.$B$BMy people procured what look to be some rather nice armaments for the cause. I\'m sure that you know best how to distribute them.$B$BThough we must continue to cooperate through back channels and behind closed doors, know that for the duration of the war against the Burning Legion, you can count on my support and that of SI:7.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44204, 'enUS', 'The order has been sent. Once my people have procured the item, it will be here for you to collect.$B$BGood... luck.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44205, 'enUS', 'The ritual has begun. This will take some time. Return later.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44206, 'enUS', 'The ritual has begun, they will Rise. Return here when the ritual is complete.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44207, 'enUS', 'All those years of study are really paying off...$B$BOnce they\'ve sent the shipment through, it will be waiting here for you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44208, 'enUS', 'The spell has begun. Return to me when it is complete. Fate is in the hands of time now.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44209, 'enUS', 'Well done, though that certainly takes all of our efforts. It will be some time before we can do that again.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44211, 'enUS', 'The order has been issued. Once the shipment arrives it will be here for you to collect.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44212, 'enUS', 'Word has been sent. The Seal will arrive soon.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44213, 'enUS', 'Our glaives are yours, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44214, 'enUS', 'Excellent. You\'re going to like this.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44215, 'enUS', 'I think you will appreciate this. I must admit to a certain level of envy.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44217, 'enUS', 'We is with you, $n!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44218, 'enUS', 'Aye, sir, the men have their orders. Once the shipment arrives it will be here for you to collect.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44219, 'enUS', 'Word has been sent. The Seal will arrive soon.', 0);
