INSERT INTO `quest_offer_reward_locale` VALUES (44228, 'enUS', 'Murr will make Lurr smash fast! When he done smashing, we put it in box. Box here for you later.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44229, 'enUS', 'The order has been placed. Once the shipment arrives it will be here for you to collect.', 0);
