INSERT INTO `quest_offer_reward_locale` VALUES (44231, 'enUS', 'The order has been placed. Once the shipment arrives it will be here for you to collect.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44232, 'enUS', 'We are with you, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44233, 'enUS', 'Yours is the path we will follow, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44234, 'enUS', 'Well done, though that certainly takes all of our efforts.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44235, 'enUS', 'Word has been sent. The Seal will arrive soon.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44237, 'enUS', 'The sapling ignores you, but seems busy at work. Perhaps you should return later.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44238, 'enUS', 'Word has been sent. The Seal will arrive soon.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44239, 'enUS', 'Tianili seems distracted. Perhaps you should return later.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44240, 'enUS', 'Our hearts and minds are with you, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44243, 'enUS', 'These Knights of the Ebon Blade are a powerful order, Deathlord.$B$BThat you command such respect amongst their ranks speaks to your strength and leadership.$B$BDuring my life, I always fought to preserve my kingdom and people. But for my failure as a father, their blood now stains my hands.$B$BSo, I will wash the failure from my hands with the blood of demons. The time has come for me to return to the fray. My sword is yours to command.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44244, 'enUS', 'Words cannot fully express my gratitude for rescuing me, $n. In truth, I always knew that the Ebon Blade would not forsake me.$B$BI do not wish to elaborate on my years in captivity. That time has passed and we are now presented with an imminent danger in the Burning Legion.$B$BMy blade is yours, Deathlord. My life and my allegiance are yours to command.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44245, 'enUS', 'There is no greater hatred and scorn in this world than that which exists in my heart.$B$BThe Burning Legion will pay for all that they have taken from me.$B$BThe day of my judgment awaits, but theirs is at hand and I will be the executioner\'s blade. I will not rest until every demon lays dead, their corpses paving the very ground I walk!$B$BCommand me to the front, Deathlord and I will rain terror upon the armies of the Burning Legion!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44246, 'enUS', '<Rottgut motions in your direction, gurgling and belching the words from its gaping mouth.>$B$BROTTGUT!!$B$BROTT. GUTT. ROTT! ROTTGUT ROTTGUT ROTTGUT!!!$B$BGUT? ROTTGUTT, GUT. ROTT... GUT!$B$BROTTGUT??', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44247, 'enUS', 'Deathlord, I have been your humble tutor in the dark arts for some years now. From your birth at the hands of the Lich King, to your ascension as leader of our order, I have taken pride in watching you grow in power and undeath.$B$BI believe the time has passed in which my services as a teacher are necessary. Perhaps I would be of more use to you on the battlefield?$B$BThe time has come for me to warm these frozen bones of mine in the blood my enemies. Please, allow me to be of service on the battlefield.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44248, 'enUS', 'The Four Horsemen of the Ebon Blade are gathered together, but our work has only just begun.$B$BThe Burning Legion has come to our world hungering for destruction, but we will feed them their own demise. Apocalypse awaits the demon invaders and we shall bring it to them!$B$BDeathlord, you have triumphed where no others could have succeeded. I shall lead the Four Horsemen like my father before me, and so long as I lead them our loyalty is yours!$B$BThe return of the Four Horsemen is at hand!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44249, 'enUS', 'In this fight, our spirits are as one, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44250, 'enUS', 'We stand with you, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44251, 'enUS', 'We are with you, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44252, 'enUS', 'Our blades are yours, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44253, 'enUS', 'We stand with you, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44254, 'enUS', 'The Council admires your power, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44255, 'enUS', 'The might of the Valarjar stands with you, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44257, 'enUS', 'Most curious indeed! This is no object of the Legion\'s making. Let me have a closer look.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44258, 'enUS', 'Were you able to overcome Violet Hold?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44259, 'enUS', 'Were you able to overcome Violet Hold?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44260, 'enUS', 'Were you able to overcome Vault of the Wardens?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44261, 'enUS', 'Were you able to overcome Vault of the Wardens?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44263, 'enUS', 'Were you able to overcome The Arcway?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44264, 'enUS', 'Were you able to overcome Neltharion\'s Lair?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44265, 'enUS', 'Were you able to overcome Neltharion\'s Lair?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44266, 'enUS', 'Were you able to overcome Maw of Souls?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44267, 'enUS', 'Were you able to overcome Maw of Souls', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44268, 'enUS', 'Were you able to overcome Odyn\'s challenge?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44269, 'enUS', 'Were you able to overcome Odyn\'s challenge?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44270, 'enUS', 'Were you able to overcome Eye of Azshara', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44271, 'enUS', 'Were you able to overcome Eye of Azshara', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44272, 'enUS', 'Were you able to overcome Darkheart Thicket?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44273, 'enUS', 'Were you able to overcome Darkheart Thicket?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44275, 'enUS', 'Were you able to overcome the challenge?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44276, 'enUS', 'Were you able to defeat Lord Ravencrest?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44277, 'enUS', 'Were you able to defeat Lord Ravencrest?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44278, 'enUS', 'We mourn together brother over the loss of Arduen, Cassiel, and Sirius. But, I owe you my life... again.$B$BThere is one thing I learned during my time in the prisons: the demons within Black Rook Hold must die.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44281, 'enUS', 'You look quite prepared for battle. Do not let the bloodlust overtake you out there.$B$BThe Warchief wishes to present you with this ring before you head to war. May you return with the heads of many demons.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44282, 'enUS', 'So this is the legendary Frozen Soul Pendant! I sense a great power in this item...$B$BI will begin my study of it at once. You have my gratitude, Deathlord.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44283, 'enUS', 'Incredible... where did you find these? With these Essences, I will be able to open the way directly to the heart of the Nightmare. Let us make haste!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44284, 'enUS', 'Incredible... where did you find these? With these Essences, I will be able to open the way directly to the heart of the Nightmare. Let us make haste!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44285, 'enUS', 'Incredible... where did you find these? With these Essences, I will be able to open the way directly to the heart of the Nightmare. Let us make haste!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44286, 'enUS', 'Yes, these parts shall do nicely!$B$BNow go on and introduce yourself to Rottgut! I\'m sure the two of you will get along... infamously!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44306, 'enUS', 'The Blessings are under way, they will be ready for you to receive here shortly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44310, 'enUS', 'So it shall be done.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44337, 'enUS', 'If this works, then perhaps there is still hope for Turalyon and the Army of the Light.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44338, 'enUS', 'If this works, then perhaps there is still hope for Turalyon and the Army of the Light.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44366, 'enUS', 'So it shall be.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44370, 'enUS', 'Agreed. We must seek it out at once.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44375, 'enUS', 'I couldn\'t agree more.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44379, 'enUS', 'Good idea. There is no more dependable ally than a worthy blade.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44383, 'enUS', 'I think that is wise. We need every weapon we can gather to defeat the Legion once and for all.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44400, 'enUS', 'Whew. That\'s a SECOND invasion dealt with. Well done.$B$BNow, who do I talk to about getting this place shut down?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44401, 'enUS', 'Very well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44406, 'enUS', 'I have been waiting for you, Farseer.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44407, 'enUS', 'That was probably the easiest decision you\'ve had to make! Let\'s get started.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44411, 'enUS', 'Such a cacophony! I could hear it before you pulled it from your pack.$B$BWhat you\'ve got there is a highborne memory crystal, somehow still intact. Created by ancient sorcery, they were used to store memories, stories, music, history, and whatnot.$B$BQuite rare! With a little... tinkering... I should be able to create something useful with it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44412, 'enUS', 'I appreciate your discretion, $n.$B$BNow, look here! I have imparted all of my substantial worldly wisdom into this globe, in addition to my ruggedly handsome features. No doubt you will find my counsel invaluable in your travels.$B$BI could only get it to say a handful of phrases, however, so be VERY SPECIFIC in your questions.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44414, 'enUS', 'We\'ve done it! Without you, I fear I would have eventually succumbed to the onslaught.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44415, 'enUS', 'A wise warrior welcomes all allies. You fight with the strength of an orc.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44416, 'enUS', 'The spirits honor us with a day of glorious combat! You have my well-earned respect, Illidan Stormrage. I will gladly follow you into any battle.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44417, 'enUS', 'That will definitely increase your power greatly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44421, 'enUS', 'Good work. There are still some stray anomalies floating about, but you\'ve negated enough interference that we should no longer be prevented from relocating the city.$B$BNow we just need to determine our destination.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44424, 'enUS', 'A wise choice.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44431, 'enUS', 'A sound choice.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44443, 'enUS', 'A sound choice.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44448, 'enUS', 'Dead? The titans are dead?$B$B<Khadgar ponders the news for a minute.>$B$BIt explains so much, yet I cannot help but feel an overwhelming sense of sadness. We have been on our own all along. Our gods killed before we were born.$B$BAs for the Army of the Light and Illidan, I am at a loss. I have never felt so powerless.$B$BIllidan is dead and the Golden Army fights an endless war in our name from across the cosmos.$B$BI need a moment, $n. This is too much bad news for an old man to bear.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44449, 'enUS', 'Look at that shine!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44457, 'enUS', '<Maiev\'s face is bruised, her lips cracked, and her body covered in scars. She looks thin and ragged, but she moves with purpose.>$B$BFor weeks they tried to break me. Amateurs!$B$BI kept my silence. I counted the minutes, measured their steps, and listened to the voices beyond my cell.$B$BI have been waiting for my chance to escape, and to strike back at my captors.$B$BNow, you bring my armor AND my blade. It\'s your turn to set me free, $C. Let us destroy the Legion together.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44463, 'enUS', 'I must admit, you saved us from what might have been a terrible tragedy. You have my gratitude, $C.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44464, 'enUS', 'An auspicious start to a life of tragedy. Perhaps one of the few joyous memories Illidan would have in his life. While the years that followed tested the prophesied child, they would never break him. You must remember that, despite what you may see as our journey continues.$B$BThere is much more to be done, but I am not yet ready. I will call for you when it is time.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44465, 'enUS', 'Greetings, Farseer $n. I have been waiting for you.$B$BThe Earthcallers are ready and at your command!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44466, 'enUS', 'Failure. Rejection. From that day, Illidan would be haunted by both. Ever undaunted, he would continue the search for his destiny. Another path would be found.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44471, 'enUS', 'Of course the Legion would try to infiltrate this funeral. Having all the leaders of the Alliance gathered in one place at one time... it is too tasty a target for the demons to resist!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44473, 'enUS', 'I trust the young king is safe.$B$BWe have more work ahead of us, $C. Much more.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44479, 'enUS', 'The line between good and evil is thin, and resides in a place where intention means little.$B$BIllidan wondered how those around him could be so blind to the threat of the Burning Legion. Fate is not without a sense of irony.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44480, 'enUS', 'Illidan sought out the truth and was blinded by what he saw. He was beginning to understand his destiny, but there was one final sacrifice that he had yet to make.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44481, 'enUS', 'I wept when I touched your consciousness in the Great Dark, mortal. For I saw his fall, and I saw you, your shadow casting a dark pall over his body. I felt hatred in your heart as it corrupted your mind.$B$BIt was not Light\'s Heart, but you, that needed preparation. Now you know truth. Are you prepared to do what must be done to save your world and all others?$B$BWhen the time is right, I will call upon you to begin the hunt for Illidan\'s soul.$B$BHis rebirth will be the story of your redemption.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44486, 'enUS', 'Ah, the burns can be reversed with the right alchemic tinctures.$B$BHow interesting. A formal Darnassian writing style with... demonic affectations.$B$BI suspect I know who penned this.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44487, 'enUS', 'I would recognize that handwriting anywhere. This is our own Khadgar\'s journal!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44488, 'enUS', 'Foul magic wards these texts.$B$BMuch stronger than anything I\'ve seen before, but nothing that can\'t be undone by our mages!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44489, 'enUS', '$n, you are a sight for sore eyes. You have my gratitude for releasing me.$B$BI do not know how long I have been held captive... but I sense an overwhelming number of demons nearby.$B$BI have much to do here. Care to join me?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44490, 'enUS', 'Grimwing was a formidable demon... I must say I am always impressed with your skill, $n.$B$BThere are many more demons here to kill. It is good to be at your side once more.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44492, 'enUS', 'Now listen closely.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44493, 'enUS', 'Do your best to pick this up the first time - I do hate repeating myself.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44495, 'enUS', 'Perhaps there is hope for outlanders after all.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44496, 'enUS', 'In the end, the denizens of Azeroth and Outland came to exact their vengeance upon Illidan. Though you did not strike a blow against him, you were complicit in his fall.$B$BI showed you Illidan\'s life so that you would understand why he fought and made the choices that he made. Yours was the vessel that needed preparation.$B$BIf the hatred and doubt in your heart has subsided, take your place at the side of the Light. Soon I will call upon you as we begin the hunt for Illidan\'s soul.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44497, 'enUS', 'Forgive me, noble soul. I mislead you. Light\'s Heart was not the vessel that required preparation, it was yours.$B$BYou, who sacrificed everything for your world, and served your master dutifully until the end. These memories will serve to strengthen your resolve. Look to them when the dark temptation surrounds you and let them grant you the strength to resist and rise against the corrupters.$B$BWe will save Illidan and once more you will battle at the side of your master for the fate of all worlds.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44500, 'enUS', 'We may not have the exact location of the Pillars of Creation, but at least we know where to start. We\'ll explore every corner of the Broken Isles until they\'re recovered.$B$BThe Legion\'s attack is intensifying. We must prepare to move Dalaran to the Broken Isles!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44543, 'enUS', 'Glad to see you back on your feet, $n. Many good soldiers who sailed for the Broken Shore were not so fortunate.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44544, 'enUS', 'It is good that you are here, Farseer $n. We have much to discuss.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44550, 'enUS', 'You have arrived at last, Deathlord. We have much to discuss.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44555, 'enUS', 'Thank you for coming, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44556, 'enUS', 'We have work to do!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44557, 'enUS', 'Well done! At least now most of the remaining demons we have to deal with are currently inside the tower.$B$BCouldn\'t be more than a thousand or two, I\'m sure.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44561, 'enUS', 'In the changing of seasons, the truth will be revealed.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44562, 'enUS', 'We shall help the shal\'dorei find harmony.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44563, 'enUS', 'Finally, my long lost brethren can return to this world. Elves belong beneath a starry sky - not a conjured one.$B$BThank you, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44570, 'enUS', 'Honor the Spires of Arak flame.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44571, 'enUS', 'Honor the Talador flame.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44572, 'enUS', 'Honor the Nagrand flame.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44573, 'enUS', 'Honor the Gorgrond flame.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44574, 'enUS', 'Honor the Azsuna flame.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44575, 'enUS', 'Honor the Val\'Sharah flame.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44576, 'enUS', 'Honor the Highmountain flame.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44577, 'enUS', 'Honor the Stormheim flame.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44579, 'enUS', 'Honor the Shadowmoon Valley flame.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44580, 'enUS', 'Honor the Frostfire Ridge flame.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44581, 'enUS', 'Hey, $n, it\'s me, Nomi. You know, from Pandaria?$B$BIt\'s fine if you don\'t remember, it\'s been ages since you may have seen me last.$B$BI\'m a full-fledged cook now and have been coming up with some of my own creations.$B$BHere, take a sample of some of the recipes and dishes I\'ve been working on.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44582, 'enUS', 'Desecrate the Alliance\'s Shadowmoon Valley bonfire!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44583, 'enUS', 'Desecrate the Horde\'s Frostfire Ridge bonfire!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44613, 'enUS', 'Honor the Suramar flame.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44614, 'enUS', 'Honor the Suramar flame.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44624, 'enUS', 'Desecrate the Alliance\'s Suramar bonfire!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44627, 'enUS', 'Desecrate the Horde\'s Suramar bonfire!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44663, 'enUS', 'Ah, $n, it\'s good to see you on your feet! The members of the Council of Six are recuperating from their ordeal.$B$BThe intensity of the teleportation spell can be disorienting. It seems you lost consciousness for a time, but at least you didn\'t awaken to find yourself stuck in a wall!$B$BDalaran has been relocated to the Broken Isles. From here, we will spearhead the effort to acquire the Pillars of Creation and drive the Legion from Azeroth once and for all!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44667, 'enUS', 'You\'ve done well. Our enemies tremble before you and your armies.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44672, 'enUS', 'Keep a lookout for those crystal formations all over Suramar. We will need them.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44680, 'enUS', 'You are an inspiration to us all, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44682, 'enUS', 'The power within you grows, $n. You will serve the council well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44683, 'enUS', 'The Legion\'s hold wanes. Our time to strike grows nearer.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44684, 'enUS', 'Every bit contains an essence of sorts - one we can study to learn things about the magic wielder and ways to manipulate their magic for... other purposes.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44685, 'enUS', 'You\'ve bought us precious time.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44686, 'enUS', 'This information is just what we needed.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44689, 'enUS', 'Well done, conjuror. With heroes like you at the helm, the Tirisgarde is a force to be reckoned with!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44690, 'enUS', 'At last, I have enough Blood of Sargeras to fuel my creations! You will see, Deathlord, what my genius is truly capable of creating...$B$BNow, I must ask that you leave me to my work... there is much to do, and we have little time to waste!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44691, 'enUS', 'Ah, I am feeling much better. Thank you!$B$BNow let us get to work.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44694, 'enUS', 'It would seem that you have done an excellent job of eliminating a great many threats on the Broken Isles.$B$BYou never fail to impress me, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44700, 'enUS', 'It\'s an honor, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44701, 'enUS', '<Nathanos glances over at you, pausing for a moment before acknowledging your presence.>$B$BYes?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44719, 'enUS', 'I must commend your knack for overcoming adversity. Take your time gathering your fellow champions, $n, but don\'t take TOO long!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44720, 'enUS', 'It is good of you to come.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44721, 'enUS', 'She has forced my hand...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44722, 'enUS', 'Glad you could make it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44723, 'enUS', 'Hopefully more will follow their example.$B$BThank you for showing them another way to serve the Nightborne.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44724, 'enUS', '<Silgryn stares grimly at the communicator.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44725, 'enUS', 'Thank you for taking this risk. Let us put an end to this now!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44726, 'enUS', 'Well done. Let us leave before they call in reinforcements.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44727, 'enUS', 'Thank you. We had no hope of rescue before you came along.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44729, 'enUS', 'Now a greater task awaits you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44733, 'enUS', 'Our worst fears have been proven true, $n. The Legion\'s presence is deeply rooted in the tower.$B$BThe time has come. We must take back Karazhan!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44734, 'enUS', 'For so long the secrets of the tower have remained hidden... I feel as if I have learned more about my former master.$B$BI am greatful we were able to see this journey through together, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44735, 'enUS', 'Your efforts today will not be forgotten, $n.$B$BThough the Legion\'s presence has left its mark on the Karazhan we once knew, I am certain the fate of the tower will not disappoint.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44736, 'enUS', 'Thank you for saving me. It seems we underestimated Elisande\'s power.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44738, 'enUS', 'The telemancy traps you placed prior to the battle are doing wonders for reducing our losses.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44739, 'enUS', 'Well, with these plans and a little luck, we might be able to get through this with far less collateral damage than I would have expected.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44740, 'enUS', 'Well done, hero. With this as our staging ground, our forces have a clear shot at the city gates.$B$BThalyssra has ordered her rebels to secure our location and cover our rear flank.$B$BOnce we have our siege vehicles in place we should be ready to assault the city.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44741, 'enUS', 'Now, look closely.$B$B<Tytallo goes into a lengthy explanation concerning the thread count, weaving techniques, and other miscellaneous details that, to a tailor, are fascinating.>$B$BYou still seem confused. Here, take the pattern and see for yourself. Perhaps then you\'ll learn a thing or two.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44742, 'enUS', 'We need to take action immediately!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44743, 'enUS', 'The Nightfallen insisted on being a part in this conflict. There is more work to be done than people we have.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44752, 'enUS', 'All that remains is to focus on his essence to isolate his location. Good work.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44753, 'enUS', 'That was... difficult... but I am glad we succeeded.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44754, 'enUS', '<Vanthir\'s hands dart up to snatch the fruit from your grasp.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44756, 'enUS', 'I will see that he is made comfortable next chance I get. We made a great stride forward today, $n.$B$BElisande will not soon forget that we do not simply abandon our own.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44758, 'enUS', 'This gunpowder is the key to my plan. Right good work retrieving it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44760, 'enUS', 'Around the isles, the very blood of our enemy attempts to corrupt all things. But as you may already know, this blood can be extracted.$B$BWe demon hunters use this blood for our own rituals, fueling us to fight back the demon invasion.$B$BBring me any Blood of Sargeras you find and I will trade with you what I can.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44764, 'enUS', 'The samples have proven to be quite helpful along with your... influence.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44765, 'enUS', 'You\'d better hurry up and hand over the fish if you want to win!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44766, 'enUS', 'Hmm. An interesting challenge!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44767, 'enUS', 'Ah, quite the breath of fresh solar winds. Take this, my favorite constellation, may it remind you of the watchers that watch over us all.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44768, 'enUS', 'That is one less Legion supporter we need to worry about. Oh, and you found a shield generator too? Wonderful!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44770, 'enUS', 'Few texts written by the ancient shal\'dorei remain. I am sure the Tirisgarde\'s librarians will be thrilled with these!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44771, 'enUS', 'Delicious, thank you.$B$BBefore we act, we must gather more information onto what Helya is planning.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44775, 'enUS', 'Finally you\'re here, Deathlord. I\'ve been waiting so long I could\'ve died again.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44782, 'enUS', 'Don\'t worry, she\'ll be alright.$B$BWhatever demon did this to her didn\'t hang around long enough to finish the job.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44783, 'enUS', 'I could feel their energy, even in undeath.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44787, 'enUS', 'That was quite the entrance, Deathlord.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44789, 'enUS', 'Our victory here is well deserved. With their forces subdued we can press our attacks to the forward camp and the monstrosity on the horizon.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44790, 'enUS', 'Well done. Sometimes a single victory is enough to bring an army together. With time, these recruits shall train others, and we can grow our army to many times this size.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44800, 'enUS', 'The Doomstone! I thought it legend, but here it is before me$B$BCan you feel its power radiating? We must only use it in times of utmost need; its power has a heavy price.$B$BYou were right not to give it to Magatha. It could do much harm in her hands.$B$BI trust you to keep it safe while we prepare an appropriate home for it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44803, 'enUS', 'Wonderful, you brought dinner! Moroes was worried he would let his master down.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44814, 'enUS', 'These people owe their lives to your bravery. They will not forget the risks we have taken for them.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44821, 'enUS', 'So what do you say? Up for a challenge?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44822, 'enUS', 'We got lucky that time, but trying again could risk all our lives for nothing. We must find another way.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44827, 'enUS', 'The trainees you helped cannot seem to stop talking about your fighting prowess. Already they are passing along what you taught them.$B$BI appreciate your help in this.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44829, 'enUS', 'These weapons should prove quite useful in the coming conflict. Well done, hero.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44830, 'enUS', 'Excellent. The knowledge in these books should prove very useful in the days to come.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44831, 'enUS', 'It is good to know that they are alive. Their knowledge will be valuable in the coming siege.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44832, 'enUS', 'It appears Ly\'leth was correct. This is an entrance to the Nightwell - and it is well protected. Nothing is impenetrable though.$B$BLet us have a look at the ley lines powering this shield, shall we?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44833, 'enUS', 'Valtrois told me everything. She is hard at work on a plan for bringing down that barrier.$B$BI am afraid all we can do for now is wait. Thank you for your help.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44834, 'enUS', 'Excellent work. The weapon will provide the proper housing, and the magical signatures on the core will let me bypass...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44842, 'enUS', 'Good. With him out of the way we will be able to establish a stronger foothold once the main force arrives.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44843, 'enUS', 'Nice work. They will not be opening that portal again any time soon.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44844, 'enUS', 'A portal that big will not be reopening any time soon. I would say that counts as weakening their defenses.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44845, 'enUS', 'We almost lost the invasion before we could begin. Good work.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44849, 'enUS', 'Keep your wits about you, $n. There are many here who will attempt to steal your soul.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44850, 'enUS', 'Good. These will be invaluable in the coming battles.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44858, 'enUS', 'Thank you, $n. Hopefully, since our forces saw you performing this task they will come to their senses and stop this harassment.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44859, 'enUS', 'I can relate to Thalyssra\'s frustration.$B$BI remember when I launched my first offensive. I swear I didn\'t eat or sleep for a week.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44860, 'enUS', 'Thank you, $n. Hopefully, since our forces saw you performing this task they will come to their senses and stop this harassment.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44861, 'enUS', 'Every member of the Duskwatch has had centuries to perfect their fighting techniques. We do not have that much time to get these rebels in to fighting shape.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44862, 'enUS', 'Every member of the Duskwatch has had centuries to perfect their fighting techniques. We do not have that much time to get these rebels in to fighting shape.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44863, 'enUS', 'I smell the air about you and see that you have returned triumphant.$B$BHere is the knowledge that you seek.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44865, 'enUS', 'I can\'t believe it\'s finally over.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44868, 'enUS', 'It is done. Helya\'s reign comes to an end and now we move forward. You have done a great thing today, champion. Consider yourself counted among those in the Halls of Valor.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44869, 'enUS', 'It took all my willpower not to jump into the fray without backup. Let\'s go!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44870, 'enUS', 'It is good to see you. I could use a helping hand.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44873, 'enUS', 'That was a little terrifying. Sometimes I am not entirely sure that Oculeth knows what he is doing.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44874, 'enUS', 'That was more infuriating than it should have been. At least her natural talents mostly matched my calculations...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44875, 'enUS', 'It is done. Shal\'Aran will have no want of mana now.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44876, 'enUS', 'That is quite the adventure you had. Thankfully we now have plenty of mana for the refugees. Thank you, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44877, 'enUS', 'Ha! Take that, demon scum!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44886, 'enUS', 'You believe Skovald didn\'t want you to find this crystal, eh? Let me have a look.$B$B<Khadgar peers at the fel crystal fragment, tracing the lines of power that run through it.>$B$BI have seen this sort of crystal before. They are used to convey orders that come from the highest ranks of the Legion.$B$BThis is not good.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44887, 'enUS', 'Well done! That couldn\'t have been easy.$B$BThis should be enough fragments. Let\'s have a look.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44888, 'enUS', 'Nature is in dire need, mortal. You must fix it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44889, 'enUS', 'Good to see you made it, Battlelord $n!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44914, 'enUS', 'So someone stole the Focusing Iris and you suspect Xylem might be the culprit? You may be right. $B$BIt is no secret that the archmage has been seeking artifacts of late. However, after the discovery of an ancient grimoire in the Legashi ruins, Xylem has become... unstable. I fear the grimoire may be stealing his mind.$B$BI can help you gain audience with the archmage. With any luck, you can reclaim the Iris peacefully.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44915, 'enUS', 'Yes, I think that will do.$B$BThe apprentices outside the tower should think you outrank them now, so you should be able to get some information out of them. You\'ll need it to bypass the barrier.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44917, 'enUS', 'Were you able to defeat the evils within Karazhan?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44918, 'enUS', 'I do not know what lies in store for us, but we cannot sit idly while Ly\'leth is missing.$B$BWe must act now!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44919, 'enUS', 'The withered... defeated so easily.$B$BWe must find a way to negate the magic of the felborne. We cannot afford to fight if our own can be turned against us.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44921, 'enUS', 'If Goldrinn is in the Dream, he\'s defenseless! We\'ve got to help!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44924, 'enUS', 'It is as I feared, the archmage is beyond reason... and now he is beyond reach.$B$BYou have done a great thing here, freeing his apprentices from his corruption, but this fight is not over yet.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44925, 'enUS', 'I apologize for my actions, $C. I was a fool to tap into the power of the grimoire, and that folly could have cost Azeroth dearly. $B$BI thank you not only for purging and defeating the shadowy evil that had hold of me, but also for sparing my life.$B$BMyself, as well as all of Azeroth, are in your debt.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44926, 'enUS', 'Oh aye! I know the make of that chopper.$B$BTha master who made it also created the famous Bleakwood Hew. You may \'ave heard of it.$B$BAn\' it just so happens I know how to make the hew too!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44927, 'enUS', 'Oh ho! Look at all that STEEL!$B$BI\'ll have this shipment finished by the end o\' the week. Well done, lad! Well done!$B$BAn\' as I promised, here are those plans for the hew.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44928, 'enUS', 'It is as I feared. Hopefully they will think twice before sending more spies.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44930, 'enUS', 'Ha ha ha! I hope those rotten thugs rot in whatever pit of misery spawned them.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44944, 'enUS', 'The time has come, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44948, 'enUS', '<The hatchling seems to trust you a bit more now. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44949, 'enUS', '<The hatchling seems to be more comfortable around the sights and sounds of a human city. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44950, 'enUS', '<The hatchling seems quite content with its victories, and settles in for a nap. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44952, 'enUS', 'Whoa, now that\'s a RUBY! I\'d only ever seen one other of its kind in the world and now I have one.$B$BI tell ya, this is gonna make me stinkin\' rich!$B$BBut uh, onto your payment. Here are those plans I was mentioning.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44953, 'enUS', '<The hatchling trills at the sight of Thunder Totem. That\'s quite an improvement! It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44954, 'enUS', '<The hatchling rams you softly with its head and trills. It seems to like doing things with you quite a lot! It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44955, 'enUS', 'She looked good. The Arcan\'dor truly is a miracle for our people.$B$BShe is a welcome ally in the fight to come. Silgryn will take good care of her.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44956, 'enUS', '<The hatchling looks at you with admiration. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44957, 'enUS', '<The hatchling looks more confident after besting those beavers, and settles in for a nap. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44958, 'enUS', '<The hatchling emits a low hiss when you pass a member of the opposite faction. Mission accomplished! It will need to rest after this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44959, 'enUS', '<You feel a special bond form between you and the hatchling. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44960, 'enUS', '<The hatchling looks more confident in its abilities. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44961, 'enUS', '<The hatchling looks like it might have absorbed some of that lesson, at least it enjoyed the trip. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44962, 'enUS', '<The hatchling looks much more at ease around elementals now. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44964, 'enUS', 'The preparations are nearly complete. Oculeth will be ready to teleport us soon.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44967, 'enUS', '<The hatchling positively beams at you in pride for defeating such a frightening foe. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44968, 'enUS', '<The hatchling looks proud of itself and preens after the victory. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44971, 'enUS', '<The hatchling seems to be more comfortable around the sights and sounds of an orc city. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44973, 'enUS', '<The hatchling struts around happily, clearing showing off. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44974, 'enUS', '<The hatchling seems to be more comfortable around the sights and sounds of a dwarven city. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44975, 'enUS', '<The hatchling seems to be more comfortable around the sights and sounds of a tauren city. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44976, 'enUS', '<The hatchling seems quite content with its victories, and claws at your leg until you sit down and create a lap it can sit on. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44977, 'enUS', '<The hatchling no longer cowers behind you when the storms crackle in Stormheim. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44978, 'enUS', '<The hatchling nips at your feet excitedly. It seems to like doing things with you quite a lot! It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44979, 'enUS', '<The hatchling looks at you with interest. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44980, 'enUS', '<Your direbeak certainly doesn\'t look afraid of ghosts. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44981, 'enUS', '<The hatchling scratches the ground aggressively when you pass a member of the opposite faction. Mission accomplished! It will need to rest after this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44982, 'enUS', '<You feel a special bond form between you and the hatchling. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44983, 'enUS', '<The hatchling builds a small nest of eaglet feathers, and settles in for a nap. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44984, 'enUS', '<The hatchling has taken a large puff of wolf fur for its nest, and you\'re not entirely sure where it was concealing it. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44985, 'enUS', '<The hatchling looks much more at ease around machines now. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44986, 'enUS', '<The hatchling growls at you possessively. It seems... proud? It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44987, 'enUS', '<The hatchling somehow still has energy, and runs off to play with your other pets. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44989, 'enUS', '<The hatchling is no longer shaking and clinging to your side. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44990, 'enUS', '<The hatchling looks strong and confident. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44991, 'enUS', '<The hatchling seems to be more comfortable around the sights and sounds of a draenei city. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44992, 'enUS', '<The hatchling seems to be more comfortable around the sights and sounds of a night elf city. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44993, 'enUS', '<The hatchling seems to be more comfortable around the sights and sounds of a blood elf city. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44994, 'enUS', '<The hatchling seems to be more comfortable around the sights and sounds of a forsaken city. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44995, 'enUS', '<The hatchling seems quite content with its victories, and butts you with its head lovingly. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44996, 'enUS', '<The hatchling seems quite content with its victories, and clucks happily at you. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44997, 'enUS', '<The hatchling no longer shivers when entering the dense foliage of Val\'sharah. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44998, 'enUS', '<The hatchling is more curious than afraid of the ghosts in Azsuna now. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (44999, 'enUS', '<The hatchling emits a loud \"baroo!\" It seems to like doing things with you quite a lot! It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45000, 'enUS', '<The hatchling beams at you. It seems to like doing things with you quite a lot! It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45001, 'enUS', '<The hatchling looks more confident in your abilities. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45002, 'enUS', '<The hatchling caws at you. A compliment, perhaps? It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45003, 'enUS', '<The hatchling gulps down one of the larva, then momentarily looks like it is going to be sick. You had better keep an eye on it. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45004, 'enUS', '<Besting another flying pet has really boosted your bloodgazer\'s confidence. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45005, 'enUS', '<The hatchling runs behind you when you pass a member of the opposite faction. Mission accomplished! It will need to rest after this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45006, 'enUS', '<The hatchling puffs itself up when you pass a member of the opposite faction. Mission accomplished! It will need to rest after this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45007, 'enUS', '<You feel a special bond form between you and the hatchling. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45008, 'enUS', '<You feel a special bond form between you and the hatchling. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45009, 'enUS', '<The hatchling pulls at a shedding nail, it will be sharp again soon. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45010, 'enUS', '<The hatchling licks its wounds, hurt but satisfied. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45011, 'enUS', '<The hatchling looks exhausted, and falls asleep immediately. It appears to be having some kind of nightmare. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45012, 'enUS', '<The hatchling glows slightly with magical energy, what did it get into? It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45013, 'enUS', '<The hatchling looks much more at ease around water now. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45014, 'enUS', '<The hatchling looks much more at ease around insects now. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45015, 'enUS', '<The hatchling looks at you timidly. It appears to be a little afraid of your power. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45016, 'enUS', '<The hatchling chews on a fragment of the great scorpion thoughtfully. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45017, 'enUS', '<The hatchling looks worn out, and spends quite a few minutes drinking after the victory. It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45018, 'enUS', '<The hatchling looks quite full. What did it eat? It will need some time to recover from this adventure.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45021, 'enUS', 'Shinfel should not have told you of my suspicions. This is my burden to bear.$B$BNevertheless, I am glad you are here. It would seem my fears are founded.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45024, 'enUS', 'Can it be true? Does some sliver of my friend remain within that wretched demon?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45025, 'enUS', 'Excellent work, as always, Netherlord. This should certainly buy us some time.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45026, 'enUS', 'Thank you, Netherlord. I will keep these crystals safe until they are needed.$B$BWhen we find Kanrethad, we will be ready.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45027, 'enUS', 'You\'re here, Netherlord! Quickly, there\'s no time to lose!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45028, 'enUS', 'I have lived with a heavy heart since the day I fulfilled my promise to banish Kanrethad. I never thought I\'d live to see the day he would be returned to us.$B$BI thank you, Netherlord. You have lifted the burden of guilt from my shoulders, and in doing so, prevented the Legion from gaining control of one of our own.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45044, 'enUS', 'Ay mon, whatcha got der in your hands?$B$BDat be da Darkspear! Ya found it?!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45051, 'enUS', 'Dem\'s some mighty fine materials dat was made of. No wonda\' da boss wants it so bad.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45055, 'enUS', 'Oh mon, I wish I could\'a seen da look on their faces when you pummled dem!$B$BNow dat we have all da materials, we just need to put it together.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45056, 'enUS', 'I cannot possibly thank you enough. We will be reunited, and I will see we are never separated again.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45057, 'enUS', 'Dat\'s it, mon! Ya did it!$B$BI tink before I head off back to da Isles, I\'ll be making a few extra copies of dees plans, just in case.$B$BI\'ll make ya a copy too, in case I be needing your help wit\' making another one.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45062, 'enUS', 'Oculeth will be quite pleased with your findings. As you know, he\'s been working diligently on a new device for the withered.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45063, 'enUS', 'The withered seem to be adapting quite well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45064, 'enUS', 'Our efforts have proven quite successful. I believe we are just about ready to make our stand.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45065, 'enUS', 'I will begin analyzing this data at once.$B$BFor now, let us turn our attention to more... <Oculeth touches his fingertips together in succession.>$B$B...interesting technological advances.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45066, 'enUS', 'Wonderful! Now the fun begins. You should speak with Thalyssra, I believe she is ready for more... testing.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45067, 'enUS', 'Let us begin.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45073, 'enUS', 'Thank ye, me friend. I feel better knowin\' I have been avenged.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45079, 'enUS', '<Annie looks at you, her eyes hollow and empty. Her clothes are stained with blood, though she seems to be mostly unscathed. She stutters, but her words are unintelligible.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45083, 'enUS', 'There are feathers everywhere! What a mess.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45088, 'enUS', 'With these souls returned to the Halls of Valor my forces return to their former strength. As promised, the bounty is yours.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45103, 'enUS', 'Now we have proven the might of the Ebon Blade to the Legion. The ability to take down so many demons without fear of death... that is the power that we hold. We shall see many more demons fall to our blades, and we shall strike them down for Azeroth.$B$BSuffer well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45111, 'enUS', 'Ok, I\'ll let your champions come and prove themselves in the ring. If they manage to win themselves a fight, come talk to me again and we can see about letting them fight harder brawls.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45118, 'enUS', 'Revenge is sweet. The kvaldir will be forced to obey us, now!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45123, 'enUS', 'So it seems that Levia has fallen under the spell of a succubus\' seduction. I fear her time alone as an outcast must have left her vulnerable to such tactics. I cannot help but feel some guilt for her turning down this path.$B$BIn any case, Levia is in great danger. She must be found!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45125, 'enUS', 'I\'m pleasantly surprised, $C. Without your quick thinking, your mage friend would be lost to Agatha.$B$BThe portal is stabilized, and should lead to the mage\'s location.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45126, 'enUS', 'Disgusting! I can\'t believe I let myself fall under the spell of such a creature! $B$BI was such a fool! She made me think she really cared about me. In the end, it seems nothing I thought I knew about Agatha was true!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45127, 'enUS', 'So Levia is safe? That is a relief, though I wish we could have reached her sooner. An imp mother is bad enough - I can\'t imagine what Agatha will be capable of with Levia\'s power. And who knows what secrets Levia shared while under her thrall?$B$BI\'m afraid that this battle may not be over yet.$B$BFor now, we should celebrate whatever victories we can get. Thank you for your assistance, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45128, 'enUS', 'You have done all that I hoped, and more, Battlelord $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45143, 'enUS', 'Your judgment is firm and fair, Highlord.$B$BThese new recruits will learn much under your command.$B$BThough I am beginning to wonder, if my worthiness was tested, would I be found lacking?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45145, 'enUS', 'I know the name Nerus. He\'s a distant relative of mine, but why would he hold on to fel trinkets?$B$BThe answer to that question might be found within this scroll, but it appears to be blank.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45146, 'enUS', 'It should only take a moment for the runes to appear once I apply the purified blood.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45147, 'enUS', 'If you were strong enough to destroy the pendant that bound my spirit to the Burning Legion, then there might be hope for my ancestors.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45148, 'enUS', 'With Zorak dead, my ancestor\'s spirits can finally be free of their curse.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45149, 'enUS', 'What you have done for my family will never be forgotten.$B$BThe spirits of the Moonfang family will forever be in your debt.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45159, 'enUS', '<Dariness peers at the artifact you hand her.>$B$BA most interesting design! It reminds me of an ancient curio I read about long ago while still in training. I doubt it could be that though. Such a device has never been found.$B$BHmm, I wonder if it still works. Only one way to find out...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45160, 'enUS', 'I trust you obtained all the ancient mana we need to infuse the cube?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45162, 'enUS', 'Hey not bad, they beat the Council huh? Sure, they can advance to the next level.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45163, 'enUS', 'You think you guys are tough, beating up a janitor and all? Well ok, I suppose I\'ll get you into the next fight.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45172, 'enUS', 'Well done! Battlegrounds are certainly no place for the weak.$B$BWith your success, your champions will now look for more opportunities for you to prove your worth.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45173, 'enUS', 'Well done!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45174, 'enUS', 'The naaru heard my call? Interesting...$B$BVery well, let\'s get to work. We\'ve found Illidan\'s soul - finally - and it\'s not where we expected it to be held.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45175, 'enUS', 'The Soul Prism of the Illidari is ready for use.$B$BIllidan\'s soul was plucked from the Nether - stolen - and taken to the underworld. A place known as Helheim.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45176, 'enUS', '<Light\'s Heart illuminates brightly and seemingly consumes the Soul Prism.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45177, 'enUS', 'I... I will do my best, Battlelord. You will - of course - have to do the hard work and lead the assault on the Nighthold!$B$BFOR AZEROTH!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45179, 'enUS', 'Congratulations are in order I hear?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45180, 'enUS', 'Ashran is no place for the faint of heart. You did well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45182, 'enUS', 'You come from the Kirin Tor? So you\'ll help me find my brother?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45185, 'enUS', 'A letter? From one of the cultists? $B$BThat could be the lead we need!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45187, 'enUS', 'Well, this definitely says... something.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45188, 'enUS', 'What\'s this, a cultist\'s manifesto? $B$BSo Raest has really gone down a dark path, hasn\'t he?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45190, 'enUS', 'My brother is here!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45192, 'enUS', 'We\'re too late, the rift has closed!$B$BWe\'ll have to find another way to get to him.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45193, 'enUS', 'So Raest escaped? This is unfortunate. $B$BStill, I will rest easier knowing the Nethersworn cultists will no longer skulk in the streets of Dalaran. I thank you for that.$B$BThe Kirin Tor will set out at once to figure out how we can reach Raest in the Twisting Nether. I will send for you when we find a way to reach him.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45207, 'enUS', 'I\'ve heard so much about you, Archmage $n. It is a pleasure to finally meet you!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45209, 'enUS', 'So they did intercept her messages! I hope Ly\'leth is okay...$B$BWe must investigate this breach she spoke of immediately!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45238, 'enUS', 'You\'ve done it! Was the wyrm truly gargantuan? Oh, nevermind, size is relative...$B$BLet us get this focus into the cube and see what it does!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45239, 'enUS', '<Something about the power coursing through the cube urges you to take it into your possession.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45240, 'enUS', 'Deathlord! The vrykul have the harness!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45243, 'enUS', 'Let\'s show the Legion true power.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45251, 'enUS', 'Let us get to work, shall we?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45260, 'enUS', 'I will ask this of you again, as more fruit is ready.$B$BFor now, we have some disturbing news to discuss.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45261, 'enUS', 'Good, now to set our attention to those still suffering within the city.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45262, 'enUS', 'There. I certainly hope Ly\'leth has good news...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45263, 'enUS', 'Very well, let us go.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45265, 'enUS', 'Good. Now let us see to business at the warfront.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45266, 'enUS', 'The time has come.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45267, 'enUS', 'Just in time. We are ready to begin.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45268, 'enUS', 'I am glad we can still cure my people, but... I have troubling news.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45269, 'enUS', 'Very well. Let us begin.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45271, 'enUS', 'Welcome hero. Your arrival could not have been better timed.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45272, 'enUS', 'Welcome hero. Your arrival could not have been better timed.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45277, 'enUS', 'You are going to want to hear this.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45278, 'enUS', 'It would seem the elves have returned to Suramar.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45280, 'enUS', 'This is an unexpected problem, but we have more soldiers than food or weapons.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45281, 'enUS', 'The time for our attack has come. It is time for us to take back Suramar from Elisande and her demonic allies!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45282, 'enUS', 'The time for our attack has come. It is time for us to take back Suramar from Elisande and her demonic allies!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45285, 'enUS', 'Thank you for coming. Your skills will prove to be invaluable for this next part of our plan.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45287, 'enUS', 'The time for our attack has come. It is time for us to take back Suramar from Elisande and her demonic allies!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45291, 'enUS', 'You were HOW small? Gracious! That must have complicated things.$B$BIt looks like there are more books on the floor than when we started. It\'s as if the books keep jumping off the shelves or something...$B$BThis is going to be harder than I thought!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45292, 'enUS', 'The box is empty? Drat!$B$BI may be a mage, but I\'ll never be able to copy Medivh\'s motivator crystal enchantment!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45293, 'enUS', 'Oh dear. My fault entirely!$B$BI should have ensured the horseshoes were in good shape before having you deliver them.$B$BThe humidity out here is a real killer!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45294, 'enUS', 'I can\'t believe you found what we needed!$B$BUh, not that I doubt you, it\'s just... well, this is the first time one of my projects has actually worked out.$B$BAnyway, I think delivering these items to the actors will ease tensions for a while.$B$BThis is a momentous day!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45295, 'enUS', 'You got every single spider, right?$B$BEither way, I\'ll just check that one off the list. No need to check up on your work.$B$B<Darius makes a squinched-up face.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45296, 'enUS', 'Nightbane has been defeated! I\'m in awe!$B$BMany years have passed since the blue dragon Arcanagos was slain by the corrupted Medivh. Archmage Alturus sought out the remains of the fallen dragon in an effort to study the Guardian\'s power. $B$BIn retrospect, maybe not the best idea. $B$BYour help has been invaluable.$B$BI still have a lot of work ahead to clean up Karazhan, but for now I dare ask no more of you. Thank you again for your assistance, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45301, 'enUS', 'Good, you made it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45304, 'enUS', 'Between you and me I\'m glad they won, that guy always creeps me out. Ready for the final challenge?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45312, 'enUS', 'I can\'t believe you beat him! Meatball was so impressed he now insists he wants to work for you. Hope you don\'t regret it!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45316, 'enUS', 'Thank you, $n. Every day we come closer to freedom for Suramar.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45317, 'enUS', 'Leadership is a difficult burden, $n.$B$BWe must often split our attention - be sure to keep the big picture in mind.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45329, 'enUS', 'That was surprisingly easy...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45330, 'enUS', 'You got most of our scouts out alive. And Lady S\'theno appears somewhat chastened, at least. Well done!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45331, 'enUS', 'Welcome back, Deathlord. I see you were successful.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45339, 'enUS', 'That was quite a hit you took...$B$BFrankly, I\'m amazed that the Fel Hammer didn\'t self destruct when we fired her weapons. We are lucky to be alive.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45342, 'enUS', 'Your allies have you to thank for their lives.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45343, 'enUS', 'Ah, good. So the Conclave received my request. I didn\'t expect they\'d send their leader!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45344, 'enUS', 'I hope you handled these samples with care, $n. I wouldn\'t forgive myself if I was responsible for getting the High $C sick.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45345, 'enUS', 'Thank you, $n. I thought those goats seemed a little strange.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45346, 'enUS', 'While there is no hope of curing those who have reached stage III, at least they will be able to provide crucial information about how the contagion works.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45347, 'enUS', 'Brilliant work, $n. For a moment I thought I\'d need to find a new companion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45348, 'enUS', 'This cure could not have come at a better time.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45349, 'enUS', 'You\'re here, High $C! Quickly, there\'s no time to lose!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45350, 'enUS', 'I believe our combined efforts have effectively eradicated the fel contagion from Azeroth.$B$BWell done, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45352, 'enUS', 'Marvelous! It is such a joy to work with such magnificent craftsmanship. Please, come see me again should you find another such masterpiece.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45353, 'enUS', 'I count myself fortunate to be able to work with the heroes who fight for our world\'s survival.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45354, 'enUS', 'To say you\'ve earned your archmage status would be an understatement. Your success today proves that you were born one.$B$BNow mount your new vessel and ride against the Legion with all the might of your knowledge.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45372, 'enUS', 'Thank you for being here, $n.$B$BUltimately the Nightborne must shape their own destiny, regardless of the help we have received from Outlanders like yourself.$B$BIt is no easy burden we bear, but Elisande has shown us that we must stand alone, without the Nightwell, to properly rejoin the world.$B$BThank you for all you have done for us.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45381, 'enUS', 'The power these fragments hold will allow me to call the talisman to us. Well done!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45382, 'enUS', 'The power these fragments hold will allow me to call the talisman to us. Well done!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45383, 'enUS', 'The power these fragments hold will allow me to call the talisman to us. Well done!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45385, 'enUS', 'About time, Sslayer $n. We have work to do.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45391, 'enUS', 'You have gone above and beyond to honor our pact, Sslayer $n. You know I\'m not one for sappy speechess, but I assure you that I am grateful.$B$BI will take my place by your side if you will have me.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45392, 'enUS', 'Velonara asked you to deliver this to me personally?$B$B<Moorgoth\'s eyes sparkle as he grins from ear to ear.>$B$BShe DOES care! She DOES care!$B$B<Moorgoth settles down and clears his throat.>$B$BThat was kind of her. Say, it is a nice hood. I bet I could mass-produce this and offer it to my fellow dark ranger aficionados.$B$BWould you like to browse my wares?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45398, 'enUS', 'During my training, Mograine told me of what we could achieve with this harness. I look forward to the results.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45399, 'enUS', 'Watching those vrykul shamble off mindlessly made my dead heart go \"pitter patter\".', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45404, 'enUS', 'How could this have happened to us; to me? I never thought I would die so young... and so violently...$B$BWe have tried to Detox our fallen friends, but this poison is too advanced.$B$BI cannot rest while our order\'s very survival is still at stake. I am so sorry I let you down, Grandmaster $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45406, 'enUS', 'Today will not be your end, hero. The Legion threatens the Gates of Valor and without the power you wield they will surely fall.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45412, 'enUS', 'You - I\'ve seen you out on the isles.$B$BWe need to move quickly!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45413, 'enUS', 'No... no, no, no, no!$B$BNot good. Not good at all.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45414, 'enUS', 'Kruul must not be allowed entrance into this world.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45415, 'enUS', 'We must strike before Kruul reaches his full strength, but we\'re going to need help.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45416, 'enUS', 'Kruul will never again threaten our world, or any other.$B$BProphet Velen sends his thanks, Archdruid.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45417, 'enUS', 'A fitting end.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45420, 'enUS', 'With the Eye of Aman\'Thul in our possession, we are one step closer to sealing the portal.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45423, 'enUS', 'Yes, I saw the shadowy character as well, he ran right past me. Probably a tauren, but we can\'t be sure. Keep a look out for him, something tells me we\'re just beginning to unravel this mystery.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45425, 'enUS', 'We have asked a lot of you over the last few months, $n. You not only rose to our expectations, but surpassed them. By killing Katith\'rax, you have stopped the attacks against our ancients.$B$BYou deserve the position of Archdruid of the Dreamgrove. I am honored to be your colleague, and expect us to do much for the world. Together.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45426, 'enUS', 'What news do you have of the attack on Aviana\'s shrine?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45437, 'enUS', 'I have been unfairly maligned by many. I am glad the Tirisgarde does not fall prey to petty rumors!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45440, 'enUS', 'Whew. Celebration brew is..*hic* shtronger than I remembered it to be. *urp*', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45442, 'enUS', 'It makes my heart glad to see our order returning to health.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45449, 'enUS', 'Thank you. That\'s one less demon working against us.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45459, 'enUS', 'Good, you made it!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45482, 'enUS', 'Yes, outsider? What business do you have here?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45486, 'enUS', 'I thank you for bringing Sigryn to me, outsider. She truly is the future of our people.$B$BThough you have already done so much, I would ask another favor of you. Please accompany Sigryn in her challenges. She has grown to trust you, and will need guidance through the trials she must face.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45498, 'enUS', 'We did it! We saved Goldrinn!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45522, 'enUS', 'The Bonespeakers yield. Our clan will not interfere with Sigryn\'s claim to the throne.$B$BBe careful of this one, $C. I can see the darkness that consumed Skovald dwelling in this girl\'s heart. How she has resisted it this far, I do not know.$B$BYou had best hope she can control it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45523, 'enUS', 'You have the backing of the Dragon-Riders, but a greater rival to the throne still lives in secret.$B$BThe God-King\'s son yet lives. My riders spotted him among the outcasts of Vrekt. He would be the true heir to Skovald\'s throne. $B$BThe vrykul would never follow you were he to contend your claim!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45524, 'enUS', 'I cannot believe that I find my brother alive, only to see him fall by my own blade. $B$BHow can fate be so cruel?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45525, 'enUS', 'Sigryn has taken the path of Skovald before her. Only, I fear she is more powerful than her father ever was. $B$BI fear that Sigryn\'s thirst for revenge may lead to her undoing. Though truly powerful, she would be no match for Odyn.$B$BShe must be stopped before it is too late.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45526, 'enUS', 'I... thank you for coming for me. I hope you can forgive me for what I\'ve done.$B$B$BI will return to Eyir. I only hope she can grant me her forgiveness as well...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45527, 'enUS', 'To think, when you met me I had all intentions of living out my days as a farmer. Little did I know that the gods had other plans for me.$B$BThank you, outsider, for showing me my true purpose. I only hope I can live up to Eyir\'s visions and truly unite the Tideskorn once more.$B$BIf that day comes, the Legion will regret ever setting foot in Stormheim.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45528, 'enUS', 'Now the demons can\'t call reinforcements. That was great!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45532, 'enUS', 'What did she say about a distraction?! This isn\'t sounding good...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45534, 'enUS', 'Remarkable! So there really was something to that prophecy after all!$B$BI am glad that Sigryn will lead the vrykul instead of the brutes who challenged her. Let us just hope she can unite the Tideskorn under her banner before the Legion has this place overrun.$B$BWell done, $n!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45539, 'enUS', 'Wow, that\'s impressive! Here\'s the sack of supplies, you earned it! Sorry about the dampness.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45540, 'enUS', 'Thank you for coming, I have some interesting news about what\'s been going on in the Wailing Caverns since Naralex has awakened.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45545, 'enUS', 'Blowing up demons never gets old, does it? Ha!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45551, 'enUS', '<Nighthuntress Syrenne\'s pet is too weak to react to your presence.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45552, 'enUS', '<D\'Bynn gently nuzzles your hand.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45553, 'enUS', 'I suppose I have you to thank for saving my beloved companion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45554, 'enUS', 'I have encountered many outsiders in my time patrolling the city, but never one quite as resourceful as you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45555, 'enUS', 'You continue to surprise me, outsider.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45556, 'enUS', 'Let\'s make this quick. It won\'t be long before more demons come rushing through this pass.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45557, 'enUS', 'There is no joy when a Nighthuntress falls, but it had to be done. The truth is, she died the moment she aligned herself with the Burning Legion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45560, 'enUS', 'Thank you for coming. I am glad you are treating this threat seriously.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45561, 'enUS', 'Are you ready to begin?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45562, 'enUS', 'Very good, now we can begin!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45563, 'enUS', 'Coins are interesting items. They travel far and wide across the lands, yet this one seems to also travel through time.$B$BThe fact that you found this coin where you did is both an omen and a blessing.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45564, 'enUS', 'There were quite a few guards as I scouted around. I noticed more strange things on the other side.$B$BLet me see those totems.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45565, 'enUS', 'Very good, Squire- First Class! Now the real journey begins!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45566, 'enUS', 'Excellent, you found my armor.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45567, 'enUS', 'Pimento! You found him!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45568, 'enUS', 'Yes!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45570, 'enUS', 'At last, the Focusing Iris is returned! I will rest easier knowing it is once again safe in the vaults.$B$BI\'m sorry to hear about Xylem, though I\'m happy he survived the ordeal. He may be eccentric, but his heart is in the right place. $B$BWe can use more allies like him in the wars to come.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45571, 'enUS', 'Good, you\'re here. Let\'s get to work.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45572, 'enUS', 'We must remember our allies who have fallen on this day and in their honor, continue our fight.$B$BThe time is upon us, $n. Our riders are ready. Let us show the Burning Legion the true strength of Highmountain.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45573, 'enUS', 'Easy as pie, Shadowblade. Now is when the plan kicks into action!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45574, 'enUS', 'Let\'s hope that\'s enough to brew a cure for our dying monks!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45575, 'enUS', 'Tugar... I thought he was dead. He was a nasty Bloodtotem even before the Legion arrived.$B$BWe have to get to him.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45576, 'enUS', 'Ah, my blade sings. Time to put this plan into action, Shadowblade.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45586, 'enUS', 'Good. The Soulstone\'s shields should be sufficiently strengthened now.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45587, 'enUS', 'That was powerful fel magic. If it is true, if he is raising an army of such beasts... Thunder Totem is in peril!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45614, 'enUS', 'The Felborne will respect the Tirisgarde now, do you not agree?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45615, 'enUS', 'Now that\'s what I\'m talking about! You know what they say - where there\'s mages, there\'s dust!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45627, 'enUS', 'Thunder Totem and countless lives are saved. One more crisis down in this war against the Legion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45628, 'enUS', 'That couldn\'t have gone better if I had done it myself. Good work, Shadowblade.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45629, 'enUS', 'That couldn\'t have gone better if I had done it myself. Good work, Shadowblade.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45630, 'enUS', 'You make a pretty good business partner, bud! I\'ll see what I can do to get ol\' Khadgar on board with these new servants. $B$BI tell ya I\'m gonna make a fortune!$B$BOh, don\'t think I forgot you. I\'ve got somethin\' special in mind for ya!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45632, 'enUS', 'The filthy naga ambushed me. I will not fail again.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45633, 'enUS', 'With their leaders defeated, the Felrage naga will not be preying on our warriors again. Still, we should keep an eye on them in the future.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45634, 'enUS', 'Well done, $n. The kvaldir will be useful tools in the battles to come.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45639, 'enUS', 'This will work just fine. De Horde thanks you, bruddah.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45642, 'enUS', 'Look at that mountain of meat. You done de Horde proud, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45643, 'enUS', 'You make your Warchief proud. For da Horde!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45644, 'enUS', 'Blast, I didn\'t think he would find me again so fast.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45645, 'enUS', '<Doloria gives you a sly wink from behind her mask>$B$BUh, no, haven\'t seen her for a few days, not sure who you\'re talking about.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45647, 'enUS', 'Our soliders will be back in action soon, and the Felrage naga will think twice before messing with us again!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45648, 'enUS', 'Thanks. I was ambushed by a dozen naga and skrog! At least I took quite a few down before they overwhelmed me...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45649, 'enUS', 'Our soliders will be back in action soon, and the Felrage naga will think twice before messing with us again!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45650, 'enUS', 'With their leaders defeated, the Felrage naga won\'t be launching any more raids for awhile! Still, we should keep an eye on them in the future.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45652, 'enUS', 'You\'re in charge here?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45706, 'enUS', 'Let\'s not keep my tribe waiting.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45723, 'enUS', 'Fel blood has never been sweeter.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45724, 'enUS', 'I reclaimed Arikara. Did you find the Doomstone?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45725, 'enUS', 'The Legion cannot break the Grimtotem.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45726, 'enUS', 'You\'ve done those souls a great favor. I hope they find peace.$B$BLet\'s cut off these experiments at the source now.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45727, 'enUS', 'Excellent work, $n. We still have a long road ahead of us to rid this world of the Legion, but this brings us one step closer.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45729, 'enUS', 'Many thanks, friend.$B$BFor the Alliance!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45730, 'enUS', 'With your help, the Alliance may win this thing.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45731, 'enUS', 'This will work just fine. The Alliance thanks you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45733, 'enUS', 'Excellent hunting, $C.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45734, 'enUS', 'Look at that mountain of meat. You have done the Alliance proud, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45735, 'enUS', 'You make your King proud. For the Alliance!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45747, 'enUS', 'Well done, $R. For the Horde!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45748, 'enUS', 'Oh, I see. This is a trophy of battle.$B$BWe will add it to the many treasures you and your fellow adventurers have brought. For the Horde!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45749, 'enUS', 'Ahh, the trophy of an epic battle. Well fought, $C!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45750, 'enUS', 'Ah, I see, it is a hard-earned reward from one of your many battles. Well done, $C!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45751, 'enUS', 'This is an impressive find indeed. The Abyssal High Council do not part with their sigils easily.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45752, 'enUS', 'To wrest a sigil from one of the Abyssal High Council is a feat worthy of praise. For the Horde!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45753, 'enUS', 'Ah, a sigil. From the Abyssal High Council, no less!$B$B<Warlord Gorchuk wipes a bead of sweat from his brow.>$B$BI... I had assumed that it was... that you were... oh, never mind.$B$BFor the Horde!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45754, 'enUS', 'A sigil from the Abyssal High Council? You\'ve outdone yourself today, $R.$B$BFor the Horde!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45755, 'enUS', 'Well done, $R. For the Alliance!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45756, 'enUS', 'Oh, I see. This is a trophy of battle.$B$BWe will add it to the many treasures you and your fellow adventurers have brought. For the Alliance!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45757, 'enUS', 'Ahh, the trophy of an epic battle. Well fought, $C!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45758, 'enUS', 'Ah, I see, it is a hard-earned reward from one of your many battles. Well done, $C!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45759, 'enUS', 'This is an impressive find indeed. The Abyssal High Council do not part with their sigils easily.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45760, 'enUS', 'To wrest a sigil from one of the Abyssal High Council is a feat worthy of praise. For the Alliance!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45761, 'enUS', 'Ah, a sigil. From the Abyssal High Council, no less!$B$B<Field Marshal Snowfall wipes a bead of sweat from his brow.>$B$BI... I had assumed that it was... that you were... oh, never mind.$B$BFor the Alliance!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45762, 'enUS', 'A sigil from the Abyssal High Council? You\'ve outdone yourself today, $R.$B$BFor the Alliance!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45763, 'enUS', 'The Legion is forcing Azeroth to bend to its will. We cannot allow this any longer!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45764, 'enUS', 'It\'ss a shame the batriderss didn\'t make it. Even more reason to blast the hell out of the Legion as soon as the Fel Hammer\'ss weaponss core iss operational again.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45765, 'enUS', 'I provided cover as the weaker of your people retreated. They will return to the Maelstrom safely.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45767, 'enUS', 'It seems the Doomstone is pulsating with energy.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45769, 'enUS', 'Ah, you\'ve awoken. I have heard tale of what happened.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45770, 'enUS', 'That was quite the encounter, wouldn\'t you say Highlord $n? Reminds me of my glory days.$B$BNevertheless we\'ll be keeping a more watchful eye on Stratholme from now on. But that\'s not important right now.$B$BWe should move on to the ceremony and have you claim your prize!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45771, 'enUS', 'Grandmaster $n, these old bones grow weary. Our future depends on you to continue the fight against the Legion.$B$BSo long as you remain a beacon of light in the darkness, hope remains!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45785, 'enUS', 'And who are you? $n?$B$BAhh... yes, I believe I\'ve heard mention of you before. Welcome to Silithus, $n.$B$BToday, we celebrate our heritage as sons of Kalimdor. Furthermore, we prove that the Horde will always grind those puny Alliance into the ground.$B$BAre you with me?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45787, 'enUS', 'And who are you? $n?$B$BAhh... yes, I believe I\'ve heard mention of you before. Welcome to Silithus, $n.$B$BToday, we celebrate the fabled war history of Kalimdor. Furthermore, we prove that the Alliance will always show the Horde their inferiority.$B$BAre you with me?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45788, 'enUS', 'Thank ye for coming so quickly, High $C. King Magni, or I suppose I should say \'The Speaker,\' thinks he\'s found a hidden Titan vault!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45789, 'enUS', 'Tis our greatest honor ta present ye with this steed, High $C. An\' thank ye for leading us, ye are truly blessed by the Light, an\' so are all of us for havin\' ye.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45790, 'enUS', 'I will miss Brewmaster Blanche. She taught me to follow my dreams.$B$BAnd I have always wanted to study Mistweaving...$B$BGrandmaster $n. If you will have me, I will defend you and our order from all that wish us harm.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45794, 'enUS', 'Thank you for bringing me news of Jubeka. It could not have come at a better time.$B$BWe\'ve received information on Kanrethad\'s whereabouts.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45795, 'enUS', 'Our fight doesn\'t end here, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45796, 'enUS', 'You have saved Thunder Totem and we owe you yet another debt.$B$BIt\'s a shame that Tugar wasn\'t there. As long as he lives, we are in danger.$B$BI will do everything I can to find him, and then we will finish this... together.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45798, 'enUS', 'It\'ss about time you shut that demon up. Thanksss...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45799, 'enUS', 'Ah, $n, you have returned. An otherworldly air hangs heavy about you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45812, 'enUS', 'We must continue our fight.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45813, 'enUS', 'Well, she has been taken, but we shall never rest. Join me as my Follower, lead my troops, perform missions for me! Together we will find her!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45833, 'enUS', 'Straighten up, Shadowblade. We\'ve got work to do.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45834, 'enUS', 'With the Valarjar leading the vanguard, our offensives will be glorious!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45835, 'enUS', 'They ran right past us on their way out.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45836, 'enUS', 'Welcome back, Shadowblade. I assume you\'ve retrieved the gunpowder?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45838, 'enUS', 'I\'m afraid our fight has only brought us so far. We must press our attack before the Legion advances beyond their stronghold within the Temple of a Thousand Lights!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45839, 'enUS', 'Just beyond these cliffs, the forces of the Legion are gathering for their assault. For every moment that passes their number grows.$B$BWe must strike soon before we are overwhelmed!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45840, 'enUS', 'My apologies, $n. I hope Aviash and I did not offend you. One cannot be too careful during times like these.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45841, 'enUS', 'I am relieved that you have dealt with immediate threat. We barely have enough resources for the Broken Shore as it is!$B$BStill we have something for you...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45842, 'enUS', 'We hope the increased power to your weapon will prove useful on the Broken Shore and beyond.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45843, 'enUS', 'Any luck out there?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45844, 'enUS', 'Archmage, I\'ve found something you may be interested in. An old journal of the late Archmage Antonidas. In it, he speaks of a project he was working on that I think we may be able to finish.$B$BIt was a sort of flying disc that could attune itself to the rider\'s magical specialization.$B$BBut I need your help tracking down the pieces. From what I could gather, he gave them to trusted friends and allies through the years. Perhaps you could persuade them to give us the pieces.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45845, 'enUS', 'You\'ve recovered it! And it is as Antonidas wrote, still surging with great fire magic!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45846, 'enUS', 'Ogres took it? Those beasts will grab anything they can I suppose.$B$BRegardless, it\'s excellent you were able to find it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45847, 'enUS', 'To think it was right here in Dalaran the whole time.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45848, 'enUS', 'Squawk! Tethys is lame! Bad pirate! bad pirate!$B$B$n better pirate, raaaaawk! Go with you now!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45856, 'enUS', 'You have sacrificed for our lands, brave $C.$B$BYour perseverance has inspired our brothers and sisters to stand against the Burning Legion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45861, 'enUS', 'We hope the increased power to your weapon will prove useful on the Broken Shore and beyond.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45862, 'enUS', 'We hope the increased power to your weapon will prove useful on the Broken Shore and beyond.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45863, 'enUS', 'We hope the increased power to your weapon will prove useful on the Broken Shore and beyond.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45864, 'enUS', 'We hope the increased power to your weapon will prove useful on the Broken Shore and beyond.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45865, 'enUS', 'We hope the increased power to your weapon will prove useful on the Broken Shore and beyond.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45866, 'enUS', 'We hope the increased power to your weapon will prove useful on the Broken Shore and beyond.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45873, 'enUS', 'I am not one for emotional speeches, Battlelord $n, so I will keep this short. $B$BI owe you my life. My axes are at your service.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45876, 'enUS', 'You are an inspiring leader, Battlelord $n. I will follow you to Argus and back if you will have me!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45883, 'enUS', 'I will not allow such insolence!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45890, 'enUS', 'What business do you have here? Have you come to scavenge what the harpies left behind?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45902, 'enUS', 'It is small compensation for the deed you have accomplished, I hope it is enough.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45904, 'enUS', 'I cannot thank you enough, hero.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45905, 'enUS', 'Your competence in these matters is greatly appreciated.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45906, 'enUS', 'Once this is all over, the Council hopes to thank you properly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45908, 'enUS', 'Your talent for this sort of thing is astounding!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45909, 'enUS', 'We hope the increased power to your weapon will prove useful on the Broken Shore and beyond.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45910, 'enUS', 'Once again you have proven to be a capable agent against the Legion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45916, 'enUS', 'The amount of power this Levia channeled into this portal is impressive, if unnecessary. Unfortunately, if we don\'t get it stable, it\'s likely to collapse and take us with it. $B$BSufficed to say, that would end your mission pretty quick.$B$BI have to concentrate to keep this open, so I\'ll need your help...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45917, 'enUS', 'What... what is going on? $B$BWho are you?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45971, 'enUS', 'I laughed as their infernals crumbled. They return to Azeroth, as they belong.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45974, 'enUS', 'Greetings, Highlord. I\'ve just been informed about the wounded soldier who escaped from the Broken Shore.$B$BWhat he must have endured...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45975, 'enUS', 'Grim tidings indeed.$B$BI suggest we continue sending our champions to scout out the dangers that await.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45986, 'enUS', 'Greetings, Battlelord. I\'ve just been informed about the wounded soldier who escaped from the Broken Shore.$B$BWhat she must have endured...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45987, 'enUS', 'Grim tidings indeed.$B$BI suggest we continue sending our champions to scout out the dangers that await.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45989, 'enUS', 'Greetings, Netherlord. I\'ve just been informed about the wounded soldier who escaped from the Broken Shore.$B$BWhat she must have endured...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45990, 'enUS', 'Grim tidings indeed.$B$BI suggest we continue sending our champions to scout out the dangers that await.', 0);
