INSERT INTO `quest_offer_reward_locale` VALUES (45996, 'enUS', 'Grim tidings indeed.$B$BI suggest we continue sending our champions to scout out the dangers that await.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45997, 'enUS', 'Greetings, Archmage. I\'ve just been informed about the wounded soldier who escaped from the Broken Shore.$B$BWhat she must have endured...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (45998, 'enUS', 'Grim tidings indeed.$B$BI suggest we continue sending our champions to scout out the dangers that await.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46000, 'enUS', 'Well done, Archmage $n! Dalaran can defend herself once again.$B$BFor all of our sakes, let us hope that the shields keeping Kathra\'natir imprisoned do not fail before we are able to find a safer solution.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46020, 'enUS', 'The crystals will be safe here, with each of the council members watching over them.$B$BKanrethad is still recovering, but is well enough to speak.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46022, 'enUS', 'Greetings, Huntmaster. I\'ve just been informed about the wounded soldier who escaped from the Broken Shore.$B$BWhat she must have endured...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46023, 'enUS', 'Grim tidings indeed.$B$BI suggest we continue sending our champions to scout out the dangers that await.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46024, 'enUS', 'Greetings, Grandmaster. I\'ve just been informed about the wounded soldier who escaped from the Broken Shore.$B$BWhat she must have endured...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46025, 'enUS', 'Grim tidings indeed.$B$BI suggest we continue sending our champions to scout out the dangers that await.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46026, 'enUS', 'Greetings, Archdruid. I\'ve just been informed about the wounded soldier who escaped from the Broken Shore.$B$BWhat he must have endured...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46027, 'enUS', 'Grim tidings indeed.$B$BI suggest we continue sending our champions to scout out the dangers that await.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46028, 'enUS', 'Greetings, High $C. I\'ve just been informed about the wounded soldier who escaped from the Broken Shore.$B$BWhat she must have endured...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46029, 'enUS', 'Grim tidings indeed.$B$BI suggest we continue sending our champions to scout out the dangers that await.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46030, 'enUS', 'Greetings, Deathlord. I\'ve just been informed about the wounded soldier who escaped from the Broken Shore.$B$BWhat he must have endured...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46031, 'enUS', 'Grim tidings indeed.$B$BI suggest we continue sending our champions to scout out the dangers that await.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46034, 'enUS', 'All these priests? They report to you? It\'s astonishing, really.$B$BI have only one Roland, and it seems you have hundreds!$B$BI think we will get along well, $n. Very well, indeed.$B$BAllow me to stay, and in return, I will offer you my services.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46035, 'enUS', 'Another crisis averted! Your effectiveness is without compare.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46043, 'enUS', 'Archmage, the events of the past have long weighed heavily upon me. While I do not regret my actions, I do regret what happened. If I could go back and change things...$B$BI hope in time the Kirin Tor - indeed, all of Azeroth - will better understand my loyalties. Thanks to you, crisis has been averted. Please accept my enduring gratitude.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46044, 'enUS', 'Look, Archdruid, don\'t get me wrong. I love Aviana. She\'s my ancient! But she\'s a little too passive for me to follow around all the time.$B$BYou, on the other hand? You\'re the real deal! I want to be in the fray, ruining some demon\'s day!$B$BSo? Will you take me with you?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46045, 'enUS', 'I know I have much to answer for.$B$BAlthough you have freed my family from their curse, nothing can take away the pain my mistakes have caused them. $B$BDelas has done well to devote herself to the Silver Hand. Do not let my past reflect poorly on her.$B$BI\'d like to follow her lead, and lend my aid to your order.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46047, 'enUS', 'Although my recollection of recent events is still a bit hazy, the power you displayed when dispatching Rezara was something I could never forget.$B$BIt seems fitting that the council chose you as its leader in my absence.$B$BRest assured, I have no desire to challenge their decision. I owe you my life.$B$BLet me serve you and the council. There is much we can learn from each other.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46048, 'enUS', 'Tell me, $n, are all those among your ranks as dedicated as their leader?$B$BI\'ve been reluctant to trust outsiders, but you and I aren\'t so different, are we? We\'re both willing to go to great lengths to protect the things we care about. Our goals seem to align in that regard.$B$BI would like to lend my aid to you and your hunters, if you\'ll allow it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46049, 'enUS', '<Your tadpole has prepared a gift for you. What could be inside?>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46050, 'enUS', 'Look, I may be dead and my lungs may serve no purpose, but raising Daumyr to undeath was like a breath of fresh air for me. I ask that you continue to take me under your guidance. Bring me to the battlefield again! I will scatter the bones of any demon that so much as looks at me.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46057, 'enUS', 'You are a foolish child. You think you have great power, but you know nothing. The Doomstone should be used for the greatness it can accomplish! It will waste away sitting in the Maelstrom.$B$BPerhaps it was a mistake coming here. Nobundo requests that the Grimtotem stay. I stay for my own reasons, not because he asked. If you need me or my warriors to earn our keep, we will oblige.$B$BBut remember your place.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46058, 'enUS', 'You made quick work of those demons, and I hope you do the same to many more. So long as the Legion extends their influence on our world, they will continue to corrupt our people as well.$B$BI would like to continue to work with you to end this madness. My blades are yours, Shadowblade.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46059, 'enUS', 'You\'ve proven your expertise to me many times over, Shadowblade. While my colleagues have already pledged their service to you, I took a step back. Though all rogues step in the shadows, it is of vital importance that my status remains truly secret.$B$BHowever, the threat is too great. We are so close to taking the Legion down... and I want to take on a greater role in it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46060, 'enUS', 'You risked your life freeing those animals from a life worse than death. I commend you, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46061, 'enUS', 'Glrm. Mrr glrg.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46062, 'enUS', 'Glrrrrms!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46064, 'enUS', 'Mrrga mr. Gll-mrrr!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46065, 'enUS', 'News has reached me of Agatha\'s demise, as well as her plot to infiltrate the Kirin Tor. If it weren\'t for your swift action, I fear the damage her sayaad could\'ve done would be irreparable. $B$BMy mages are working to hunt down any of Agatha\'s remaining allies, but the real victory today belongs to you, $n.$B$BThe Kirin Tor thanks you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46069, 'enUS', 'Highlord! I\'d like to speak with you about obtaining a special mount...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46070, 'enUS', '<Grayson examines the barding.>$B$BThis is... well, a good start, Highlord. But I think it will have to be strengthened a bit.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46071, 'enUS', 'Greetings, Highlord. What can I help you with?$B$B<You explain what you need to Alard as he looks over the barding.>$B$BI see. I can certainly help you with your upgrading this, but I\'ll need a few things first.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46074, 'enUS', '<Grayson examines the barding.>$B$BThis is perfect. Exactly what I expected from Alard. Now that we have everything together, there is but one task left.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46078, 'enUS', 'A bit late for the warning, eh? Still, I appreciate that we haven\'t been forgotten.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46079, 'enUS', 'You\'ve saved many lives this day, $C. Bradensbrook thanks you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46080, 'enUS', 'We realize these spirits are misguided, but we have to care about the living more than the dead at this point.$B$BThe attacks should ease off for a while.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46082, 'enUS', 'I had hoped this town had found peace after what we\'ve all been through. Somehow restless dead have been stirred into a fury. We need to stop it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46083, 'enUS', 'You got them! Now to upgrade your barding.$B$BNever say a blacksmith can\'t improve on a leatherworker\'s work, I always say. I mean never. I mean... well you know what I mean.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46089, 'enUS', 'We have shown the demons why they should truly fear the darkness. Now, Lord Ravenholdt has something for you from his personal collection.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46103, 'enUS', 'You don\'t really know if an ally is an undead pawn under the control of a dreadlord until you carve into them a bit.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46106, 'enUS', 'That should disorganize the assault for some time, but we must get to the bottom of this. I sensed a fel taint about those leaders, did you?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46107, 'enUS', 'The attacks on Bradensbrook should relent for now. We must still deal with Lord Erdris, and soon.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46108, 'enUS', 'Learning more about your artifact weapon will help hasten our victory over the Legion.$B$BIf you supply me with order resources, I can provide research notes on your weapon. Read them, and learn how to take greater advantage of the power you infuse into your artifact.$B$BDeath to our enemies!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46110, 'enUS', 'Well done, $n! Well done indeed!$B$BThe Legion will rue the day they set their sights on the land of Stormheim.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46119, 'enUS', '$n! Listen. You\'ve been real good to our business. REAL good. Never thought I\'d sell so many guns.$B$BWe like to reward those that patronize our establishment, so... here. Take this.$B$BSlap this puppy on your shoulderpads and go hunting for engineering supplies. You\'d be surprised how many basilisks get sprockets stuck in their gullets!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46125, 'enUS', 'The order resources you have provided are crucial to further empowering your weapon.$B$BHere, take these notes. Read the research and apply the knowledge you have learned.$B$BOnward to victory!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46127, 'enUS', 'So Raest has fallen, and in his hubris has taken his brother with him. I mourn for them both, but his brother most of all. $B$BKaram Magespear was truly a beacon of the Light. I only hope that the stories of his sacrifices live throughout the ages. $B$BYou have done well, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46128, 'enUS', 'I been thinkin\' more about this whole battery thing, and how the whole process is just so... wasteful.$B$BI ain\'t goin\' green or nothin\' like that - I\'m just worried about our bottom line!$B$BYou know, if one were to supercharge one of these batteries with some Blood of Sargeras, maybe cap it off with some concentrated leystone...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46129, 'enUS', 'Learning more about your artifact weapon will sure speed up our victory over the Legion, boss.$B$BIf you supply me with order resources, I can whip up research notes on your weapon. Read \'em, and in no time you\'ll be taking greater advantage of the power you infuse into your artifact.$B$BLet\'s do this!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46130, 'enUS', 'Learning more about your artifact weapon will help hasten our victory over the Legion.$B$BIf you supply me with order resources, I can provide research notes on your weapon. Read them, and learn how to take greater advantage of the power you infuse into your artifact.$B$BFor Azeroth!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46131, 'enUS', 'Knowledge of your artifact is the key to bending the demons to your will.$B$BIf you supply me with order resources, I can provide research notes on your weapon. Read them, Netherlord, and the power you infuse into your artifact will magnify.$B$BYour foes will quake in fear... as it should be!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46132, 'enUS', 'Learnin\' more about yer artifact weapon\'ll help hasten our victory over tha Legion.$B$BIf ye supply me with order resources, I can provide research notes on yer weapon. Read \'em, and learn how to take greater advantage of the power ye infuse into yer artifact.$B$BFor Azeroth!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46133, 'enUS', 'Learning more about your artifact weapon will help hasten our victory over the Legion.$B$BIf you supply me with order resources, I can provide research notes on your weapon. Read them, and learn how to take greater advantage of the power you infuse into your artifact.$B$BLet pain and suffering fall upon our enemies!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46140, 'enUS', 'Learning more about your artifact weapon will hasten our victory over the Legion.$B$BIf you supply me with order resources, I can provide research notes on your weapon. Read them, and learn how to take greater advantage of the power you infuse into your artifact.$B$BWe will send the Legions back to the hell that spawned them!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46141, 'enUS', 'Learning more about your artifact weapon will help hasten our victory over the Legion.$B$BIf you supply me with order resources, I can provide research notes on your weapon. Read them, and learn how to take greater advantage of the power you infuse into your artifact.$B$BFor Azeroth!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46142, 'enUS', 'There is power in old tales. Learning the legend of your artifact weapon will hasten our victory over the Legion.$B$BIf you supply me with order resources, I can scribe tales of might and wonder. Read them, and the power you infuse into your artifact will echo through the Halls of Valor.$B$BFor Odyn!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46143, 'enUS', 'Learning more about your artifact weapon will help hasten our victory over the Legion.$B$BIf you supply me with order resources, I can provide research notes on your weapon. Read them, and learn how to take greater advantage of the power you infuse into your artifact.$B$BFor Azeroth!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46144, 'enUS', 'Learning more about your artifact weapon will help hasten our victory over the Legion.$B$BIf you supply me with order resources, I can provide research notes on your weapon. Read these tales, for within them you will learn how to take greater advantage of the power you infuse into your artifact.$B$BIn stories, we find strength!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46145, 'enUS', 'What a charming place this is. Much more hospitable than that demon-infested island.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46147, 'enUS', 'Learning more about your artifact weapon will help speed us on the path to victory over the Legion.$B$BIf you supply me with order resources, I can provide research notes on your weapon. Read them, and learn how to take greater advantage of the power you infuse into your artifact.$B$BLet the wind guide your way!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46148, 'enUS', 'These order resources are just the ticket for juicing up your weapon\'s power.$B$BHere, take these notes. I\'m not a big reader myself, but in this case, it\'s worth it. That artifact of yours will really get the job done.$B$BGood luck, boss!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46149, 'enUS', 'The order resources you have provided are crucial to further empowering your weapon.$B$BHere, take these notes. Read the research and apply the knowledge you have learned.$B$BOnward to victory!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46150, 'enUS', 'The order resources you have provided are crucial to further empowering your weapon.$B$BHere, take these notes. Read the dark secrets within and apply the knowledge you have learned.$B$BAll enemies will fall before us!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46151, 'enUS', 'The order resources ye \'ave provided be crucial ta further empowerin\' yer weapon.$B$BTake these notes. Read tha research an\' apply tha knowledge ye \'ave learned.$B$BOnward ta vict\'ry!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46152, 'enUS', 'The order resources you have provided are crucial to further empowering your weapon.$B$BHere, take these notes. Read the research and apply the knowledge you have learned.$B$BOnward to victory!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46153, 'enUS', 'The order resources you have provided are crucial to further empowering your weapon.$B$BHere, take these notes. Read the research and apply the knowledge you have learned.$B$BVictory will be ours!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46154, 'enUS', 'The order resources you have provided are crucial to further empowering your weapon.$B$BHere, take these notes. Read the research and apply the knowledge you have learned.$B$BOnward to victory!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46155, 'enUS', 'The order resources you have provided are crucial to further empowering your weapon.$B$BHere, take these notes. Read the tales within and apply the knowledge you have learned.$B$BLet the minstrels write songs of your glory!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46156, 'enUS', 'The order resources you have provided are crucial to further empowering your weapon.$B$BHere, take these notes. Read the research and apply the knowledge you have learned.$B$BOnward to victory!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46157, 'enUS', 'The order resources you have provided are crucial to further empowering your weapon.$B$BHere, take these notes. Read the research and apply the knowledge you have learned.$B$BEvery good story needs a hero!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46158, 'enUS', 'The order resources you have provided are crucial to further empowering your weapon.$B$BHere, take these notes. Read the research and apply the knowledge you have learned.$B$BMay the elements guide us to victory!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46159, 'enUS', 'Lady S\'theno went down to lend a hand, but this sounds like it\'s getting serious!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46173, 'enUS', 'It is good to see you again, my friend.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46177, 'enUS', 'So Xylem has been corrupted by shadow magic and has escaped with the Focusing Iris? This is not good.$B$BThe Kirin Tor will pool our efforts with those of his apprentici-- I mean, apprentices. We must track down the archmage before he does something drastic.$B$BWe will be in touch.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46178, 'enUS', 'We have shown the demons why they should truly fear the darkness. Now, Lord Ravenholdt has something for you from his personal collection.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46182, 'enUS', 'Our efforts today have prevailed over the Legion\'s presence, though let us not be remiss - our journey has only just begun.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46199, 'enUS', 'With the fall of their commander the Legion\'s presence in Azsuna will be more manageable for our defenders to make headway. For your efforts, we may see the end of these attacks once and for all.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46200, 'enUS', 'I am relieved that you have dealt with immediate threat. We barely have enough resources for the Broken Shore as it is!$B$BStill we have something for you...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46205, 'enUS', 'With the conduit destroyed, now may be our only chance.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46206, 'enUS', 'This warning is an ill omen indeed, $n. It seems the fate of Azeroth is tied to that of Argus, the homeworld of the Legion.$B$BWe must uncover the Dark Titan\'s plan! I believe the Speaker\'s connection to the world soul will prove crucial to our efforts.$B$BStay vigilant, Archdruid. We must trust in Magni\'s guidance... and Azeroth\'s as well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46207, 'enUS', 'That was truly a grand exposition of $C skill. I was truly impressed at how you handled Asrea. She will be missed.$B$BBut now on to a grander event. The prize which you so rightfully deserve.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46208, 'enUS', 'Battlelord $n, I have an offer you may be interested in...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46213, 'enUS', 'You brought crystals with you? Thank the Light, that\'s just what we need!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46235, 'enUS', 'You\'ve done so much so quickly here on the Broken Shore. Impressive, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46237, 'enUS', 'Our task will not be easy, but when this is over it is we who will be the true masters of Xoroth.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46238, 'enUS', 'Excellent. This Unbending Potion should shore up the Felslate enough to hold the portal\'s structure, and these Chaotic Spinel crystals should focus the portal\'s magic nicely.$B$BI will set the mo\'arg to work posthaste.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46239, 'enUS', 'I sense the fel energy emanating from the core the moment you entered Dreadscar Rift. $B$BI think this will suit our needs.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46240, 'enUS', 'That\'s... quite a bit of blood. I am impressed, $n.$B$BI really should just start stockpiling this stuff. It has so many uses!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46242, 'enUS', 'Long have I waited to get my hands on one of the dreadlord\'s calling stones. Were it not for our current task, we could outfit an army with dreadsteeds.$B$BHowever, this will serve a greater purpose. With the lure of this stone, Arax\'ath will not be able to restrain the Wrathsteed. So long as we can keep the portal open long enough, it will come.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46243, 'enUS', 'The Wrathsteed is prepared for your binding, Netherlord. It will not be easy to enslave, its will is strong.$B$BI have to say, I\'m a bit jealous. Never before have I seen such a ferocious beast, our disciples have it barely held in check.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46244, 'enUS', 'Mephistroth is dead and the Cathedral is secured, but the lower reaches of the Tomb remain in the hands of the Legion.$B$BThis is not the outcome we wanted, but this fight is far from over, $n.$B$BDo not relent. Give the Legion no quarter, no place to hide. When we are ready, we will take the Tomb and drive them from Azeroth!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46245, 'enUS', 'Good on ya, mate! Not that there\'s a bad choice to be made, of course, but it\'s important to keep a positive attitude when surrounded by an infinite number of demons looking to kill ya.$B$BAs you gather additional supplies, come on back and I\'ll see they get assigned to the fortification of your choice.$B$BPhew! That was a mouthful, right? I\'d say it\'s time for a pint.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46246, 'enUS', 'I have spent a lifetime hunting the wicked and making them pay for their crimes. When I strike a demon down, I feel a measure of justice has been served.$B$BYou have been an instrument of retribution this day, Huntmaster. Had you walked a different path, you might have made a worthy Warden.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46247, 'enUS', 'A fine victory, Archdruid.$B$BBut do not grow complacent! Fight back against the Legion wherever they strike.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46248, 'enUS', 'Step by step, we march closer to victory. We must not relent!$B$BOnly through courage and persistence will we stop the insidious evil that threatens the soul of this world.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46249, 'enUS', 'Excellent work, Huntmaster! When this war is finally won, I believe I owe you and your order champions a banquet to honor your heroism.$B$BSay, that sounds like something that Odyn fellow would say. Not that I\'ve met him myself, of course...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46250, 'enUS', 'We must take every opportunity to shatter the will of Kil\'jaeden\'s army.$B$BWhen they see their mightiest champions crumble to dust, they will realize that the vaunted Legion is doomed to fall.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46251, 'enUS', 'It has been pointed out to me that I can, on occasion, get a bit carried away.$B$BThis... <clears throat> might possibly have been one of those times.$B$BA single Nethershard will suffice for my purposes. I\'m certain you can put the rest to good use.$B$BLet\'s not speak of this again.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46252, 'enUS', 'Thinning the ranks of demons in locations like Faronaar and Felsoul Hold cuts the legs out from under the Legion.$B$BKil\'jaeden will fall!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46253, 'enUS', 'The Pillars of Creation are in place. The Tomb of Sargeras is sealed, and Aegwynn\'s echo is at rest.$B$B<Khadgar gestures toward the sky.>$B$BUnfortunately, we do not have that luxury.$B$BThough you won a great victory this day, there is no time for revelry. The final battle awaits us. Make ready.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46258, 'enUS', 'You have witnessed the destruction the Doomstone can wreak firsthand. You are a trusted warden of Azeroth, but even in your hands the power caused chaos and panic amongst your people. Imagine it in the control of someone with ill intent...$B$BWe cannot let that happen.$B$BWe discussed what to do with this artifact at length while we waited for you to awaken. We considered giving it a new home in one of the elemental planes, but each one provided its own danger.$B$BThere is no safer place for it than here.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46259, 'enUS', 'You have my thanks, $n. The Moonfang family has certainly seen better days.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46260, 'enUS', 'We\'ve been discussing your recent success, $n. We walk the shadows, and that often goes taken for granted. But without us, the Armies of Legionfall would have a great many more powerful demons to deal with.$B$BWe do not need the fame. We reap the rewards.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46266, 'enUS', 'Your quick blades have proven your worth to the Illidari yet again, Slayer $n. We will begin the repairs to the Fel Hammer immediately. $B$BWe cannot allow the Legion to catch us with our pants down again!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46267, 'enUS', 'Your return is triumphant indeed, Battlelord $n!$B$BUnder your leadership, the warriors of Skyhold are truly a force to be reckoned with!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46268, 'enUS', '<As the king examines the compass, his expression turns from recognition to sorrow.>$B$BWhen I went through my father\'s things and didn\'t find this compass, I assumed it was with him on the Broken Shore when Gul\'dan...$B$B<The king\'s voice breaks.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46272, 'enUS', 'You\'ve arrived at last, Huntmaster!$B$BYou may have noticed that King Anduin is conspicuous by his absence.$B$BThis is a situation that only you can rectify.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46274, 'enUS', 'Let me guess... Genn sent you.$B$BI wonder which he\'s more concerned about... my well-being, or keeping up the appearance that everything is normal?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46275, 'enUS', 'They\'re right. They\'re absolutely right.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46278, 'enUS', 'You\'re an absolute natural!$B$BSay, do you mind sticking around for awhile? I could sure use a helping hand!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46282, 'enUS', 'You have helped me more than I can say, $n. For that, you will always have my thanks.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46286, 'enUS', 'That\'s what I\'m talkin\' about, mate!$B$BOi! Time to get to work.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46290, 'enUS', 'We must not forget that this is a temporary measure. I cannot overstate the devastation that will ensue if Kathra\'natir escapes... $B$BStill, thanks to you, Dalaran\'s teeth are sharpened once more. Well done, Archmage $n!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46291, 'enUS', 'Someone took something from Cookies\' cauldron? I\'ll report this to Breanni immediately. It seems the Wailing Caverns was not a singular incident. There is something big going on and I feel you have unknowingly stepped into the middle of it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46292, 'enUS', 'Impressive work. Here\'s the supplies I promised you. I believe that shadowy figure left it behind.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46293, 'enUS', 'I don\'t know nothing about nothing! Better get going before my shiv finds your face! Don\'t test me, cause I ain\'t all that bright!$B$BOh, Breanni? Yeah, sure! She\'s an old friend!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46297, 'enUS', 'Now for the main weapon.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46305, 'enUS', 'See? Totally convinced. Let\'s take this torch down to the beacon.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46314, 'enUS', 'Slayer $n, you\'re a sight for sore eyes.$B$BWe need to move quickly!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46316, 'enUS', 'I remember you, $n. We met long ago within the Black Temple. How could I forget such power?$B$BIt seems fitting that the council chose you as its leader in my absence.$B$BRest assured, I have no desire to challenge their decision. I owe you my life.$B$BLet me serve you and the council. There is much we can learn from each other.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46317, 'enUS', 'Archdruid! We don\'t have much time, the shrine burns as we speak!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46318, 'enUS', 'The Legion will pay for what we\'ve lost today. We escaped with as many of us as we could, but too many died in vain, trying to protect the Shrine and the Idol of Aviana, which was lost anyway, thanks to that demon scum, Shadegrove.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46319, 'enUS', 'You place the Corrupted Idol of Aviana on the pedestal.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46320, 'enUS', 'Hmm let me take a look... Yes, I think I can counter these!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46322, 'enUS', 'Finally... my time to shine. Let\'s do this right.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46323, 'enUS', 'Yes... the gunpowder. It is the key to my plan!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46324, 'enUS', 'They left with such purpose... fools.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46326, 'enUS', 'Welcome back, Shadowblade. I assume you\'ve retrieved the gunpowder?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46327, 'enUS', 'You are lucky that Modera contacted me for assistance. $B$BAgatha is beyond you, $C. She is beyond any of us.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46333, 'enUS', 'Slayer $n, I have something I would like to speak with you about when you have a moment.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46334, 'enUS', 'Never would I have thought an adult fel bat could be tamed, but your efforts seemed to have prove otherwise. This is a promising revelation for us.$B$BBut for now, let all see what you have accomplished.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46335, 'enUS', 'Now that\'s quite the eclectic collection if I ever saw one!$B$BThese are all powerful in their own way to be sure, but none are useable for our needs. At least not in their current form.$B$BI wonder...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46336, 'enUS', '<You gingerly pick up the shimmering letter and open it.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46337, 'enUS', '<An empty saddle sits here, as if it is waiting for your new companion.$B$BYou feel a warm kinship with the beast as you recall your meeting. and you know what you must do to call the Wolfhawk. You put your fingers to your lips...>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46338, 'enUS', 'So word has gotten out about Ryanna already? Ha!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46339, 'enUS', 'This appears to be some sort of attunement crystal. Perfect.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46340, 'enUS', 'So the daughter of Skovald followed in her father\'s footsteps? A pity, but it may have been inevitable. I believe this may be the \"fall\" the scrolls mentioned.$B$BIf this is true, there may still be hope! I will work on a way to get us into the Halls of Valor to pursue this Sigryn. I will be in touch when we find a way.$B$BIn the meantime, you have done a great service to bring her this far. I would not let that go unrewarded.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46341, 'enUS', 'Thank you for listening, and for paying for this beverage.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46342, 'enUS', 'A senseless loss of life, and for what?$B$B<Master Bu looks heavily at the portal and shakes his head.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46343, 'enUS', 'These old bones just need a little rest. But we appear to be one step further on our journey.$B$BThat grummle over there looks like he could use some assistance. Why don\'t you talk to him while I get some rest?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46344, 'enUS', 'Smelly has a new idea! Leave his pack on fire!$B$BNothing else bad happen while pack on fire! Pack on fire IS Smelly\'s new luckydo! You keep old one.$B$BOh, you looking for big tiger? Smelly saw big glowy tiger. Went towards monastery. Smelly was helpful?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46345, 'enUS', 'I think we have stumbled upon their headquarters. Be careful in here!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46346, 'enUS', 'I\'ve just begun my meditation, Grandmaster. But we may have another lead...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46347, 'enUS', 'The Shado-pan appear greatful, Grandmaster.$B$BShall we cont... what is that black residue on your foot?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46348, 'enUS', 'Greetings. It is not every day that a Grandmaster $C comes to visit me. How can I be of service?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46349, 'enUS', 'Thank you. Allow me to search for answers for you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46350, 'enUS', 'It will be my honor to carry you on the ceremonial path from this shrine to the temple, as I have done for the Grandmasters before you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46351, 'enUS', 'What is this?$B$BThis is not just any old shield generator - it is almost... a sentient entity...$B$BAnd it is very eager for a job to do. Yes, I think it will be quite content to work with us.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46353, 'enUS', 'Thank you for coming, Grandmaster.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46499, 'enUS', 'Oh, look here! You went and got that treasure! Hey... You still got a spider on your shoulder.$B$BLets see what fantastic treasure you brought me... This is it? This is worthless! Here you keep it.$B$BTough break, kid. Keep at it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46501, 'enUS', 'You found a key in a chest? Nothing else?$B$BI\'m guessing the last guy took all the goods, then accidentally locked the key in the chest. So, you just found a key to a chest that you\'ve already looted. Fantastic work... And people say I suck at this job.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46509, 'enUS', 'Did you bother to read the label on this potion? I\'m going to assume, no. You may find some sucker who will pay you for it.$B$BBetter luck next time kid.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46510, 'enUS', 'It\'s... Wet. This thing is most likely worthless now.$B$BIs there a good piece of treasure on this cursed island? I may not be the brightest tool in the bag, but I\'m starting to think this place doesn\'t really fit my \"chance of death versus treasure\" ratio.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46511, 'enUS', 'This is it? You sure you didn\'t find anything else? Like a giant pile of gold on top of a statue made of diamonds which was holding a scroll listing the combination to the vault in Ironforge? That would have been pretty sweet.$B$BOh well. I can make this into a paper weight or throw it at a squirrel.$B$BCome back tomorrow, I\'ll have another job for you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46666, 'enUS', 'Looks like we hit the motherlode! Now all we need is a key... Huh. Why don\'t you go work on getting some keys for these chests and I\'ll hang out with goofy-nose here.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46674, 'enUS', 'Look at him squirm. He gave in easily!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46675, 'enUS', 'Let me take a look at these... I think I\'ve got it!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46676, 'enUS', 'I feel a lot better knowing we were able to save some of the other druids. We did what we could.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46677, 'enUS', 'Revenge feels so good.$B$BBut stopping the attacks on the ancients feels even better.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46678, 'enUS', 'Ah thank you for locating that. Let me see--we\'ll want to target the most stylish of the Nightborne... this seems like the perfect list... oh, she\'s dangerous... so\'s that one... very well. $B$BThere is a lot to do so you should get started!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46679, 'enUS', 'Excellent, $n! Oh the things you will sew!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46680, 'enUS', 'Excellent work, my friend! I will find an appropriate use for this as soon as I can.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46681, 'enUS', 'The soul thread is so beautiful! I am very pleased, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46682, 'enUS', 'Ah, that is just what we need, young $R!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46683, 'enUS', 'The cloth you\'ve created is like none I\'ve ever seen. Beautiful! $B$BTake these elements and make something wonderful with them. I will be the first to write of your accomplishments and I truly believe you will become, at last, an icon of heroic style, $n!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46684, 'enUS', 'Ancient wisps? Beautiful! This is a strong start, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46685, 'enUS', 'The shroud is perfect, $n. Well done!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46686, 'enUS', 'These gloves have an air of sadness about them, do they not? Regardless, thank you for restoring them and bringing them here.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46687, 'enUS', 'The spellsash looks perfect, $n! I couldn\'t have done a better repair myself.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46688, 'enUS', 'That is, indeed, dreadleather. Should be enough for our needs, $n. My thanks!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46689, 'enUS', 'The Elderhide leather that you\'ve created is magnificent. Take this, and work your magic to create something of wonder and beauty. $B$BIt is an extraordinary accomplishment and you will look quite dashing--and I should know!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46690, 'enUS', 'What a magnificent creature! Allow me to attune him to you...there! With his ancient knowledge, we are ready to begin.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46691, 'enUS', 'The mantle looks brand new! Excellent craftsmanship, $n!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46692, 'enUS', 'Those legplates are rather large! I\'m surprised you survived that encounter--and you\'ve refinished them beautifully!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46693, 'enUS', 'These bracers have legends of their own--too bad we need to sacrifice them to build a proper reputation for you but we all must suffer for fashion. $B$BI would also like to personally thank you for killing Viz\'aduum. It just shouldn\'t... exist. I mean... well you know what I mean.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46694, 'enUS', 'That should be enough Ancient Gravenscale. Well done, $n!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46695, 'enUS', 'The Wardenscale is incredibly light yet strong--I have never seen its equal. $n, there is nothing else I can do. It is all up to you now. $B$BTake what you have earned and make wonders with it. Stylish, stylish wonders.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46696, 'enUS', 'Ah, the book! Let\'s see... blah, blah, blah, 3 heroes... blah, blah, blah, forge 3 hammers and create the ultimate hammer... blah, blah, blah, forger will be metaphorically crushed and possibly literally killed under impossible expectations, etc. Looks good! $B$BIt appears I can help you find what remains of the armor and weapons of these heroes and these incredible materials can be used to make amazing things!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46697, 'enUS', 'What a remarkable metal! I feel like it tingles just to hold it. Incredible!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46698, 'enUS', 'It is a powerful magic that kept the draconic slag hot so many years later. Is it the will of the Dragonhunter? Was dragon fire even more dangerous in ancient times? Or was it actually the dragon Neltharion, whom you know as Deathwing, whom she fought back then? $B$BI wonder if I shall ever find out. $B$BWell done! The hammer is extraordinary.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46699, 'enUS', 'The hammer is perfect but rather cold. I do respect your craftsmanship!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46700, 'enUS', 'That will be enough for our needs. Good work, $n!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46701, 'enUS', 'The Hammer is possibly the most perfect item you have ever forged. With this, you will create armor of such style and taste that you will become a figure of legends. $B$BI\'m proud of you, $n. I\'m so happy you will finally start to look good.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46705, 'enUS', 'Revenge is so sweet. Thank you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46719, 'enUS', 'Ah, Deathlord, you have returned.$B$BI have inscribed a series of frozen runes above Acherus. Once attuned, you will be able to communicate with the Lich King more... completely.$B$BHe will be able to show you things he could not before.$B$B<Amal\'thazad emits a horrible, rasping noise, that you can only assume is a chuckle.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46722, 'enUS', 'This is a catastrophe! Something must be wrong with my rabbit dimension!$B$BOkay, I\'m gonna need your help again.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46723, 'enUS', 'I can\'t believe a wolf got in my pocket dimension! That\'s the last time I order a crate of rabbits from Moonbrook!$B$BI owe you a solid, bud. Here, take my spare hat. Just don\'t go trying to muscle in on my Dalaran business, got it?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46724, 'enUS', 'You know, you\'re a useful fella to have around, $n. $B$BTell ya what, I think I\'ll accompany you on your adventures. Seems to be good gold in it, and I think it\'ll be a good way to scout out some new business opportunities around the Broken Isles.$B$BWhat do you say?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46725, 'enUS', 'I alwayss hated heightss. I\'m glad you\'re the one who has to do the dirty work.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46730, 'enUS', 'Our forces are assembled. We are ready to begin.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46732, 'enUS', 'Turalyon yet lives! Perhaps there is still hope after all.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46734, 'enUS', 'Mephistroth is on the run, and we have a foothold here at Deliverance Point.$B$BA good start, I\'d say, though we still have much to do.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46743, 'enUS', 'Champion, your help to our people has far exceeded any of our expectations, and has provided us some much needed breathing space.$B$BPlease, take these supplies to aid you in the war against the Legion. With your continued aid, we should be able to gather more and prepare them for you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46744, 'enUS', 'Excellent! Your artifact is as powerful as you can make it... for now.$B$BWe are working on a solution for that, but in the meantime you should continue your efforts on the Broken Shore.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46745, 'enUS', 'Prince Farondis has asked me to thank you for your continued efforts to aid our lands.$B$BPlease take these supplies as a token of our gratitude, and a promise of more to come, should you continue to help us.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46746, 'enUS', 'Greetings, little hero.$B$BThe mighty Odyn has proclaimed that you should receive these gifts of war. At every turn you continue to prove your valor and your efforts to aid the Valarjar have not gone unnoticed. $B$BFor the Valarjar! For Odyn! For $n!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46747, 'enUS', 'Hero! $B$BYour dedication to defending Val\'sharah has given us a much needed respite from the vile influence of the Legion. We were able to scavenge some supplies as a result of your efforts. $B$BHere, take them and know that, should you continue to aid us, we will set aside more rewards such as these as we find them.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46748, 'enUS', 'Outlander, I have some supplies for you. These goods are yours, earned by your continued efforts to our forces here in Suramar.$B$BI shall set aside similar treasures should you choose to aid our people more.$B$BYou have my deepest thanks.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46749, 'enUS', 'Your dedication to our efforts has yielded results. We have supplies for you.$B$BContinue your dedication and there will be more.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46765, 'enUS', 'This scroll, fascinating... this confirms our concerns about indirect Legion threats. We must return to Dalaran, $n!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46769, 'enUS', 'Fine work. It\'s important to keep powerful treasures out of demon hands.$B$BThere are more ways to undermine the Legion\'s agenda than simply killing demons... although there\'s a lot to be said for good old-fashioned violence.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46772, 'enUS', 'Our grand efforts have resulted in a boon which all can leverage in the coming days.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46773, 'enUS', 'Our grand efforts have resulted in a boon which all can leverage in the coming days.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46774, 'enUS', 'Our grand efforts have resulted in a boon which all can leverage in the coming days.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46777, 'enUS', 'Shadowblade, thanks to your efforts, our forces have been able to secure additional resources from the battlefield.$B$BThe more you continue to dominate the battlefield the more resources our forces can spare.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46778, 'enUS', 'Our power grows.', 0);
