INSERT INTO `quest_offer_reward_locale` VALUES (46791, 'enUS', 'Thank you for coming, Farseer.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46792, 'enUS', 'Now that the council is reunited, the plane of air shall flow as one again!$B$BI believe Windlord Thunderaan has a reward waiting for you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46794, 'enUS', 'Greetings Deathlord $n.$B$BFor some time now you have been a Paragon to our prince and to our people. Our gratitude goes beyond anything mere words can define.$B$BTake these trophies as a token of our gratitude and a share in the spoils of war. The more you aid us, the more we can provide you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46796, 'enUS', 'Greetings Huntmaster $n.$B$BFor some time now you have been a Paragon to our people. Our gratitude goes beyond anything mere words can define.$B$BTake these trophies as a token of our gratitude and a share in the spoils of war. The more you aid us, the more we can provide you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46797, 'enUS', 'Greetings Highlord $n.$B$BFor some time now you have been a Paragon to Nature and to our people. Our gratitude goes beyond anything mere words can define.$B$BTake these trophies as a token of our gratitude and a share in the spoils of war. The more you aid us, the more we can provide you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46798, 'enUS', 'Greetings Highlord $n.$B$BFor some time now you have been a Paragon to Odyn and a hero to the Valarjar. Our gratitude goes beyond anything mere words can define.$B$BTake these trophies as a token of our gratitude and a share in the spoils of war. The more you aid us, the more we can provide you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46799, 'enUS', 'Greetings outlander, liberator, Huntmaster, friend.$B$B.Our gratitude goes beyond anything mere words can define.$B$BTake these trophies as a token of our gratitude and a share in the spoils of war. The more you aid us, the more we can provide you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46800, 'enUS', 'Greetings Huntmaster.$B$BFor some time now you have been a Paragon in your efforts against the Legion and your aid of the Wardens. Our gratitude goes beyond anything mere words can define.$B$BTake these trophies as a token of our gratitude and a share in the spoils of war. The more you aid us, the more we can provide you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46802, 'enUS', 'Greetings, Deathlord.$B$BFor some time now you have been a paragon in your efforts against the Legion, the beacon that unites our armies together. Our gratitude goes beyond anything mere words can define.$B$BTake these trophies as a token of our gratitude and a share in the spoils of war. The more you aid us, the more we can provide you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46804, 'enUS', 'Glad I could share the Hammerbeard System of Style and Taste with you. Are you ready to work for your legacy in your chosen profession?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46805, 'enUS', 'When we faced the Deceiver, millennia of rage flooded my heart. Hatred took hold, blinding me to every thought but revenge.$B$BThankfully the Light helped me see that the future must not be defined by vengeance, but by hope. Your courage showed me that as well, $n.$B$BIn those last moments of Kil\'jaeden\'s life, I had to let go of the past. Not only for my own sake, but for the memory of my son.$B$BMy spirit and mind are clear and focused. Now we take the fight to Sargeras himself. Now we end the Legion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46809, 'enUS', 'What have you brought today, Deathlord?$B$B<Illanna examines the ancient tome.>$B$BThis book... it changes everything!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46810, 'enUS', 'If you find any other unwanted spoils of war, obliterate them at the forge and I can help you find something more desirable.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46813, 'enUS', '<A crack in the ice beneath the snow, it\'s very deep. You feel the unholy power surge within you, this would be the ideal location to unleash the energy to raise the dragon.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46815, 'enUS', 'It is as if the battle never ceased. How long have they suffered like this?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46816, 'enUS', 'Lothraxion is an old friend, and a noble warrior. We are fortunate to have him among us.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46818, 'enUS', 'The tide is turning. We must press forward.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46827, 'enUS', 'We\'ve been discussing your recent success, $n. We walk the shadows, and that often goes taken for granted. But without us, the Armies of Legionfall would have a great many more powerful demons to deal with.$B$BWe do not need the fame. We reap the rewards.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46832, 'enUS', 'Chambers sent you? He can down a tankard with the best of \'em, I\'ll give him that. But if he says I owe him anything, he\'s a liar!$B$BDon\'t you worry, my drakes and I will hold the point here. But more of this shore will need to be secured before your campaign can find victory.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46834, 'enUS', 'I cannot right every wrong that happened here, but this is a comfort nonetheless.$B$BThank you, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46839, 'enUS', 'So it begins.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46840, 'enUS', 'Hatuun\'s people will greatly appreciate what you\'ve done for them.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46841, 'enUS', 'Now that their lords have been reduced to ash, we may strike at the heart of their power.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46842, 'enUS', 'This victory is only the first link in a long chain, Archdruid.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46843, 'enUS', 'Our absence has wounded Arator. We knew it would. But we had to know that he was safe while we fought the Legion.$B$BNow that we are reunited, I will not let us be separated again.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46845, 'enUS', 'The Illidari don\'t waste time on congratulations. There is more to do, and you\'re the one to do it.$B$BGet a move on.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46904, 'enUS', 'Well done, I can now provide you with a boon that will grant you a benefit while the Command Center is activated.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46924, 'enUS', 'We must warn the Dreamgrove of what is happening.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46935, 'enUS', 'The Legion uses these beacons to communicate with their fleet up above. If we were to find more of these...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46938, 'enUS', 'Welcome to Argus, homeworld of the Burning Legion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (46941, 'enUS', 'The way forward is clear, and we have the Army of the Light at our side.', 0);
