INSERT INTO `quest_offer_reward_locale` VALUES (47043, 'enUS', 'So someone stole the Focusing Iris and you suspect Xylem might be the culprit? You may be right. $B$BIt is no secret that the archmage has been seeking artifacts of late. However, after the discovery of an ancient grimoire in the Legashi ruins, Xylem has become... unstable. I fear the grimoire may be stealing his mind.$B$BI can help you gain audience with the archmage. With any luck, you can reclaim the Iris peacefully.', 0);
