INSERT INTO `quest_offer_reward_locale` VALUES (47067, 'enUS', 'This tome is fascinating! It appears to seek out any and all knowledge that it does not already possess.$B$BI\'d wager an experienced researcher could direct it to locate specific knowledge.$B$BHmm, that gives me an idea...', 0);
