INSERT INTO `quest_offer_reward_locale` VALUES (47100, 'enUS', '<The broken peers suspiciously at his surroundings, avoiding eye contact with you.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47101, 'enUS', 'What is this... a sermon? Fascinating.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47102, 'enUS', 'You\'ve found one of our scouting reports? It was overdue, and I feared it had been intercepted by the enemy.$B$B<The captain looks over the letter.>$B$BYes, this is what I\'ve been expecting. The Legion is planning something and this is the breakthrough we\'ve been looking for!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47104, 'enUS', 'High Inquisitor Raalgar? A fearsome creature but he has been held securely in the Arcatraz at Tempest Keep for a very long time. $B$BIf the Legion plans to free him then they must know that he is particularly dangerous to us.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47112, 'enUS', 'Thank you, $n. A peaceful rest is all we have to offer those who have made the ultimate sacrifice for the Alliance... for Azeroth.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47114, 'enUS', 'Were you able to overcome the Tomb of Sargeras?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47115, 'enUS', 'Were you able to overcome the Tomb of Sargeras?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47116, 'enUS', 'Were you able to overcome the Tomb of Sargeras?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47117, 'enUS', 'Were you able to overcome the Tomb of Sargeras?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47118, 'enUS', 'Were you able to overcome the Tomb of Sargeras?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47119, 'enUS', 'Were you able to overcome the Tomb of Sargeras?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47120, 'enUS', 'Were you able to overcome the Tomb of Sargeras?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47121, 'enUS', 'Were you able to overcome the Tomb of Sargeras?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47122, 'enUS', 'Were you able to overcome the Tomb of Sargeras?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47123, 'enUS', 'Were you able to overcome the Tomb of Sargeras?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47124, 'enUS', 'Were you able to overcome the Tomb of Sargeras?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47125, 'enUS', 'Were you able to overcome the Tomb of Sargeras?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47126, 'enUS', 'Were you able to overcome the Tomb of Sargeras?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47127, 'enUS', 'Were you able to overcome the Tomb of Sargeras?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47128, 'enUS', 'Were you able to overcome the Tomb of Sargeras?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47129, 'enUS', 'Were you able to overcome the Tomb of Sargeras?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47134, 'enUS', 'You did your best, $n, but the demons won this round.$B$BIt won\'t take Raalgar long to gather his power to attack us. But I have learned the source of his immortality while you were gone!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47137, 'enUS', 'Another powerful ally recruited to our cause!$B$BYou have bolstered our strength against the Legion once more, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47139, 'enUS', 'Even the mightiest demons unleashed by the Sentinax have fallen before you.$B$BGood. The Legion will be driven from our world, no matter what it takes.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47148, 'enUS', 'Even I didn\'t see that coming.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47180, 'enUS', 'I can feel the Void\'s influence retreating. Perhaps now we can find out what happened here.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47182, 'enUS', 'You are a true hero, $n. Even though the demons freed Raalgar and thought him immortal, he was no match for you! Perhaps the Fel Heart will be of use to you. It is now available in the Matrix Core.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47183, 'enUS', 'I should have seen this coming.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47184, 'enUS', 'As I said, the Void\'s influence is rarely peaceful. We must press on.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47202, 'enUS', '<Velen listens closely to your words as you tell him of King Anduin\'s plan.>$B$BThe Broken Shore is a dangerous place... far too dangerous to travel alone. But perhaps this journey is necessary for Anduin to find peace.$B$BWhen the moment is right, I\'ll inform King Greymane of Anduin\'s departure. Until then, go and see that Anduin is not alone on the Broken Shore. I trust that you will return him safely.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47203, 'enUS', '<Alleria seems momentarily speechless.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47217, 'enUS', 'We buy time but nothing more.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47218, 'enUS', 'It is good to know we can share a common goal. Perhaps I will find some use for your kind yet.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47219, 'enUS', '<Alleria takes the heart in her hands.>$B$BThis is the next step, $n. Thank you for bringing me to this point.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47220, 'enUS', 'What is it you bring, $n?$B$B$B$BIntriguing...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47221, 'enUS', 'I\'m glad you were among those called for the expedition to Argus. There will be plenty of fighting ahead.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47222, 'enUS', 'May the Light protect us all this day.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47223, 'enUS', 'Thank the Light you have arrived.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47224, 'enUS', 'I have waited many years for this day.$B$BBehold the triumph of the draenei, the Vindicaar!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47238, 'enUS', 'This is grave news indeed. It would be wise to follow Alleria\'s lead from here.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47251, 'enUS', '$n, you\'re here. You must have received my letter.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47252, 'enUS', '$n, you\'re here. You must have received my letter.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47253, 'enUS', 'Let us use this moment to reflect upon the past, lest we forget the lessons it teaches us, and doom ourselves to repeat it once more.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47254, 'enUS', 'Let us use this moment to reflect upon the past, lest we forget the lessons it teaches us, and doom ourselves to repeat it once more.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47287, 'enUS', 'Light\'s Judgment will now fire on your command when you use the Matrix Uplink. $B$BPerhaps you will find more objects that we can link into the Matrix on your travels. I have routed enough energy to that part of the Core to handle anything that you can link into it. $B$BGo well, my friend.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47330, 'enUS', 'This warning is an ill omen indeed, $n. It seems the fate of Azeroth is tied to that of Argus, the homeworld of the Legion.$B$BWe must uncover the Dark Titan\'s plan! I believe the Speaker\'s connection to the world soul will prove crucial to our efforts.$B$BStay vigilant, Huntmaster. We must trust in Magni\'s guidance... and Azeroth\'s as well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47416, 'enUS', 'I worried for L\'ura, but this is... unthinkable.$B$BHow she must have suffered...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47430, 'enUS', '<Makkaw seems very pleased about what you have learned.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47431, 'enUS', 'We\'ve secured a foothold. Good.$B$BNow we take the fight to them!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47473, 'enUS', '<Turalyon listens in grim silence.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47508, 'enUS', 'We may be grounded, but that does not mean they have to rule the skies!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47523, 'enUS', 'What\'s this, $n?$B$B$B$B$B$BThese are the plans for the raid on Mardum, were we too late?$B$BWhat\'s strange, is the new plan seems better than the original! It\'s unlikely this is the Legion\'s doing, Illidan surely would have detected any fel manipulation. So if not the Legion, who is behind this?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47526, 'enUS', '<The panel is now pulsing a soft golden glow. According to Romuul, activating it should teleport the cannon to the Vindicaar.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47541, 'enUS', 'You fought well. The Light shines brighter, thanks to your efforts.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47543, 'enUS', 'That didn\'t go so great, did it? Maybe next time.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47545, 'enUS', 'I guess we have plenty of leads to follow up on.$B$BWow, whoever wants to kill me really thought this through!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47550, 'enUS', 'Fifteen minutes isn\'t a whole lot of time. We\'re going to have to move quickly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47554, 'enUS', 'Skara and Brae gave their lives to get us this information and the codebook. Their sacrifice will not be forgotten.$B$BNow, let us decipher the orders and see what the Legion is up to.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47557, 'enUS', 'Yeeeeeowch! It\'s hot! What could it possibly... oh, yeah, that makes sense.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47558, 'enUS', 'A chronoshard, you say? I know what to do with those.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47559, 'enUS', 'Hand over that chronoshard, $n. If you don\'t mind.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47560, 'enUS', 'I hate when they get all chilly like this.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47589, 'enUS', 'We may yet stand a chance.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47591, 'enUS', 'See, I told ya it be a great idea!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47592, 'enUS', 'Ooh, ooh, lemme see!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47594, 'enUS', 'Dis be da best day. I\'m going ta fleece dat Baron so hard his eyes be covered in more wool than a flock of sheep.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47595, 'enUS', 'Be you sure ya wanna do dis? I got other wares that be much more interestin\' and next week I be needin\' more of these.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47603, 'enUS', 'You really don\'t see it? I can sense the magic in their pockets!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47604, 'enUS', 'Fantastic, simply fantastic. This will be a profitable partnership, my puny associate.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47605, 'enUS', 'I entrust you with my lamp. May our partnership be fruitful.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47606, 'enUS', 'Yes, yes, YES! Do you see the power radiating from the lamp? I can sense objects of great power that were concealed even from my mighty eyes.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47607, 'enUS', 'You\'ve done it! My lamp has never shone brighter. I shall continue to grant you coins, but I shall have to find new uses for the magic you provide.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47627, 'enUS', 'It seems we underestimated the Legion\'s cunning.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47641, 'enUS', 'This must be it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47642, 'enUS', 'I think this is the spot.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47643, 'enUS', 'Based on the clues the ancients gave us, this must be the spot. It HAS to be!$B$BLet\'s do this, $n!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47644, 'enUS', 'I\'m not a big fan of dreadlords, but I think you and I can handle one if we stick together. You ready, $n?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47645, 'enUS', 'I sense something... bad.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47652, 'enUS', 'Light be praised! This was a dark day, and many lives were lost. $B$BBut the Army endures. The Light Mother\'s prophecy will be fulfilled.$B$BAll is as it was meant to be.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47653, 'enUS', 'The Army endures. The Light Mother\'s prophecy will be fulfilled.$B$BAll is as it was meant to be.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47654, 'enUS', 'It is done. My heart mourns the loss of L\'ura, but at least you brought her peace.$B$BOnce the Crown is in place, the Vindicaar will stand against the Legion\'s vile assault. Antorus will fall!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47663, 'enUS', 'Oh, is it time?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47685, 'enUS', 'Oh. You were successful.$B$BSurprising.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47686, 'enUS', 'This place has its share of secrets. Thankfully, I know enough of them to get us started.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47687, 'enUS', 'I must admit, I am impressed.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47688, 'enUS', 'I had not imagined the final product to be so... sticky.$B$B<Y\'mera wipes her hands on her robes.>$B$BIt will do.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47689, 'enUS', 'You may be worthy of the Conservatory\'s secrets, if you survive that long.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47690, 'enUS', 'I have never felt power like this before...$B$B<Y\'mera handles the shard cautiously.>$B$BWe should get this to Velen as soon as we can.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47691, 'enUS', 'You came upon me in a moment of reflection.$B$B<Velen peers at you with a tired expression.>$B$BThere is no time for such sentiment. We must press on.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47709, 'enUS', 'One small step for $n, one giant leap for gnomekind!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47725, 'enUS', 'With the remnants of this seal, we can dispel the wards and enter my sanctum.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47726, 'enUS', 'With the remnants of this seal, we can dispel the wards and enter my sanctum.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47727, 'enUS', 'With the remnants of this seal, we can dispel the wards and enter my sanctum.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47743, 'enUS', 'I did not expect this of Xe\'ra. Nor could I have foreseen Illidan\'s reaction.$B$BWe must ensure these events do not crush the spirits of our allies.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47744, 'enUS', 'The smoke and the meat are for me. The flowers, on the other hand, are for the kids at the orphanage down the street.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47745, 'enUS', 'These are from Emery, I assume?$B$B<Meliana blushes.>$B$BThat dummy. Gotta admire his persistence, though...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47746, 'enUS', 'I don\'t know how long we\'ll need to stay holed up in the orphanage, but there\'s no way I\'m letting the kids out while our prince walks the streets like some sort of madman.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47747, 'enUS', 'This\'ll do, $C.$B$BTake this key. You\'ve earned it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47750, 'enUS', 'From the kids, you say?$B$B<Emery struggles to conceal a smile as he pockets the jerky.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47754, 'enUS', 'Excellent. The path is clear.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47771, 'enUS', 'We\'re under too much pressure here. And it\'s so close to us...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47772, 'enUS', 'You did it! Now hurry along... if I remember this correctly, you don\'t have much time left!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47773, 'enUS', 'You did it! Now hurry along... if I remember this correctly, you don\'t have much time left!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47790, 'enUS', 'I\'ve managed to stabilize the mixture without diminishing its potency. No simple task, mind you, and I do hope you will appreciate the hard work it took to get this far.$B$BI feel a great sense of unease regarding what might have been the source of this disruption. One would have expected that releasing Aman\'thul\'s power would bring harmony, not chaos.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47791, 'enUS', 'Maddening! I am no closer to a breakthrough on this matter. Such a failure is unacceptable!$B$B<Vridiel breathes deeply and composes himself.>$B$BThank you, $n. I must not let this setback deter me from further attempts. Please, take this. You will no doubt find a use for it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47793, 'enUS', 'This is worrisome. Gul\'dan\'s defeat may have disrupted forces far more fundamental than anyone realized. $B$BHmm... perhaps we can turn that to our advantage.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47807, 'enUS', 'It was a dreadlord? That\'s... unusual. I mean, I know we\'re in Northrend and everything, so risen skeletons aren\'t all that rare, but demons?$B$BOh well! Thanks for taking the time to calm my worries.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47808, 'enUS', 'You have my thanks, $R.$B$BI know that you are here today in service to the Bronze Dragonflight. Perhaps this gift will aid you in your journeys.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47809, 'enUS', 'Your assistance is appreciated.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47810, 'enUS', 'With your assistance, the ancients have fallen back into their restful slumber. Thank you, $R.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47835, 'enUS', 'I knew you would be among those called to fight. It will be an honor to fight by your side.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47851, 'enUS', 'A simple exchange with complex results. That\'s the art of doing business.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47853, 'enUS', '<Velen stares at the shattered statue before him and says nothing.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47854, 'enUS', 'If I have learned anything about the Legion, it is that we have no other option but to fight back.$B$BIt was a pleasure to have you at my side.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47855, 'enUS', '<Prophet Velen peers solemnly at you.>$B$BThank you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47856, 'enUS', 'It is done. This one wrong, of many, is finally set to rights.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47864, 'enUS', 'A simple exchange with complex results. That\'s the art of doing business.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47865, 'enUS', 'A simple exchange with complex results. That\'s the art of doing business.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47867, 'enUS', 'May the Light protect us all this day.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47882, 'enUS', 'Yes, excellent. The conduits are back online.$B$BThe construct however is proving a little more difficult to awaken than I had hoped.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47883, 'enUS', 'Prepare yourself, stranger.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47889, 'enUS', 'Thank ye fer joinin\' me, lad. There\'s somethin\' ye have to see.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47890, 'enUS', 'I don\'t know how Sargeras managed to raise Aggramar, but it\'s bad news for us, believe you me.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47891, 'enUS', 'What did Magni have to show you?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47892, 'enUS', 'If we do not act quickly, the demons stationed here are more than enough to overwhelm us.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47895, 'enUS', 'I\'m going to have to go back to the drawing board!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47904, 'enUS', 'We\'ve stopped all four attacks from the dragonshrines - but the timelines are still incorrect. I\'m still being assassinated, elsewhere, at the same time.$B$BLooks like our work isn\'t done yet, $n!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47906, 'enUS', 'We\'ve done it! The timelines are exactly as they\'re supposed to be again. With me, alive.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47967, 'enUS', 'With these new steeds our forces stand a chance.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47986, 'enUS', 'Perfect! Thank you, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47987, 'enUS', 'Thank you, $n. Your actions deny the Legion power and grant the dead the peace they deserve.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47988, 'enUS', 'Now that their forces are in disarray, let us proceed.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47989, 'enUS', 'Impressive. Without the shivarra bolstering their strength we just might stand a chance.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47990, 'enUS', 'Yes! This is it!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47991, 'enUS', 'No war is won by a single act, but without the spires protecting them the rest of the hold will fall as well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47992, 'enUS', 'Well fought! Now for the commander.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47993, 'enUS', 'By the Light...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47994, 'enUS', 'Now that it has been thoroughly tested, I will direct our artificers to energize the warframe once more so that you may call it into battle. If you wish, you may select it at the Matrix Core at your leisure.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (47995, 'enUS', 'Fareeya\'s forces are the best the Army of the Light has to offer. Our mission is that much more likely to succeed with them at our side.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48002, 'enUS', 'You\'ve found some! These will certainly be enough to get us by for a good while longer.$B$BAs promised, here is a recipe for one of the potions I brew to help in our fight against the Legion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48013, 'enUS', 'You\'re an honorable ally, $n. Thank you for helping us.$B$BAs promised, here is the recipe for the potion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48016, 'enUS', 'And there you have it! I believe this will be far more useful for you in your fight against the Legion.$B$BAllow me to explain how it\'s done...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48021, 'enUS', 'Despite her troubles, this has been a welcome reminder that, although our battle with the Legion remains at the forefront of our concerns, the rest of the world does not simply wait for us.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48027, 'enUS', 'So you were trying to gather astral glory I see. Yes, there is a method to doing it correctly.$B$BThe flower has a power to it, allowing it to protect itself from anything it thinks may seek to destroy it. If it feels truly threatened, it extinguishes itself.$B$BYou mustn\'t try to pick it with intent to harm, but to protect. It\'s an unfortunate irony as we eventually destroy it in the process of making items with it.$B$BHowever, this deception is necessary for it to yield itself to you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48028, 'enUS', 'Indeed, the newer blooms are particularly stubborn and would rather give up their life than live in servitude to those who pick them.$B$BTo handle the herb in this form, one must coax the herb into submitting, as it can\'t quite fully read the intentions of those who wish to gather it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48029, 'enUS', 'I see the glory has come to trust you fully. It is now exposing its heart to you.$B$BFocus your intentions here and you will gather it in its entirety.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48034, 'enUS', 'Empyrium requires a precise strike to yield the best results. Aim your pick at the brightest bits of the ore, which also happen to be very small, hence the precision.$B$BThis will break the deposit apart faster and you\'ll be able to harvest ore quicker.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48035, 'enUS', 'As I mentioned before, precision is key with mining empyrium. You\'ve learned to strike at the correct spots, now you must learn to strike at the correct angle.$B$BTake out your pick and I\'ll show you what I mean...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48036, 'enUS', 'You\'ve learned where to strike and at what angle to strike, but should you wish to leave the core intact to mine, you must finally learn how hard to strike.$B$BThe fractures you found in this core are the result of striking the ore too hard. As I\'m sure you no doubt know by now, mining empyrium is not just a task, but an art.$B$BCome, let us practice your swing until it\'s just right.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48037, 'enUS', 'Empyrium is quite a sight to behold once it\'s been mined. And while the deposits of this ore require precision, the seams require exposure.$B$BIf you spend some time picking away the surrounding rock, you\'ll find much more ore to harvest.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48038, 'enUS', 'Empyrium seams can be tricky in that regard. The ore is very good at interweaving itself into the surrounding elements.$B$BI\'ve found that striking those areas with the shaft of the pick loosens the empyrium\'s grip on it, so that when you pick at it, the rock should just fall away.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48039, 'enUS', 'Much like the deposit, empyrium requires a balanced extraction. Its core is its most fragile section.$B$BIf you swing too hard, it breaks, too soft and you\'ll be there forever. The same is true for loosening it from its surrounding rock.$B$BHere, let me show you a method which balances both.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48040, 'enUS', 'If you haven\'t already guessed, the key to skinning these creatures properly is speed. They\'re born of foul energies and those spill out once you begin to cut into the corpse.$B$BI would suggest training your hand to become faster at removing the hide.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48041, 'enUS', 'So you\'ve become faster, but you\'re still thinking in your old ways.$B$BInstead of cutting away small pieces at a time, try making one large cut and removing as much of the hide in as few cuts as possible. Move away from the corpse and begin cutting the large pieces into smaller, usable pieces.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48042, 'enUS', 'So it\'s just more teeth and claws you\'re after? This should be simple to explain then.$B$BThe teeth receive the greatest exposure to the creature\'s foul insides, so removing them first will still give you time to dissect the rest of the beast. Next, remove the hide. And lastly the claws, as those take the longest to take on any corruption.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48053, 'enUS', 'Whaddya got for me?$B$BMore felslate, fantastic! This stuff weighs a ton, and is perfect for anchors.$B$BI see you have the arms of a blacksmith. Perhaps you\'d like ta have a hand at making a few anchors as well, eh?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48054, 'enUS', 'More felslate, fantastic! This stuff weighs a ton, and is perfect for anchors.$B$BI see you have the arms of a blacksmith. Perhaps you\'d like to have a hand at making a few anchors as well, eh?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48055, 'enUS', 'This is quality work. It appears you even solved an issue I was having with the spacing between the front and back chest plates.$B$BYou wouldn\'t mind if I kept this, would you? A fair trade for the recipe, yes?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48056, 'enUS', 'That last jump looked about what I had in mind for how the gravity was gonna be.$B$B<Hobart scribbles some notes on the schematic.>$B$BAnd there ya have it. They\'ll only last ya a few minutes before they\'re spent, so use \'em wisely.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48065, 'enUS', 'Oh, this is great stuff. That\'s some landscape up there! Let me just get this information written down...$B$B<Didi begins to scribble some notes on some blueprint paper.>$B$BThat should do it. As with all generators, you\'ll need to use local materials for it, so whatever you can find on that planet should work.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48066, 'enUS', 'Welcome, $n.$B$BMayla speaks of you as a trusted ally. Your presence will surely help convince her of the merits of joining the Horde.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48067, 'enUS', 'The Old Gods are known for subversion and duplicity. To attack so brazenly...$B$BWhatever they seek, they want it badly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48069, 'enUS', '$n, you came at the perfect time. I just finished creating this Ionized Geographical Recorder.$B$BNow, here\'s how you\'re gonna use it...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48074, 'enUS', 'You have no idea the time you\'ve just saved me, $n. You have my utmost gratitude.$B$BAnd as promised, here is my most coveted design.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48075, 'enUS', 'My book! And it doesn\'t appear to be damaged either, thank the Light.$B$BLook here, $n.$B$B$B$BHere are the designs for turning those gems into accessories of power.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48076, 'enUS', 'Excellent work, $n. Now, onto the different combinations...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48078, 'enUS', 'An interesting balance, but necessary. You may keep the oil, I have plenty.$B$BOh, and now that you know how to purify the leather, let me show you how to use it. Here are some shoulder patterns my allies ask for regularly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48079, 'enUS', 'Ebonhorn has spoken of ancient wards that must be maintained in Highmountain. Wards that hold back a great darkness.$B$BThis may be tied to the evil that grips him now.$B$BWe must hope that Spiritwalker Graysky can tell us more.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48081, 'enUS', '<Velen\'s gaze is drawn to the ruins spread out before him.>$B$BI am home.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48107, 'enUS', 'We are that much closer to restoring the Crown of the Triumvirate to its former glory.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48185, 'enUS', 'The next ward is nearby. I can sense it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48190, 'enUS', 'Do you sense it, $n? Such strength... such courage.$B$BThe echo of Huln Highmountain\'s spirit is all around us.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48199, 'enUS', 'I never imagined such destruction... such horror.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48200, 'enUS', 'Good. From here we can quickly access and reinforce each of the encampments.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48201, 'enUS', 'We have a foothold here... for now.$B$BI am unsure how long it could hold out against a sustained assault.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48202, 'enUS', 'So many demons. So much work to do.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48203, 'enUS', 'After so many years... so many sacrifices... victory is finally within our grasp.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48230, 'enUS', '<Fareeya examines the crystal fragment.>$B$BThis is old... very old. It is a piece of an elaborate key, the sort my people use to secure our most prized and sacred places.$B$BI wonder...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48231, 'enUS', 'The Armor of the Triumvirate! I never believed I would see it again. It is a reminder of our proud history, one which the evil of the Legion will never overshadow.$B$BGaal told me of your dedication, $n. It is fitting that you don this armor. May it serve as a beacon of the Light in these dark times.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48261, 'enUS', 'Ah, yes. Combined, these clusters should provide just enough power for me to fuse the key fragments back together.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48271, 'enUS', 'Nice work, Huntmaster. Those ethereals stood no chance against you.$B$BNow that we have the fragments, I can prepare them for reforging.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48272, 'enUS', 'The Pantheon has been dead for thousands of years... I fear this plan has been in the works for a very, very long time.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48273, 'enUS', 'Thank ye fer joinin\' me, lad. There\'s somethin\' ye have to see.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48277, 'enUS', 'Ye came just in the nick of time.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48280, 'enUS', 'Our answer lies in the Legion\'s own portal network in the heart of Antorus.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48288, 'enUS', 'Did you triumph in Antorus?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48292, 'enUS', 'Did you triumph in Antorus?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48293, 'enUS', 'Did you triumph in Antorus?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48294, 'enUS', 'Did you triumph in Antorus?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48295, 'enUS', 'Did you triumph in Antorus?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48296, 'enUS', 'Did you triumph in Antorus?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48297, 'enUS', 'Did you triumph in Antorus?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48298, 'enUS', 'Did you triumph in Antorus?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48299, 'enUS', 'Did you triumph in Antorus?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48300, 'enUS', 'Did you triumph in Antorus?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48301, 'enUS', 'Did you triumph in Antorus?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48302, 'enUS', 'Did you triumph in Antorus?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48303, 'enUS', 'Did you triumph in Antorus?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48304, 'enUS', 'Did you triumph in Antorus?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48305, 'enUS', 'Did you triumph in Antorus?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48306, 'enUS', 'Did you triumph in Antorus?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48318, 'enUS', 'Thank you for assisting us, alchemist. We needed these potions badly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48323, 'enUS', 'Thank you for assisting us, alchemist. We needed these potions badly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48337, 'enUS', 'Thank you for assisting us, herbalist. We needed this astral glory badly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48338, 'enUS', 'Thank you for assisting us, $C. We needed this astral glory badly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48344, 'enUS', 'There is no room for error here, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48345, 'enUS', '<Velen does not seem to notice your presence.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48349, 'enUS', 'Thank you for assisting us, miner. We needed this empyrium badly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48358, 'enUS', 'Thank you for assisting us, $C. We needed this empyrium badly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48359, 'enUS', 'Thank you for assisting us, skinner. We needed this fiendish leather badly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48360, 'enUS', 'Thank you for assisting us, $C. We needed this fiendish leather badly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48363, 'enUS', 'Thank you for assisting us, jewelcrafter. We needed these florid malachites badly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48364, 'enUS', 'Thank you for assisting us, jewelcrafter. We needed this hesselian badly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48373, 'enUS', 'Thank you for assisting us, tailor. We needed this lightweave cloth badly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48374, 'enUS', 'Thank you for assisting us, $C. We needed this lightweave cloth badly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48375, 'enUS', '<As Caelen takes the Sargerite, you see him fusing it with the Obliterum near the forge. The power radiating from it is quite impressive.>$B$BHere you are, lad. Say, ya don\'t think this stuff is toxic, right?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48376, 'enUS', '<As Caelen takes the stack of Sargerite, you see him fusing it with the stack of Obliterum near the forge. The power radiating from it is quite impressive.>$B$BHere you are, lad. Say, ya don\'t think this stuff is toxic, right?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48403, 'enUS', 'I cannot put into words how much you have done for us this day, or how grateful I am to have you as an ally.$B$BYou have our thanks, hero. You have MY thanks.$B$BI owe you a great debt for this.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48433, 'enUS', 'It seems we have secured a new ally. You have done well.$B$BThe Highmountain tauren are famed for their prowess in battle. I look forward to the pummeling they will unleash upon the Alliance.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48434, 'enUS', 'I am myself again, $n.$B$BYou and Graysky have freed me from the grasp of the Old Gods. Had I remained in that state for much longer, I would have been lost.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48440, 'enUS', 'We must act quickly!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48441, 'enUS', 'You have recovered our supplies. As promised, we will aid your forces on Argus.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48442, 'enUS', 'Soon, the krokul will raid Nath\'raxas Hold. My people are anxious to begin.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48443, 'enUS', 'We were a great civilization, once. But, now?... Thank you, $n. Our combined forces freed many from Nath\'raxas. With fewer slaves, and the Army of the Light on their doorstep, the Legion\'s influence over this region will be greatly diminished.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48445, 'enUS', 'Your champions discovered someone living in a cave beneath Oranaar. He is hiding from the Void-Touched, and he appears lucid.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48446, 'enUS', 'The voidcallers roaming the Shadowguard Incursion must be extinguished. Your people are sufficiently armed for the coming encounter.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48447, 'enUS', 'With L\'ura defeated, and the voidcallers eliminated, the Shadowguard\'s dominance over the city has been crippled. if our campaign against the Legion is successful, there could be a future for the creatures living here.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48448, 'enUS', 'Three Legion facilities decimated in a single operation. Extraordinary.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48453, 'enUS', 'You\'ve been a great asset to my wranglers here. Please take this as a token of our gratitude.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48455, 'enUS', 'Keeping balance within the forest ensures its longevity.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48460, 'enUS', 'I fear the forest may be lost.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48461, 'enUS', 'So many Legion worlds are ripe for the taking...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48483, 'enUS', 'A cowled figure... and it did not attack you?$B$BMost curious.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48500, 'enUS', 'Are you ready to continue on our journey?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48506, 'enUS', 'I\'m glad you were among those called for the expedition to Argus. There will be plenty of fighting ahead.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48507, 'enUS', 'I knew you would be among those called to fight. It will be an honor to fight by your side.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48513, 'enUS', 'The Legion\'s defeat is at hand.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48542, 'enUS', 'You\'ve been a great asset to my wranglers here. Please take this as a token of our gratitude.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48544, 'enUS', 'The Wranglers are essential for our survival here. Any assistance you have given them must be repaid.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48559, 'enUS', 'An important first step, $n.$B$BIf we can bring balance to the Netherlight Crucible, I believe it will make your weapon even more powerful.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48560, 'enUS', 'Ah, yes. Balance is key, just as the Prophet said.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48600, 'enUS', 'One step closer to defeating the Legion.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48601, 'enUS', 'There\'s nothing more beautiful than a lightburst charge erupting in a Legion stronghold. Your people afforded themselves well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48605, 'enUS', 'Their commanders fall before us!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48634, 'enUS', 'You must value our aid greatly, to part with such a bounty.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48635, 'enUS', 'I am humbled by your generosity.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48636, 'enUS', 'Another lightforged to fight alongside your forces.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48639, 'enUS', 'The Army of the Light thanks you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48641, 'enUS', 'The Armies of Legionfall thank you, mate.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48642, 'enUS', 'The Argussian Reach thank you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48654, 'enUS', 'I told the others; I will not abandon my people. I must remain here, but maybe you can help? I have discovered a way to purge the shadow from the void-addled.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48668, 'enUS', 'This beacon will be added to the Navigation Console.$B$BA contingent of the Army of the Light will remain to hold this location for future use.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48799, 'enUS', 'A good start, hero. There is plenty more where that came from.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48803, 'enUS', 'Success! It is nice to know I haven\'t lost my touch.$B$BHere you go, $n; it is as good as new.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48864, 'enUS', 'I am glad to hear Fareeya is well.$B$BShe is right... this is a fragment of the armory key I forged her so long ago.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48910, 'enUS', 'What say you, offworlder?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48911, 'enUS', 'Another soul freed from the cruelty of the void.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48912, 'enUS', 'A lightforged soldier can wade through a sea of demons. They will serve you well.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48929, 'enUS', '<Turalyon listens in grim silence.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48954, 'enUS', 'Champion, you have returned... and not a moment too soon.$B$BThe object you hold in your hands is but one of many mysteries unfolding before us.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48962, 'enUS', 'Former blood elves willing to pledge to our cause. This is better than I dared hope.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48965, 'enUS', '<Caleb\'s body is lifeless, still warm. His wounds claimed him while you were gone.$B$BHis face seems content, as though he knew you would finish the job.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48973, 'enUS', 'Greetings, $n.$B$BLong have we awaited this day. Argus was all but lost, its true denizens forced to remain hidden lest we perish. Your efforts on our behalf have allowed us to once again live free from fear. Please accept these trophies as a symbol of our gratitude.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48974, 'enUS', 'Krona ki cristorr, champion!$B$BYour presence among the Army of the Light has been a singular boon to our cause. Gratitude is not all that we may offer. Please accept these trophies as a tribute to your unwavering support.$B$BTogether we will bring about the Legion\'s end.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48976, 'enUS', 'Highlord, thanks to your efforts, our forces have been able to secure additional resources from the battlefield.$B$BThe more you continue to dominate the battlefield the more resources our forces can spare.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (48977, 'enUS', 'Archenon poros, champion.$B$BThe Army of the Light wishes to thank you for your aid against the Legion\'s forces on Argus.$B$BPlease accept these supplies with our gratitude. Your continued support brings us ever closer to our ultimate goal of eradicating the Legion once and for all.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49014, 'enUS', 'After so many years... so many sacrifices... victory is finally within our grasp.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49015, 'enUS', 'It is finished. At long last, the Burning Crusade is over.$B$BI thank you for all you did, $n. With the power of Argus feeding his Dark Pantheon, Sargeras would have been unstoppable.$B$BOn behalf of the draenei, the eredar, the countless worlds destroyed by the Legion...$B$BThank you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49032, 'enUS', 'Magnificent work!$B$BOnce these runes are integrated into our shielding matrix, the Vindicaar will be able to bypass the Burning Throne\'s defenses and strike directly at the felworks.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49075, 'enUS', 'Magnificent work!$B$BOnce these runes are integrated into our shielding matrix, the Vindicaar will be able to bypass the Burning Throne\'s defenses and strike directly at the felworks.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49076, 'enUS', 'Magnificent work!$B$BOnce these runes are integrated into our shielding matrix, the Vindicaar will be able to bypass the Burning Throne\'s defenses and strike directly at the felworks.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49133, 'enUS', 'With these sigils, the Vindicaar can bypass the Burning Throne\'s defenses.$B$BThe time has come to press our advantage and end this war.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49134, 'enUS', 'With these sigils, the Vindicaar can bypass the Burning Throne\'s defenses.$B$BThe time has come to press our advantage and end this war.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49135, 'enUS', 'With these sigils, the Vindicaar can bypass the Burning Throne\'s defenses.$B$BThe time has come to press our advantage and end this war.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49143, 'enUS', 'Ah yes, I sense the Light within these fragments. Do not lose hope, $n!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49224, 'enUS', 'As your weapon increases in strength we will be able to infuse it with even greater power, but its new strength should be more than enough for now.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49266, 'enUS', 'T\'paartos is... enthusiastic. He means well, and he has a fire within him that few even among the Lightforged possess. Thank you for keeping him safe, $R.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49293, 'enUS', 'The Legion\'s defeat is at hand.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49354, 'enUS', 'That was not wholly expected.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49445, 'enUS', 'As you\'ve no doubt learned, Primal Sargerite is a precious material which yields great power when infused with items. In our fight against the Legion, we need all the power we can get our hands on.$B$BBring me any Primal Sargerite you find and I will trade with you what I can.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49472, 'enUS', 'The changes this substance has undergone since the Vindicaar departed for Argus are alarming.$B$BWhat will the outcome mean for Azeroth? I fear this to be an ill omen, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49473, 'enUS', 'Take this. May it aid your efforts to stop the Legion... and to save our world.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49474, 'enUS', 'The Betrayer lives up to his name once more.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49532, 'enUS', 'Welcome to the battlefield, grunt!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49533, 'enUS', 'Ah, $n, you have arrived!$B$BLet\'s get to work.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49534, 'enUS', 'Death and acts of sacrilege pervert this land.$B$B<Lantinga lets out a drawn-out sigh.>$B$BThankfully, we\'re here to stop it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49535, 'enUS', 'I am glad you\'re here, $R. Hemet has not been heard from for quite some time, and I could really use your help finding him.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49536, 'enUS', 'Yo! Do I have an explosive proposition for you, pal....', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49537, 'enUS', 'The Warsong Offensive is ready to strike at the heart of the Scourge, $C. Are you up to the challenge?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49538, 'enUS', 'Lok\'tar ogar, $n. You\'ve arrived not a moment too soon....', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49539, 'enUS', 'You seem like someone who needs some excitement in their life. Excitement... and beer!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49540, 'enUS', 'What the dook is going on here, $R?!$B$BWhy are pandaren so sad?!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49541, 'enUS', 'Traveling to Kun-Lai? Right this way, wanderer, right this way!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49542, 'enUS', 'Welcome to Townlong Steppes, outsider.$B$BIf you insist on wandering in to the darkest places of Pandaria then far be it from me to not put you to good use.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49543, 'enUS', 'A volunteer for Dread Wastes duty? I think you might be the first.$B$BPleased to meet you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49545, 'enUS', 'I am glad to see you are well after Tanaan Jungle.$B$BWe have much to do.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49546, 'enUS', 'Gorgrond is no place for armies. We are now stepping into the domain of legends.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49547, 'enUS', 'It is good to see you, Commander $n. I require your advisement.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49548, 'enUS', '<Azik looks you up and down.>$B$BAzik is betting you are someone of importance to your people.$B$BCome closer, friend. Azik could use your help.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49549, 'enUS', 'They came at us... from... nowhere.$B$B<The stone guard nearly passes out.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49550, 'enUS', 'We\'re gettin\' hammered out here, lad.$B$BI hope you\'re here to help.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49551, 'enUS', 'What is it?!$B$BCan\'t you see I\'m already busy trying to get this port ready, $R?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49552, 'enUS', 'Death and acts of sacrilege pervert this land.$B$B<Lantinga lets out a drawn-out sigh.>$B$BThankfully, we\'re here to stop it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49553, 'enUS', 'I am glad you\'re here, $R. Hemet has not been heard from for quite some time, and I could really use your help finding him.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49554, 'enUS', 'Yo! Do I have an explosive proposition for you, pal....', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49555, 'enUS', 'The Valiance Expedition is ready to strike at the heart of the Scourge, $C. Are you up to the challenge?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49556, 'enUS', 'Our role is of utmost importance, $n.$B$BAdmiral Taylor and his flagship have gone missing.... More importantly, the young Prince was with him, and it is our primary objective to bring him back home safely.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49557, 'enUS', 'You seem like someone who needs some excitement in their life. Excitement... and beer!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49558, 'enUS', 'What the dook is going on here, $R?!$B$BWhy are pandaren so sad?!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49559, 'enUS', 'Traveling to Kun-Lai? Right this way, wanderer, right this way!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49560, 'enUS', 'Welcome to Townlong Steppes, outsider.$B$BIf you insist on wandering in to the darkest places of Pandaria then far be it from me to not put you to good use.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49561, 'enUS', 'A volunteer for Dread Wastes duty? I think you might be the first.$B$BPleased to meet you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49564, 'enUS', 'Welcome to Gorgrond, commander.$B$BWe have just arrived ourselves.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49565, 'enUS', 'It is good to see you, Commander $n. I require your advisement.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49566, 'enUS', '<Azik looks you up and down.>$B$BAzik is betting you are someone of importance to your people.$B$BCome closer, friend. Azik could use your help.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49567, 'enUS', 'They came at us... from... nowhere.$B$B<The lieutenant nearly passes out.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49613, 'enUS', 'Good, we\'re all here. Our guests should be arriving shortly.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49614, 'enUS', 'You return with good news, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49698, 'enUS', 'Welcome, $n. You are about to bear witness to a ritual none but members of the Army of the Light have seen.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49756, 'enUS', 'A fine kill, $n. My people can clean up from here.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49772, 'enUS', 'What have we here? One of the famed Lightforged draenei! Welcome, welcome.$B$BThank you for your service against the Legion, $n. Truly an inspiration!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49773, 'enUS', 'Are you the new one? I\'m supposed to welcome you. Here, take this letter.$B$B<Blackguard lets out an exasperated sigh.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49782, 'enUS', 'Duty. Honor. Sacrifice. The Lightforged strive to embody these qualities. You have done so with aplomb.$B$BIt is my pleasure to award you with a symbol of your service, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49783, 'enUS', 'You have brought great honor to our tribes, $n. It is fitting that we give you a symbol of our thanks.$B$BHighmountain stands... because you have the courage to fight for it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49784, 'enUS', 'When we were liberated from the Legion, some among the shal\'dorei believed we should remain isolated. Alone.$B$BYour accomplishments in Azeroth have shown that we made the right decision in reclaiming our place in this world. It pleases me to honor you with this symbol of Suramar\'s gratitude.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49787, 'enUS', 'Umbric\'s methods are a bit cavalier, but he seems competent. We must get to him before things become too dangerous.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49788, 'enUS', 'Ah, there you are, $n! We\'ve been inspecting--err--expecting you!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49812, 'enUS', 'Goddess be praised that you are here, $n. I\'m hoping that you can aid me.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49851, 'enUS', 'Ah, $n. Thank you for responding to my request.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49852, 'enUS', 'Lok\'tar, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49855, 'enUS', 'We knew the Horde would send help and not a moment too soon!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49865, 'enUS', 'Ah, $n. Thank you for responding to my request.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49866, 'enUS', 'Greetings, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49928, 'enUS', 'Though some continue to doubt us, your deeds have proven that the ren\'dorei serve the Alliance with honor.$B$BYour will is strong, $n. Accept this gift as a symbol of the powers you command.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49929, 'enUS', 'Welcome, $n. I am pleased you answered the call.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49930, 'enUS', 'Ah, $n. Now we can begin.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49933, 'enUS', 'Are you the new one? I\'m supposed to welcome you. Here, take this letter.$B$B<Blackguard lets out an exasperated sigh.>', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49973, 'enUS', 'The city of Suramar is beautiful to behold. I hope Silvermoon City is not a disappointment to them.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49976, 'enUS', 'If this strange substance is as powerful as it appears to be, we cannot allow it to fall into the wrong hands. Your presence will be needed in Silithus.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49977, 'enUS', 'About time you arrived, $n. The very future of the Horde may depend on what I am about to tell you...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49981, 'enUS', 'Well met, $n. It\'s good to have someone of your renown here with us in Silithus.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (49982, 'enUS', 'Greetings, $n. I was told you\'d be coming. The mining operation is currently underway.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50046, 'enUS', 'Great work, $n! With the shredders sabotaged, the Bilgewater Cartel mining operation will grind to a halt!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50047, 'enUS', 'I\'ve never seen anythin\' like this before... I\'ll get to work examinin\' it at once!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50048, 'enUS', 'You made it back alive. That\'s good news, indeed! I trust the expedition went well?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50049, 'enUS', 'Thank you for delivering Khadgar\'s letter ta me. I\'m goin\' ta need some time ta consider his words. If what he says is correct, we may be able ta save Azeroth... but at a great cost.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50052, 'enUS', 'You did well, $n... Crisis averted! But we better keep an eye out for reinforcements.$B$BIf this stuff is as valuable as Gallywix says it is, the Alliance is going to be all over this place in no time!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50053, 'enUS', 'Hmmpf! I hope you didn\'t go easy on them. If it were up to me they\'d be getting more than a simple beating!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50054, 'enUS', 'I\'m pleased to see that you made it back alive. I\'m sure you fought with honor!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50055, 'enUS', 'Thank you for delivering Khadgar\'s letter ta me. I\'m goin\' ta need some time ta consider his words. If what he says is correct, we may be able ta save Azeroth... but at a great cost.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50071, 'enUS', 'The stories of the Lightforged echo throughout the streets of Stormwind. An army of elite soldiers dedicated to fighting the Legion... they will be one of our strongest allies.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50130, 'enUS', 'Thank you for helping the people of Sporeggar, $R. You are always welcomed here.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50131, 'enUS', 'Thank you, $n! Thank you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50226, 'enUS', 'Oh! Look at these big, beautiful brains! I can\'t wait to dig in... thanks for your help, $n! You can stay and watch if you want, but it may get a bit messy!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50227, 'enUS', 'I see you have the broodlings! These will do nicely. Would you like to stay and watch me carefully dissect and catalog every detail of their anatomy?', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50228, 'enUS', 'I see you have brought the head of Michiel Voidstrider. A gruesome task, but a necessary one. The Alliance thanks you for your service, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50229, 'enUS', 'Aye! This\'ll do nicely! Just give us a wee minute here...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50230, 'enUS', 'Holy moly! Look at the size of these big, beautiful brains! Where\'s my scalpel?! Wait... no... bring me the electric hacksaw. It\'s time for the big guns baby!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50231, 'enUS', 'You\'ve got the larvae! These are gonna make us a boatload o\' money! I can already hear the gold jinglin\' in my pockets!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50232, 'enUS', 'I see you have brought the head of Michiel Voidstrider. It will look glorious mounted on a spike! The Horde thanks you for your service, $n.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50239, 'enUS', 'Your wisdom is always appreciated, $n. The choice you make today will strengthen the Alliance.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50242, 'enUS', 'I have come to value your wisdom, $n. The choice you make today will strengthen the Horde.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50247, 'enUS', 'Well done! $B$BIs it not fulfilling? To see each letter safely to its destination?$B$BCome by and help any time!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50303, 'enUS', 'So this is Orgrimmar. The orcs have made some... interesting aesthetic choices. Be careful of the spikes, $n.$B$BAnd the smells. So many smells.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50305, 'enUS', 'Welcome to Stormwind. Though it is no Silvermoon, the city does have its charms.$B$BIf you came here expecting a warm welcome, I cannot say I have received one myself. But most folk are polite enough.$B$BNo matter. I am off to seek adventure! And perhaps a stiff drink.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50313, 'enUS', 'Welcome to this beautiful city, $n. I am sure you will feel as welcome by the other members of the Alliance as I do.$B$BI have met a number of the city guards. Good people, though there are a few things they could learn from us.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50318, 'enUS', 'We\'re behind schedule - let\'s get moving.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50319, 'enUS', 'So many tauren! I think I\'ve seen more tauren since I got here than in my entire life in Highmountain.$B$BThey all ask to touch my antlers. It\'s weird at first, but now I kind of like it.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50335, 'enUS', 'The uprising quelled, the elements calmed, and Hogger slain... I cannot thank you enough, $n. My people have been avenged.$B$BThank you.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50336, 'enUS', 'I\'d love for you to come aboard as a full G-Team Commando, but our bylaws specifically prohibit Horde team members; however, I CAN enroll you in the G-Team Fan Club!$B$BHere\'s something for your trouble.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50337, 'enUS', 'Took you long enough. Get behind the pillar before you blow our cover!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50338, 'enUS', 'The mission is far from over!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50341, 'enUS', 'The Dark Lady has given orders that you are to personally oversee the operation in Silithus.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50358, 'enUS', 'You\'re here to collect the samples? It\'s about time they sent someone to help me out!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50360, 'enUS', 'It\'s good to see you, $n. I suspect that my welcome among the Horde is wearing thin...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50364, 'enUS', 'The blood of Azeroth? Hmph.$B$BI\'ll make sure this news reaches the warchief, but this operation must continue until I\'m ordered to cease!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50371, 'enUS', 'At last you have arrived, $n. The very future of the Alliance may depend on what I am about to tell you...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50372, 'enUS', 'You\'re here to collect the samples? Let\'s get started!', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50373, 'enUS', 'It\'s good to see you, $n. I wish that I were here under more pleasant circumstances...', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50374, 'enUS', 'The blood of Azeroth? I\'ll make sure this news reaches Stormwind, but I must continue the operation until I am ordered otherwise.', 0);
INSERT INTO `quest_offer_reward_locale` VALUES (50432, 'enUS', 'Spectacular! Marvelous! At last, I understand fully, and the titans themselves speak to me! They have shown me how to use the essences to craft the finest armors the world has ever seen, though I think the results may be... somewhat unpredictable.$B$B<Vridiel beams with pride.>$B$BWell, what are you waiting for? Bring me as many Wakening Essence as you can find!', 0);
